NTGreekWord.create({strong_id: 796, form: "ἀστραπή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "astrapé", phonetic_spelling: "(as-trap-ay')", short_definition: "a flash of lightning, brightness, luster", medium_definition: "a flash of lightning, brightness, luster.", long_definition: " from astraptw - astrapto <a>797</a>; lightning; by analogy, glare:--lightning, bright shining." })
NTGreekWord.create({strong_id: 797, form: "ἀστράπτω", pos: "Verb", transliteration: "astraptó", phonetic_spelling: "(as-trap'-to)", short_definition: "I flash, am lustrous", medium_definition: "I flash (with, then like, lightning), am lustrous.", long_definition: " probably from asthr - aster <a>792</a>; to flash as lightning:--lighten, shine." })
NTGreekWord.create({strong_id: 798, form: "ἄστρον, ου, τό", pos: "Noun, Neuter", transliteration: "astron", phonetic_spelling: "(as'-tron)", short_definition: "a star", medium_definition: "a star.", long_definition: " neuter from asthr - aster <a>792</a>; properly, a constellation; put for a single star (natural or artificial):--star." })
NTGreekWord.create({strong_id: 799, form: "Ἀσύγκριτος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Asugkritos", phonetic_spelling: "(as-oong'-kree-tos)", short_definition: "Asyncritus", medium_definition: "Asyncritus, a Christian in Rome.", long_definition: " from a - a <a>4793</a>; incomparable; Asyncritus, a Christian:--Asyncritos." })
NTGreekWord.create({strong_id: 800, form: "ἀσύμφωνος, ον", pos: "Adjective", transliteration: "asumphónos", phonetic_spelling: "(as-oom'-fo-nos)", short_definition: "dissonant, discordant", medium_definition: "dissonant, discordant; met: at variance.", long_definition: " from a - a <a>4859</a>; inharmonious (figuratively):--agree not." })
NTGreekWord.create({strong_id: 801, form: "ἀσύνετος, ον", pos: "Adjective", transliteration: "asunetos", phonetic_spelling: "(as-oon'-ay-tos)", short_definition: "unintelligent, unwise, undiscerning", medium_definition: "unintelligent, without wisdom, unwise, undiscerning (implying probably moral defect).", long_definition: " from a - a <a>4908</a>; unintelligent; by implication, wicked:--foolish, without understanding." })
NTGreekWord.create({strong_id: 802, form: "ἀσύνθετος, ον", pos: "Adjective", transliteration: "asunthetos", phonetic_spelling: "(as-oon'-thet-os)", short_definition: "untrue to an agreement, treacherous", medium_definition: "not covenanting, untrue to an agreement, treacherous.", long_definition: " from a - a <a>4934</a>; properly, not agreed, i.e. treacherous to compacts:-- covenant-breaker." })
NTGreekWord.create({strong_id: 803, form: "ἀσφάλεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "asphaleia", phonetic_spelling: "(as-fal'-i-ah)", short_definition: "safety, security, reliability", medium_definition: "safety, security, reliability, firmness.", long_definition: " from asfalhV - asphales <a>804</a>; security (literally or figuratively):--certainty, safety." })
NTGreekWord.create({strong_id: 804, form: "ἀσφαλής, ές", pos: "Adjective", transliteration: "asphalés", phonetic_spelling: "(as-fal-ace')", short_definition: "safe, reliable, trustworthy", medium_definition: "(lit: unfailing), safe, reliable, trustworthy, certain, sure.", long_definition: " from a - a <a>1</a> (as a negative particle) and sphallo (to \"fail\"); secure (literally or figuratively):--certain(-ty), safe, sure." })
NTGreekWord.create({strong_id: 805, form: "ἀσφαλίζω", pos: "Verb", transliteration: "asphalizó", phonetic_spelling: "(as-fal-id'-zo)", short_definition: "I make safe", medium_definition: "I make safe (secure, fast).", long_definition: " from asfalhV - asphales <a>804</a>; to render secure:--make fast (sure)." })
NTGreekWord.create({strong_id: 806, form: "ἀσφαλῶς", pos: "Adverb", transliteration: "asphalós", phonetic_spelling: "(as-fal-oce')", short_definition: "safely, securely, assuredly", medium_definition: "safely, securely, assuredly, certainly.", long_definition: " adverb from asfalhV - asphales <a>804</a>; securely (literally or figuratively):--assuredly, safely." })
