NTGreekWord.create({strong_id: 809, form: "ἀσχήμων, ον", pos: "Adjective", transliteration: "aschémón", phonetic_spelling: "(as-kay'-mone)", short_definition: "unseemly, indecent", medium_definition: "unseemly, indecent.", long_definition: " from a - a <a>2192</a> (in the sense of its congener 4976); properly, shapeless, i.e. (figuratively) inelegant:--uncomely." })
NTGreekWord.create({strong_id: 810, form: "ἀσωτία, ας, ἡ", pos: "Noun, Feminine", transliteration: "asótia", phonetic_spelling: "(as-o-tee'-ah)", short_definition: "wantonness, profligacy", medium_definition: "wantonness, profligacy, wastefulness.", long_definition: " from a compound of a - a <a>4982</a>; properly, unsavedness, i.e. (by implication) profligacy:--excess, riot." })
NTGreekWord.create({strong_id: 811, form: "ἀσώτως", pos: "Adverb", transliteration: "asótós", phonetic_spelling: "(as-o'-toce)", short_definition: "prodigally, with prodigal living", medium_definition: "prodigally, with prodigal living, wastefully.", long_definition: " adverb from the same as aswtia - asotia <a>810</a>; dissolutely:--riotous." })
