NTGreekWord.create({strong_id: 814, form: "ἀτάκτως", pos: "Adverb", transliteration: "ataktós", phonetic_spelling: "(at-ak'-toce)", short_definition: "in a disorderly manner", medium_definition: "in a disorderly manner, irregularly.", long_definition: " adverb from ataktoV - ataktos <a>813</a>, irregularly (morally):--disorderly." })
NTGreekWord.create({strong_id: 815, form: "ἄτεκνος, ον", pos: "Adjective", transliteration: "ateknos", phonetic_spelling: "(at'-ek-nos)", short_definition: "childless", medium_definition: "childless.", long_definition: " from a - a <a>5043</a>; childless:--childless, without children." })
