NTGreekWord.create({strong_id: 817, form: "ἄτερ", pos: "Preposition", transliteration: "ater", phonetic_spelling: "(at'-er)", short_definition: "apart from, without", medium_definition: "apart from, without.", long_definition: " a particle probably akin to aneu - aneu <a>427</a>; aloof, i.e. apart from (literally or figuratively):--in the absence of, without." })
NTGreekWord.create({strong_id: 818, form: "ἀτιμάζω", pos: "Verb", transliteration: "atimazó", phonetic_spelling: "(at-im-ad'-zo)", short_definition: "I disgrace, dishonor", medium_definition: "I disgrace, treat disgracefully, dishonor, insult; I despise.", long_definition: " from atimoV - atimos <a>820</a>; to render infamous, i.e. (by implication) contemn or maltreat:--despise, dishonour, suffer shame, entreat shamefully." })
