NTGreekWord.create({strong_id: 824, form: "ἄτοπος, ον", pos: "Adjective", transliteration: "atopos", phonetic_spelling: "(at'-op-os)", short_definition: "improper, unrighteous, perverse", medium_definition: "(lit: out of place, unusual, unbecoming), improper, unrighteous, perverse.", long_definition: " from a - a <a>5117</a>; out of place, i.e. (figuratively) improper, injurious, wicked:--amiss, harm, unreasonable." })
NTGreekWord.create({strong_id: 825, form: "Ἀττάλεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "Attaleia", phonetic_spelling: "(at-tal'-i-ah)", short_definition: "Attalia", medium_definition: "Attalia, the port of Perga in Pamphylia.", long_definition: " from Attalos (a king of Pergamus); Attaleia, a place in Pamphylia:--Attalia." })
