NTGreekWord.create({strong_id: 845, form: "αὐτόπτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "autoptés", phonetic_spelling: "(ow-top'-tace)", short_definition: "an eye-witness", medium_definition: "an eye-witness.", long_definition: " from autoV - autos <a>3700</a>; self-seeing, i.e. an eye-witness:--eye-witness." })
NTGreekWord.create({strong_id: 846, form: "αὐτός, αὐτή, αὐτό", pos: "Personal Pronoun", transliteration: "autos", phonetic_spelling: "(ow-tos')", short_definition: "he, she, it, they, them, same", medium_definition: "he, she, it, they, them, same.", long_definition: " from the particle au (perhaps akin to the base of ahr - aer <a>848</a>." })
