NTGreekWord.create({strong_id: 849, form: "αὐτόχειρ, ρος, ὁ", pos: "Adjective", transliteration: "autocheir", phonetic_spelling: "(ow-tokh'-ire)", short_definition: "with one's own hand", medium_definition: "with one's own hand.", long_definition: " from autoV - autos <a>5495</a>; self-handed, i.e. doing personally:--with ... own hands." })
NTGreekWord.create({strong_id: 850, form: "αὐχμηρός, ά, όν", pos: "Adjective", transliteration: "auchmeros", phonetic_spelling: "(owkh-may-ros')", short_definition: "dingy, dusky, obscure, dark, funereal", medium_definition: "(poetical, lit: dry and parched; then: squalid and rough), dingy, murky, obscure, dark, funereal.", long_definition: " from auchmos (probably from a base akin to that of 109) (dust, as dried by wind); properly, dirty, i.e. (by implication) obscure:--dark." })
NTGreekWord.create({strong_id: 851, form: "ἀφαιρέω", pos: "Verb", transliteration: "aphaireó", phonetic_spelling: "(af-ahee-reh'-o)", short_definition: "I take away, smite off", medium_definition: "I take away, smite off.", long_definition: " from apo - apo <a>138</a>; to remove (literally or figuratively):--cut (smite) off, take away." })
NTGreekWord.create({strong_id: 852, form: "ἀφανής, ές", pos: "Adjective", transliteration: "aphanés", phonetic_spelling: "(af-an-ace')", short_definition: "invisible", medium_definition: "invisible, unseen, hidden.", long_definition: " from a - a <a>5316</a>; non-apparent):--that is not manifest." })
