NTGreekWord.create({strong_id: 855, form: "ἄφαντος, ον", pos: "Adjective", transliteration: "aphantos", phonetic_spelling: "(af'-an-tos)", short_definition: "disappearing, invisible, hidden", medium_definition: "disappearing, invisible, hidden.", long_definition: " from a - a <a>5316</a>; non-manifested, i.e. invisible:--vanished out of sight." })
NTGreekWord.create({strong_id: 856, form: "ἀφεδρών, ῶνος, ὁ", pos: "Noun, Masculine", transliteration: "aphedrón", phonetic_spelling: "(af-ed-rone')", short_definition: "a drain, latrine", medium_definition: "a drain, latrine.", long_definition: " from a compound of apo - apo <a>1476</a>; a place of sitting apart, i.e. a privy:--draught." })
