NTGreekWord.create({strong_id: 858, form: "ἀφελότης, τητος, ἡ", pos: "Noun, Feminine", transliteration: "aphelotés", phonetic_spelling: "(af-el-ot'-ace)", short_definition: "simplicity, sincerity", medium_definition: "simplicity, sincerity.", long_definition: " from a compound of a - a <a>1</a> (as a negative particle) and phellos (in the sense of a stone as stubbing the foot); smoothness, i.e. (figuratively) simplicity:--singleness." })
