NTGreekWord.create({strong_id: 861, form: "ἀφθαρσία, ας, ἡ", pos: "Noun, Feminine", transliteration: "aphtharsia", phonetic_spelling: "(af-thar-see'-ah)", short_definition: "indestructibility, incorruptibility, immortality", medium_definition: "indestructibility, incorruptibility; hence: immortality.", long_definition: " from afqartoV - aphthartos <a>862</a>; incorruptibility; genitive, unending existence; (figuratively) genuineness:--immortality, incorruption, sincerity." })
