NTGreekWord.create({strong_id: 863, form: "ἀφίημι", pos: "Verb", transliteration: "aphiémi", phonetic_spelling: "(af-ee'-ay-mee)", short_definition: "I send away, release, remit, forgive, permit", medium_definition: "(a) I send away, (b) I let go, release, permit to depart, (c) I remit, forgive, (d) I permit, suffer.", long_definition: " from apo - apo <a>575</a> and hiemi (to send; an intensive form of eimi, to go); to send forth, in various applications (as follow):--cry, forgive, forsake, lay aside, leave, let (alone, be, go, have), omit, put (send) away, remit, suffer, yield up." })
NTGreekWord.create({strong_id: 864, form: "ἀφικνέομαι", pos: "Verb", transliteration: "aphikneomai", phonetic_spelling: "(af-ik-neh'-om-ahee)", short_definition: "I arrive at, reach", medium_definition: "I arrive at, reach, come to.", long_definition: " from apo - apo <a>2425</a>; to go (i.e. spread) forth (by rumor):--come abroad." })
