NTGreekWord.create({strong_id: 869, form: "ἄφνω", pos: "Adverb", transliteration: "aphnó", phonetic_spelling: "(af'-no)", short_definition: "suddenly", medium_definition: "suddenly.", long_definition: " adverb from afanhV - aphanes <a>852</a> (contraction); unawares, i.e. unexpectedly:--suddenly." })
