NTGreekWord.create({strong_id: 893, form: "ἀψευδής, ές", pos: "Adjective", transliteration: "apseudés", phonetic_spelling: "(aps-yoo-dace')", short_definition: "not guilty of falsehood, truthful", medium_definition: "not guilty of falsehood, truthful.", long_definition: " from a - a <a>5579</a>; veracious:--that cannot lie." })
