NTGreekWord.create({strong_id: 905, form: "βαλάντιον, ου, τό", pos: "Noun, Neuter", transliteration: "ballantion", phonetic_spelling: "(bal-an'-tee-on)", short_definition: "a purse, money-bag", medium_definition: "a purse, money-bag.", long_definition: " probably remotely from ballw - ballo <a>906</a> (as a depository); a pouch (for money):--bag, purse." })
NTGreekWord.create({strong_id: 906, form: "βάλλω", pos: "Verb", transliteration: "balló", phonetic_spelling: "(bal'-lo)", short_definition: "I cast, throw, rush, put, place, drop", medium_definition: "(a) I cast, throw, rush, (b) often, in the weaker sense: I place, put, drop.", long_definition: " a primary verb; to throw (in various applications, more or less violent or intense):--arise, cast (out), X dung, lay, lie, pour, put (up), send, strike, throw (down), thrust. Compare riptw - rhipto <a>4496</a>." })
