NTGreekWord.create({strong_id: 910, form: "βαπτιστής, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "baptistés", phonetic_spelling: "(bap-tis-tace')", short_definition: "the baptizer, the Baptist", medium_definition: "the baptizer, the Baptist, epithet used only of John, the son of Zechariah and Elizabeth, forerunner of Jesus.", long_definition: " from baptizw - baptizo <a>907</a>; a baptizer, as an epithet of Christ's forerunner:--Baptist." })
NTGreekWord.create({strong_id: 911, form: "βάπτω", pos: "Verb", transliteration: "baptó", phonetic_spelling: "(bap'-to)", short_definition: "I dip, dye", medium_definition: "(a) I dip, (b) I dye.", long_definition: " a primary verb; to whelm, i.e. cover wholly with a fluid; in the New Testament only in a qualified or special sense, i.e. (literally) to moisten (a part of one's person), or (by implication) to stain (as with dye):--dip." })
NTGreekWord.create({strong_id: 912, form: "Βαραββᾶς, ᾶ, ὁ", pos: "Noun, Masculine", transliteration: "Barabbas", phonetic_spelling: "(bar-ab-bas')", short_definition: "Barabbas", medium_definition: "Barabbas.", long_definition: " of Chaldee origin (1347 and 'Abagtha' <a>5</a>; son of Abba; Bar-abbas, an Israelite:--Barabbas." })
NTGreekWord.create({strong_id: 913, form: "Βαράκ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Barak", phonetic_spelling: "(bar-ak')", short_definition: "Barak", medium_definition: "Barak, one of the judges of Israel.", long_definition: " of Hebrew origin (Baraq <a>1301</a>; Barak, an Israelite:--Barak." })
