NTGreekWord.create({strong_id: 2201, form: "ζεῦγος, ους, τό", pos: "Noun, Neuter", transliteration: "zeugos", phonetic_spelling: "(dzyoo'-gos)", short_definition: "a yoke, team, pair", medium_definition: "a yoke, team; hence: a pair.", long_definition: " from the same as zugoV - zugos <a>2218</a>; a couple, i.e. a team (of oxen yoked together) or brace (of birds tied together):--yoke, pair." })
NTGreekWord.create({strong_id: 2202, form: "ζευκτηρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "zeuktéria", phonetic_spelling: "(dzook-tay-ree'-ah)", short_definition: "a band, fastening", medium_definition: "a band, fastening.", long_definition: " feminine of a derivative (at the second stage) from the same as zugoV - zugos <a>2218</a>; a fastening (tiller-rope):--band." })
NTGreekWord.create({strong_id: 2203, form: "Ζεύς, Διός, Δία (acc.), ὁ", pos: "Noun, Masculine", transliteration: "Zeus", phonetic_spelling: "(dzyooce)", short_definition: "Zeus", medium_definition: "Zeus, the Greek god of the sky in all its manifestations, corresponding to the Roman Jupiter and to the leading god of the native Lycaonians.", long_definition: " of uncertain affinity; in the oblique cases there is used instead of it a (probably cognate) name     Dis  deece, which is otherwise obsolete     Zeus or Dis (among the Latins, Jupiter or Jove), the supreme deity of the Greeks:--Jupiter." })
NTGreekWord.create({strong_id: 2204, form: "ζέω", pos: "Verb", transliteration: "zeó", phonetic_spelling: "(dzeh'-o)", short_definition: "I burn in spirit", medium_definition: "(lit: I boil, am boiling), I burn (in spirit), am fervent.", long_definition: " a primary verb; to be hot (boil, of liquids; or glow, of solids), i.e. (figuratively) be fervid (earnest):--be fervent." })
NTGreekWord.create({strong_id: 2205, form: "ζῆλος, ου, ὁ", pos: "Noun, Masculine; Noun, Neuter", transliteration: "zelos", phonetic_spelling: "(dzay'-los)", short_definition: "eagerness, zeal, rivalry", medium_definition: "(a) eagerness, zeal, enthusiasm, (b) jealousy, rivalry.", long_definition: " from zew - zeo <a>2204</a>; properly, heat, i.e. (figuratively) \"zeal\" (in a favorable sense, ardor; in an unfavorable one, jealousy, as of a husband (figuratively, of God), or an enemy, malice):--emulation, envy(-ing), fervent mind, indignation, jealousy, zeal." })
NTGreekWord.create({strong_id: 2206, form: "ζηλόω", pos: "Verb", transliteration: "zéloó", phonetic_spelling: "(dzay-lo'-o)", short_definition: "I am jealous, eager for", medium_definition: "(a) intrans: I am jealous, (b) trans: I am jealous of, with acc. of a person; I am eager for, am eager to possess, with acc. of a thing.", long_definition: " from zhloV - zelos <a>2205</a>; to have warmth of feeling for or against:--affect, covet (earnestly), (have) desire, (move with) envy, be jealous over, (be) zealous(-ly affect)." })
NTGreekWord.create({strong_id: 2207, form: "ζηλωτής, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "zélótés", phonetic_spelling: "(dzay-lo-tace')", short_definition: "a zealot", medium_definition: "one who is eagerly devoted to a person or a thing, a zealot.", long_definition: " from zhlow - zeloo <a>2206</a>; a \"zealot\":--zealous." })
