NTGreekWord.create({strong_id: 2209, form: "ζημία, ας, ἡ", pos: "Noun, Feminine", transliteration: "zémia", phonetic_spelling: "(dzay-mee'-ah)", short_definition: "damage, loss", medium_definition: "damage, loss, detriment.", long_definition: " probably akin to the base of damazw - damazo <a>1150</a> (through the idea of violence); detriment:--damage, loss." })
