NTGreekWord.create({strong_id: 2260, form: "ἤπερ", pos: "Particle, Disjunctive Particle", transliteration: "éper", phonetic_spelling: "(ay'-per)", short_definition: "than", medium_definition: "than.", long_definition: " of uncertain affinity; at which time:--when." })
NTGreekWord.create({strong_id: 2261, form: "ἤπιος, α, ον", pos: "Adjective", transliteration: "épios", phonetic_spelling: "(ay'-pee-os)", short_definition: "placid, gentle", medium_definition: "placid, gentle, mild.", long_definition: " from h - e <a>4007</a>; than at all (or than perhaps, than indeed):--than." })
NTGreekWord.create({strong_id: 2262, form: "Ἤρ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Er", phonetic_spelling: "(ayr)", short_definition: "Er", medium_definition: "Er, son of Joshua and father of Elmadam.", long_definition: " probably from epoV - epos <a>2031</a>; properly, affable, i.e. mild or kind:--gentle." })
NTGreekWord.create({strong_id: 2263, form: "ἤρεμος, ον", pos: "Adjective", transliteration: "éremos", phonetic_spelling: "(ay'-rem-os)", short_definition: "quiet, tranquil", medium_definition: "quiet, tranquil.", long_definition: " of Hebrew origin (`Er <a>6147</a>; Er, an Israelite:--Er." })
NTGreekWord.create({strong_id: 2264, form: "Ἡρῴδης, ου, ὁ", pos: "Noun, Masculine", transliteration: "Héródés", phonetic_spelling: "(hay-ro'-dace)", short_definition: "Herod", medium_definition: "Herod; four persons are called by this name: Herod the Great, Herod Antipas, Herod Agrippa, and Herod Agrippa the younger.", long_definition: " perhaps by transposition from erhmoV - eremos <a>2048</a> (through the idea of stillness); tranquil:--quiet." })
NTGreekWord.create({strong_id: 2265, form: "Ἡρῳδιανοί, ῶν, οἱ", pos: "Noun, Masculine", transliteration: "Héródianoi", phonetic_spelling: "(hay-ro-dee-an-oy')", short_definition: "the Herodians, the partisans of Herod Antipas", medium_definition: "the Herodians, the partisans of Herod (Antipas).", long_definition: " compound of heros (a \"hero\") and eidoV - eidos <a>1491</a>; heroic; Herod, the name of four Jewish kings:--Herod." })
NTGreekWord.create({strong_id: 2266, form: "Ἡρῳδιάς, άδος, ἡ", pos: "Noun, Feminine", transliteration: "Héródias", phonetic_spelling: "(hay-ro-dee-as')", short_definition: "Herodias", medium_definition: "Herodias (died after A.D. 40), daughter of Aristobulus and granddaughter of Herod I, wife, first, of her uncle Herod, second, of his half-brother, her uncle Herod Antipas.", long_definition: " plural of a derivative of hrwdhV - Herodes <a>2264</a>; Herodians, i.e. partisans of Herod:--Herodians." })
NTGreekWord.create({strong_id: 2267, form: "Ἡρῳδίων, ωνος, ὁ", pos: "Noun, Masculine", transliteration: "Héródión", phonetic_spelling: "(hay-ro-dee'-ohn)", short_definition: "Herodion", medium_definition: "Herodion, a Christian in Rome, a relative of Paul.", long_definition: " from hrwdhV - Herodes <a>2264</a>; Herodias, a woman of the Heodian family:--Herodias." })
NTGreekWord.create({strong_id: 2268, form: "Ἠσαΐας, ου, ὁ", pos: "Noun, Masculine", transliteration: "Esaias", phonetic_spelling: "(hay-sah-ee'-as)", short_definition: "Isaiah", medium_definition: "Isaiah, the prophet.", long_definition: " from hrwdhV - Herodes <a>2264</a>; Herodion, a Christian:--Herodion." })
NTGreekWord.create({strong_id: 2269, form: "Ἠσαῦ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Esau", phonetic_spelling: "(ay-sow')", short_definition: "Esau", medium_definition: "Esau, elder son of Isaac the patriarch, brother of Jacob.", long_definition: " of Hebrew origin (Ysha`yah <a>3470</a>; Hesaias (i.e. Jeshajah), an Israelite:--Esaias." })
NTGreekWord.create({strong_id: 2270, form: "ἡσυχάζω", pos: "Verb", transliteration: "hésuchazó", phonetic_spelling: "(hay-soo-khad'-zo)", short_definition: "I rest, am silent, live quietly", medium_definition: "I rest from work, cease from altercation, am silent, live quietly.", long_definition: " of Hebrew origin (`Esav <a>6215</a>; Esau, an Edomite:--Esau." })
NTGreekWord.create({strong_id: 2271, form: "ἡσυχία, ας, ἡ", pos: "Noun, Feminine", transliteration: "hésuchia", phonetic_spelling: "(hay-soo-khee'-ah)", short_definition: "quietness, silence", medium_definition: "quietness, stillness, silence.", long_definition: " from the same as hsucioV - hesuchios <a>2272</a>; to keep still (intransitively), i.e. refrain from labor, meddlesomeness or speech:--cease, hold peace, be quiet, rest." })
NTGreekWord.create({strong_id: 2272, form: "ἡσύχιος, α, ον", pos: "Adjective", transliteration: "hésuchios", phonetic_spelling: "(hay-soo'-khee-os)", short_definition: "quiet, tranquil", medium_definition: "quiet, tranquil, peaceful.", long_definition: " feminine of hsucioV - hesuchios <a>2272</a>; (as noun) stillness, i.e. desistance from bustle or language:--quietness, silence." })
NTGreekWord.create({strong_id: 2273, form: "ἤτοι", pos: "Conjunction", transliteration: "étoi", phonetic_spelling: "(ay'-toy)", short_definition: "or of course", medium_definition: "whether.", long_definition: " a prolonged form of a compound probably of a derivative of the base of edraioV - hedraios <a>2192</a>; properly, keeping one's seat (sedentary), i.e. (by implication) still (undisturbed, undisturbing):--peaceable, quiet." })
NTGreekWord.create({strong_id: 2274, form: "ἡττάομαι", pos: "Verb", transliteration: "héttaomai", phonetic_spelling: "(hayt-tah'-o)", short_definition: "I am defeated, made inferior", medium_definition: "I am defeated, am overcome, am made inferior.", long_definition: " from h - e <a>5104</a>; either indeed:--whether." })
NTGreekWord.create({strong_id: 2275, form: "ἥττημα, ατος, τό", pos: "Noun, Neuter", transliteration: "héttéma", phonetic_spelling: "(hayt'-tay-mah)", short_definition: "a defeat, failure", medium_definition: "defect, loss, defeat, failure, shortcoming.", long_definition: " from the same as htton - hetton <a>2276</a>; to make worse, i.e. vanquish (literally or figuratively); by implication, to rate lower:--be inferior, overcome." })
NTGreekWord.create({strong_id: 2276, form: "ἧττων, ον", pos: "Adjective", transliteration: "héttón", phonetic_spelling: "(hate'-ton)", short_definition: "lesser, inferior, weaker", medium_definition: "lesser, inferior, weaker.", long_definition: " from httaw - hettao <a>2274</a>; a deterioration, i.e. (objectively) failure or (subjectively) loss:--diminishing, fault." })
NTGreekWord.create({strong_id: 2277, form: "ἤτω", pos: "étó", transliteration: "(ay'-to)", phonetic_spelling: "be", short_definition: "imper. of ", medium_definition: ", q.v.", long_definition: " neuter of comparative of heka (slightly) used for that of kakoV - kakos <a>2556</a>; worse (as noun); by implication, less (as adverb):--less, worse." })
NTGreekWord.create({strong_id: 2278, form: "ἠχέω", pos: "Verb", transliteration: "écheó", phonetic_spelling: "(ay-kheh'-o)", short_definition: "I make a sound, sound when struck", medium_definition: "I make a sound, give forth a sound, sound (when struck); I roar (as the sea).", long_definition: " third person singular imperative of eimi - eimi <a>1510</a>; let him (or it) be:--let ... be." })
NTGreekWord.create({strong_id: 2279, form: "ἦχος, ου, ὁ", pos: "Noun, Masculine", transliteration: "échos", phonetic_spelling: "(ay'-khos)", short_definition: "a sound, rumor", medium_definition: "(a) a sound, noise, (b) a rumor, report.", long_definition: " from hcoV - echos <a>2279</a>; to make a loud noise, i.e. reverberate:--roar, sound." })
NTGreekWord.create({strong_id: 2280, form: "Θαδδαῖος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Thaddaios", phonetic_spelling: "(thad-dah'-yos)", short_definition: "Thaddaeus", medium_definition: "Thaddaeus, one of the twelve apostles.", long_definition: " of uncertain affinity; a loud or confused noise (\"echo\"), i.e. roar; figuratively, a rumor:--fame, sound." })
NTGreekWord.create({strong_id: 2281, form: "θάλασσα, ης, ἡ", pos: "Noun, Feminine", transliteration: "thalassa", phonetic_spelling: "(thal'-as-sah)", short_definition: "the sea, lake", medium_definition: "(a) the sea, in contrast to the land, (b) a particular sea or lake, e.g. the sea of Galilee (Tiberias), the Red Sea.", long_definition: "" })
NTGreekWord.create({strong_id: 2282, form: "θάλπω", pos: "Verb", transliteration: "thalpó", phonetic_spelling: "(thal'-po)", short_definition: "I cherish, nourish", medium_definition: "(properly: I warm, then) I cherish, nourish, foster, comfort.", long_definition: " of uncertain origin; Thaddaeus, one of the Apostles:--Thaddaeus." })
NTGreekWord.create({strong_id: 2283, form: "Θάμαρ, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Thamar", phonetic_spelling: "(tham'-ar)", short_definition: "Tamar", medium_definition: "Tamar, mother of Perez and Zerah by Judah, son of Jacob.", long_definition: " probably prolonged from alV - hals <a>251</a>; the sea (genitive case or specially):--sea." })
NTGreekWord.create({strong_id: 2284, form: "θαμβέω", pos: "Verb", transliteration: "thambeó", phonetic_spelling: "(tham-beh'-o)", short_definition: "I amaze", medium_definition: "I amaze; pass: I am amazed (almost terrified).", long_definition: " probably akin to thallo (to warm); to brood, i.e. (figuratively) to foster:--cherish." })
NTGreekWord.create({strong_id: 2285, form: "θάμβος, ους, τό", pos: "Noun, Neuter", transliteration: "thambos", phonetic_spelling: "(tham'-bos)", short_definition: "astonishment", medium_definition: "astonishment, amazement (allied to terror or awe).", long_definition: " of Hebrew origin (Tamar <a>8559</a>; Thamar (i.e. Tamar), an Israelitess:--Thamar." })
NTGreekWord.create({strong_id: 2286, form: "θανάσιμος, ον", pos: "Adjective", transliteration: "thanasimos", phonetic_spelling: "(than-as'-ee-mos)", short_definition: "deadly, mortal", medium_definition: "deadly, mortal, fatal.", long_definition: " from qamboV - thambos <a>2285</a>; to stupefy (with surprise), i.e. astound:--amaze, astonish." })
NTGreekWord.create({strong_id: 2287, form: "θανατηφόρος, ον", pos: "Adjective", transliteration: "thanatéphoros", phonetic_spelling: "(than-at-ay'-for-os)", short_definition: "death-bringing, deadly", medium_definition: "death-bringing, deadly.", long_definition: " akin to an obsolete tapho (to dumbfound); stupefaction (by surprise), i.e. astonishment:--X amazed, + astonished, wonder." })
NTGreekWord.create({strong_id: 2288, form: "θάνατος, ου, ὁ", pos: "Noun, Masculine", transliteration: "thanatos", phonetic_spelling: "(than'-at-os)", short_definition: "death", medium_definition: "death, physical or spiritual.", long_definition: " from qanatoV - thanatos <a>2288</a>; fatal, i.e. poisonous:--deadly." })
NTGreekWord.create({strong_id: 2289, form: "θανατόω", pos: "Verb", transliteration: "thanatoó", phonetic_spelling: "(than-at-o'-o)", short_definition: "I put to death, subdue", medium_definition: "I put to death, subdue; pass: I am in danger of death, am dead to, am rid of, am parted from.", long_definition: " from (the feminine form of) qanatoV - thanatos <a>5342</a>; death-bearing, i.e. fatal:--deadly." })
NTGreekWord.create({strong_id: 2290, form: "θάπτω", pos: "Verb", transliteration: "thaptó", phonetic_spelling: "(thap'-to)", short_definition: "I bury", medium_definition: "I bury.", long_definition: " from qnhskw - thnesko <a>2348</a>; (properly, an adjective used as a noun) death (literally or figuratively):--X deadly, (be...) death." })
NTGreekWord.create({strong_id: 2291, form: "Θάρα, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Thara", phonetic_spelling: "(thar'-ah)", short_definition: "Terah", medium_definition: "Terah, the father of Abraham.", long_definition: " from qanatoV - thanatos <a>2288</a> to kill (literally or figuratively):--become dead, (cause to be) put to death, kill, mortify." })
NTGreekWord.create({strong_id: 2292, form: "θαρρέω", pos: "Verb", transliteration: "tharreó", phonetic_spelling: "(thar-hreh'-o)", short_definition: "I am courageous, of good cheer", medium_definition: "I am courageous, confident, of good cheer.", long_definition: " a primary verb; to celebrate funeral rites, i.e. inter:--bury." })
NTGreekWord.create({strong_id: 2293, form: "θαρσέω", pos: "Verb", transliteration: "tharseó", phonetic_spelling: "(thar-seh'-o)", short_definition: "be of good cheer", medium_definition: "I am of good courage, good cheer, am bold.", long_definition: " of Hebrew origin (Terach <a>8646</a>; Thara (i.e. Terach), the father of Abraham:--Thara." })
NTGreekWord.create({strong_id: 2294, form: "θάρσος, ους, τό", pos: "Noun, Neuter", transliteration: "tharsos", phonetic_spelling: "(thar'-sos)", short_definition: "courage", medium_definition: "courage, confidence.", long_definition: " another form for qarsew - tharseo <a>5111</a>." })
NTGreekWord.create({strong_id: 2295, form: "θαῦμα, ατος, τό", pos: "Noun, Neuter", transliteration: "thauma", phonetic_spelling: "(thos'-mah)", short_definition: "a marvel, wonder", medium_definition: "(a) concr: a marvel, wonder, (b) abstr: wonder, amazement.", long_definition: " from qarsoV - tharsos <a>2292</a>." })
NTGreekWord.create({strong_id: 2296, form: "θαυμάζω", pos: "Verb", transliteration: "thaumazó", phonetic_spelling: "(thou-mad'-zo)", short_definition: "I wonder, admire", medium_definition: "(a) intrans: I wonder, marvel, (b) trans: I wonder at, admire.", long_definition: " akin (by transposition) to thrasos (daring); boldness (subjectively):--courage." })
NTGreekWord.create({strong_id: 2297, form: "θαυμάσιος, α, ον", pos: "Adjective", transliteration: "thaumasios", phonetic_spelling: "(thow-mas'-ee-os)", short_definition: "wonderful", medium_definition: "wonderful, admirable; subst: a wonder.", long_definition: " apparently from a form of qeaomai - theaomai <a>2300</a>; wonder (properly concrete; but by implication, abstract):--admiration." })
NTGreekWord.create({strong_id: 2298, form: "θαυμαστός, ή, όν", pos: "Adjective", transliteration: "thaumastos", phonetic_spelling: "(thow-mas-tos')", short_definition: "wonderful, marvelous", medium_definition: "to be wondered at, wonderful, marvelous.", long_definition: " from qauma - thauma <a>2295</a>; to wonder; by implication, to admire:--admire, have in admiration, marvel, wonder." })
NTGreekWord.create({strong_id: 2299, form: "θεά, ᾶς, ἡ", pos: "Noun, Feminine", transliteration: "thea", phonetic_spelling: "(theh-ah')", short_definition: "a goddess", medium_definition: "a goddess.", long_definition: " from qauma - thauma <a>2295</a>; wondrous, i.e. (neuter as noun) a miracle:--wonderful thing." })
NTGreekWord.create({strong_id: 2300, form: "θεάομαι", pos: "Verb", transliteration: "theaomai", phonetic_spelling: "(theh-ah'-om-ahee)", short_definition: "I see, behold, contemplate, visit", medium_definition: "I see, behold, contemplate, look upon, view; I see, visit.", long_definition: " from qaumazw - thaumazo <a>2296</a>; wondered at, i.e. (by implication) wonderful:--marvel(-lous)." })
NTGreekWord.create({strong_id: 2301, form: "θεατρίζω", pos: "Verb", transliteration: "theatrizó", phonetic_spelling: "(theh-at-rid'-zo)", short_definition: "I make a public show of", medium_definition: "I make a public show of, expose to public shame.", long_definition: " from qeatron - theatron <a>2302</a>; to expose as a spectacle:--make a gazing stock." })
NTGreekWord.create({strong_id: 2302, form: "θέατρον, ου, τό", pos: "Noun, Neuter", transliteration: "theatron", phonetic_spelling: "(theh'-at-ron)", short_definition: "a theatre, spectacle", medium_definition: "(a) a theatre, a semi-circular stone building, generally open to the sky, (b) a spectacle, show.", long_definition: " from qeaomai - theaomai <a>2300</a>; a place for public show (\"theatre\"), i.e. general audience-room; by implication, a show itself (figuratively):--spectacle, theatre." })
NTGreekWord.create({strong_id: 2303, form: "θεῖον, ου, τό", pos: "Noun, Neuter", transliteration: "theion", phonetic_spelling: "(thi'-on)", short_definition: "brimstone, sulfur", medium_definition: "brimstone, sulfur.", long_definition: " probably neuter of qeioV - theios <a>2304</a> (in its original sense of flashing); sulphur:--brimstone." })
NTGreekWord.create({strong_id: 2304, form: "θεῖος, α, ον", pos: "Adjective", transliteration: "theios", phonetic_spelling: "(thi'-os)", short_definition: "divine", medium_definition: "divine; subst: the Deity.", long_definition: " from qeoV - theos <a>2316</a>; godlike (neuter as noun, divinity): - divine, godhead." })
NTGreekWord.create({strong_id: 2305, form: "θειότης, ητος, ἡ", pos: "Noun, Feminine", transliteration: "theiotés", phonetic_spelling: "(thi-ot'-ace)", short_definition: "divinity", medium_definition: "divinity, divine nature.", long_definition: " from qeioV - theios <a>2304</a>; divinity (abstractly):--godhead." })
NTGreekWord.create({strong_id: 2306, form: "θειώδης, ες", pos: "Adjective", transliteration: "theiódés", phonetic_spelling: "(thi-o'-dace)", short_definition: "of brimstone, sulfurous", medium_definition: "of brimstone, sulfurous.", long_definition: " from qeion - theion <a>1491</a>; sulphur-like, i.e. sulphurous:--brimstone." })
NTGreekWord.create({strong_id: 2307, form: "θέλημα, ατος, τό", pos: "Noun, Neuter", transliteration: "theléma", phonetic_spelling: "(thel'-ay-mah)", short_definition: "will, wish, desire", medium_definition: "an act of will, will; plur: wishes, desires.", long_definition: " from the prolonged form of qelw - thelo <a>2309</a>; a determination (properly, the thing), i.e. (actively) choice (specially, purpose, decree; abstractly, volition) or (passively) inclination:-- desire, pleasure, will." })
NTGreekWord.create({strong_id: 2308, form: "θέλησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "thelésis", phonetic_spelling: "(thel'-ay-sis)", short_definition: "a willing, will", medium_definition: "a willing, will.", long_definition: " from qelw - thelo <a>2309</a>; determination (properly, the act), i.e. option:--will." })
NTGreekWord.create({strong_id: 2309, form: "θέλω", pos: "Verb", transliteration: "theló", phonetic_spelling: "( eth-el'-o,)", short_definition: "I will, wish, desire", medium_definition: "I will, wish, desire, am willing, intend, design.", long_definition: " or  ethelo  eth-el'-o,  in certain tenses    theleo  thel-eh'-o, and  etheleo eth-el-eh'-o, which are otherwise obsolete apparently strengthened from the alternate form of aireomai - haireomai <a>1014</a> properly denotes rather a passive acquiescence in objective considerations), i.e. choose or prefer (literally or figuratively); by implication, to wish, i.e. be inclined to (sometimes adverbially, gladly); impersonally for the future tense, to be about to; by Hebraism, to delight in:--desire, be disposed (forward), intend, list, love, mean, please, have rather, (be) will (have, -ling, - ling(-ly))." })
NTGreekWord.create({strong_id: 2310, form: "θεμέλιος, ον", pos: "Noun, Masculine; Noun, Neuter", transliteration: "themelios", phonetic_spelling: "(them-el'-ee-os)", short_definition: "belonging to the foundation", medium_definition: "(properly, an adj: belonging to the foundation), a foundation stone.", long_definition: " from a derivative of tiqhmi - tithemi <a>5087</a>; something put down, i.e. a substruction (of a building, etc.), (literally or figuratively):--foundation." })
NTGreekWord.create({strong_id: 2311, form: "θεμελιόω", pos: "Verb", transliteration: "themelioó", phonetic_spelling: "(them-el-ee-o'-o)", short_definition: "I found, lay the foundation", medium_definition: "I found, lay the foundation (lit. and met.).", long_definition: " from qemelioV - themelios <a>2310</a>; to lay a basis for, i.e. (literally) erect, or (figuratively) consolidate:--(lay the) found(- ation), ground, settle." })
NTGreekWord.create({strong_id: 2312, form: "θεοδίδακτος, ον", pos: "Adjective", transliteration: "theodidaktos", phonetic_spelling: "(theh-od-id'-ak-tos)", short_definition: "taught by God", medium_definition: "taught by God, divinely instructed.", long_definition: " from qeoV - theos <a>1321</a>; divinely instructed:--taught of God." })
NTGreekWord.create({strong_id: 2313, form: "θεομαχέω", pos: "Verb", transliteration: "theomacheó", phonetic_spelling: "(theh-o-makh-eh'-o)", short_definition: "I fight against God", medium_definition: "I fight against God.", long_definition: " from qeomacoV - theomachos <a>2314</a>; to resist deity:--fight against God." })
NTGreekWord.create({strong_id: 2314, form: "θεομάχος, ον", pos: "Adjective", transliteration: "theomachos", phonetic_spelling: "(theh-om'-akh-os)", short_definition: "fighting against God", medium_definition: "fighting against God.", long_definition: " from qeoV - theos <a>3164</a>; an opponent of deity:--to fight against God." })
NTGreekWord.create({strong_id: 2315, form: "θεόπνευστος, ον", pos: "Adjective", transliteration: "theopneustos", phonetic_spelling: "(theh-op'-nyoo-stos)", short_definition: "God-breathed, inspired by God", medium_definition: "God-breathed, inspired by God, due to the inspiration of God.", long_definition: " from qeoV - theos <a>4154</a>; divinely breathed in:--given by inspiration of God." })
NTGreekWord.create({strong_id: 2316, form: "θεός, οῦ, ὁ", pos: "Noun, Feminine; Noun, Masculine", transliteration: "theos", phonetic_spelling: "(theh'-os)", short_definition: "God, a god", medium_definition: "(a) God, (b) a god, generally.", long_definition: " of uncertain affinity; a deity, especially (with 3588) the supreme Divinity; figuratively, a magistrate; by Hebraism, very:--X exceeding, God, god(-ly, -ward)." })
NTGreekWord.create({strong_id: 2317, form: "θεοσέβεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "theosebeia", phonetic_spelling: "(theh-os-eb'-i-ah)", short_definition: "reverence for God", medium_definition: "reverence for God, fear of God, godliness, piety.", long_definition: " from qeosebhV - theosebes <a>2318</a>; devoutness, i.e. piety:--godliness." })
NTGreekWord.create({strong_id: 2318, form: "θεοσεβής, ές", pos: "Adjective", transliteration: "theosebés", phonetic_spelling: "(theh-os-eb-ace')", short_definition: "devout, pious", medium_definition: "devout, pious, God-fearing.", long_definition: " from qeoV - theos <a>4576</a>; reverent of God, i.e. pious:--worshipper of God." })
NTGreekWord.create({strong_id: 2319, form: "θεοστυγής, ές", pos: "Adjective", transliteration: "theostugés", phonetic_spelling: "(theh-os-too-gace')", short_definition: "hating God, hateful to God", medium_definition: "hating God, hateful to God.", long_definition: " from qeoV - theos <a>4767</a>; hateful to God, i.e. impious:--hater of God." })
NTGreekWord.create({strong_id: 2320, form: "θεότης, ητος, ἡ", pos: "Noun, Feminine", transliteration: "theotés", phonetic_spelling: "(theh-ot'-ace)", short_definition: "deity, Godhead", medium_definition: "deity, Godhead.", long_definition: " from qeoV - theos <a>2316</a>; divinity (abstractly):--godhead." })
NTGreekWord.create({strong_id: 2321, form: "Θεόφιλος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Theophilos", phonetic_spelling: "(theh-of'-il-os)", short_definition: "Theophilus", medium_definition: "Theophilus, a friend of Luke of equestrian rank, to whom the Gospel and Acts are dedicated.", long_definition: " from qeoV - theos <a>5384</a>; friend of God; Theophilus, a Christian:--Theophilus." })
