NTGreekWord.create({strong_id: 2383, form: "Ἰάειρος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Iairos", phonetic_spelling: "(ee-ah'-i-ros)", short_definition: "Jairus", medium_definition: "Jairus, a Jewish ruler of the synagogue.", long_definition: "" })
NTGreekWord.create({strong_id: 2384, form: "Ἰακώβ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Iakób", phonetic_spelling: "(ee-ak-obe')", short_definition: "Jacob", medium_definition: "(Hebrew), Jacob, (a) the patriarch, son of Isaac, (b) father of Joseph, the husband of Mary.", long_definition: " of Hebrew origin (Ya'iyr <a>2971</a>; Jairus (i.e. Jair), an Israelite:--Jairus." })
NTGreekWord.create({strong_id: 2385, form: "Ἰάκωβος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Iakóbos", phonetic_spelling: "(ee-ak'-o-bos)", short_definition: "James", medium_definition: "James, (a) the Small, son of Alphaeus, and one of the Twelve, (b) half-brother of Jesus, (c) father (?) of Jude, (d) son of Zebedee, and brother of John, one of the Twelve, killed A.D. 44.", long_definition: " of Hebrew origin (Ya`aqob <a>3290</a>; Jacob (i.e. Ja`akob), the progenitor of the Israelites:--also an Israelite:--Jacob." })
NTGreekWord.create({strong_id: 2386, form: "ἴαμα, ατος, τό", pos: "Noun, Neuter", transliteration: "iama", phonetic_spelling: "(ee'-am-ah)", short_definition: "healing, curing", medium_definition: "healing, curing, remedy.", long_definition: " the same as Iakwb - Iakob <a>2384</a> Graecized; Jacobus, the name of three Israelites:--James." })
