NTGreekWord.create({strong_id: 2388, form: "Ἰαννά, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Iannai", phonetic_spelling: "(ee-an-nah')", short_definition: "Jannai", medium_definition: "Jannai, an ancestor of Jesus; Jannai was the son of Joseph, and father of Melchi.", long_definition: " of Egyptian origin; Jambres, an Egyptian:--Jambres." })
NTGreekWord.create({strong_id: 2389, form: "Ἰαννῆς, ου, ὁ", pos: "Noun, Masculine", transliteration: "Iannés", phonetic_spelling: "(ee-an-nace')", short_definition: "Jannes", medium_definition: "Jannes, a sorcerer at the court of the Pharaoh.", long_definition: " probably of Hebrew origin (compare yanah <a>3238</a>; Janna, an Israelite:--Janna." })
NTGreekWord.create({strong_id: 2390, form: "ἰάομαι", pos: "Verb", transliteration: "iaomai", phonetic_spelling: "(ee-ah'-om-ahee)", short_definition: "I heal", medium_definition: "I heal, generally of the physical, sometimes of spiritual, disease.", long_definition: " of Egyptian origin; Jannes, an Egyptian:--Jannes." })
NTGreekWord.create({strong_id: 2391, form: "Ἰαρέδ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Iaret", phonetic_spelling: "(ee-ar'-ed)", short_definition: "Jared", medium_definition: "(Hebrew), Jared, son of Mahalalel and father of Enoch.", long_definition: " middle voice of apparently a primary verb; to cure (literally or figuratively):--heal, make whole." })
NTGreekWord.create({strong_id: 2392, form: "ἴασις, εως, ἡ", pos: "Noun, Feminine", transliteration: "iasis", phonetic_spelling: "(ee'-as-is)", short_definition: "a cure, healing", medium_definition: "a cure, healing.", long_definition: " of Hebrew origin (Yered <a>3382</a>; Jared (i.e. Jered), an antediluvian:--Jared." })
NTGreekWord.create({strong_id: 2393, form: "ἴασπις, ιδος, ἡ", pos: "Noun, Feminine", transliteration: "iaspis", phonetic_spelling: "(ee'-as-pis)", short_definition: "jasper", medium_definition: "jasper; a precious stone.", long_definition: " from iaomai - iaomai <a>2390</a>; curing (the act):--cure, heal(-ing)." })
NTGreekWord.create({strong_id: 2394, form: "Ἰάσων, ονος, ὁ", pos: "Noun, Masculine", transliteration: "Iasón", phonetic_spelling: "(ee-as'-oan)", short_definition: "Jason", medium_definition: "Jason, a Christian of Thessalonica, perhaps the same as the relative of Paul.", long_definition: " probably of foreign origin (see yashpheh <a>3471</a>; \"jasper\", a gem:--jasper." })
NTGreekWord.create({strong_id: 2395, form: "ἰατρός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "iatros", phonetic_spelling: "(ee-at-ros')", short_definition: "a physician", medium_definition: "a physician.", long_definition: " future active participle masculine of iaomai - iaomai <a>2390</a>; about to cure; Jason, a Christian:--Jason." })
NTGreekWord.create({strong_id: 2396, form: "ἴδε", pos: "Interjection", transliteration: "ide", phonetic_spelling: "(id'-eh)", short_definition: "See! Lo! Behold! Look!", medium_definition: "See! Lo! Behold! Look!.", long_definition: " from iaomai - iaomai <a>2390</a>; a physician:--physician." })
NTGreekWord.create({strong_id: 2397, form: "ἰδέα, ας, ἡ", pos: "Noun, Feminine", transliteration: "idea", phonetic_spelling: "(id-eh'-ah)", short_definition: "form, outward appearance", medium_definition: "form, outward appearance.", long_definition: " second person singular imperative active of eidw - eido <a>1492</a>; used as an interjection to denote surprise; lo!:--behold, lo, see." })
NTGreekWord.create({strong_id: 2398, form: "ἴδιος, α, ν", pos: "Adjective", transliteration: "idios", phonetic_spelling: "(id'-ee-os)", short_definition: "one's own, private, personal", medium_definition: "one's own, belonging to one, private, personal; one's own people, one's own family, home, property.", long_definition: " from eidw - eido <a>1492</a>; a sight (comparative figuratively \"idea\"), i.e. aspect:--countenance." })
