NTGreekWord.create({strong_id: 2401, form: "Ἰδουμαία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Idoumaia", phonetic_spelling: "(id-oo-mah'-yah)", short_definition: "Idumea, Edom", medium_definition: "Idumea, Edom, a district of Arabia, immediately south of Judea.", long_definition: " of Hebrew origin ('Edom <a>123</a>; Idumaea (i.e. Edom), a region East (and South) of Palestine:--Idumaea." })
NTGreekWord.create({strong_id: 2402, form: "ἱδρώς, ῶτος, ὁ", pos: "Noun, Masculine", transliteration: "hidrós", phonetic_spelling: "(hid-roce')", short_definition: "sweat, perspiration", medium_definition: "sweat, perspiration.", long_definition: " a strengthened form of a primary idos (sweat): perspiration:--sweat." })
NTGreekWord.create({strong_id: 2403, form: "Ἰεζάβελ, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Iezabel", phonetic_spelling: "(ee-ed-zab-ale')", short_definition: "Jezebel", medium_definition: "Jezebel, name given to a false prophetess of Thyatira, possibly borrowed from the name of Ahab's wife, queen of Israel.", long_definition: " of Hebrew origin ('Iyzebel <a>348</a>; Jezabel (i.e. Jezebel), a Tyrian woman (used as a synonym of a termagant or false teacher):--Jezabel." })
NTGreekWord.create({strong_id: 2404, form: "Ἱεράπολις, εως, ἡ", pos: "Noun, Feminine", transliteration: "Hierapolis", phonetic_spelling: "(hee-er-ap'-ol-is)", short_definition: "Hierapolis", medium_definition: "Hierapolis, a city of the Lycus valley in Phrygia, near Laodicea and Colossae.", long_definition: " from ieroV - hieros <a>4172</a>; holy city; Hierapolis, a place in Asia Minor:--Hierapolis." })
NTGreekWord.create({strong_id: 2405, form: "ἱερατεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "hierateia", phonetic_spelling: "(hee-er-at-i'-ah)", short_definition: "the duty of a priest", medium_definition: "the duty (office) of a priest, priesthood.", long_definition: " from ierateuw - hierateuo <a>2407</a>; priestliness, i.e. the sacerdotal function:--office of the priesthood, priest's office." })
NTGreekWord.create({strong_id: 2406, form: "ἱεράτευμα, ατος, τό", pos: "Noun, Neuter", transliteration: "hierateuma", phonetic_spelling: "(hee-er-at'-yoo-mah)", short_definition: "the act or office of priesthood", medium_definition: "the act or office of priesthood.", long_definition: " from ierateuw - hierateuo <a>2407</a>; the priestly fraternity, i.e. sacerdotal order (figuratively):--priesthood." })
NTGreekWord.create({strong_id: 2407, form: "ἱερατεύω", pos: "Verb", transliteration: "hierateuó", phonetic_spelling: "(hee-er-at-yoo'-o)", short_definition: "I serve as priest", medium_definition: "I serve as priest.", long_definition: " prolongation from iereuV - hiereus <a>2409</a>; to be a priest, i.e. perform his functions:--execute the priest's office." })
NTGreekWord.create({strong_id: 2408, form: "Ἰερεμίας, ου, ὁ", pos: "Noun, Masculine", transliteration: "Ieremias", phonetic_spelling: "(hee-er-em-ee'-as)", short_definition: "Jeremiah", medium_definition: "Jeremiah, Hebrew prophet.", long_definition: " of Hebrew origin (Yirmyah <a>3414</a>; Hieremias (i.e. Jermijah), an Israelite:--Jeremiah." })
NTGreekWord.create({strong_id: 2409, form: "ἱερεύς, έως, ὁ", pos: "Noun, Masculine", transliteration: "hiereus", phonetic_spelling: "(hee-er-yooce')", short_definition: "a priest", medium_definition: "a priest, one who offers sacrifice to a god (in Jewish and pagan religions; of Christians only met.).", long_definition: " from ieroV - hieros <a>2413</a>; a priest (literally or figuratively):--(high) priest." })
NTGreekWord.create({strong_id: 2410, form: "Ἰεριχώ, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Hiericho", phonetic_spelling: "(hee-er-ee-kho')", short_definition: "Jericho", medium_definition: "Jericho, a city a little north of the Dead Sea.", long_definition: " of Hebrew origin (Yriychow <a>3405</a>; Jericho, a place in Palestine:--Jericho." })
NTGreekWord.create({strong_id: 2411, form: "ἱερόν, οῦ, τό", pos: "Noun, Neuter", transliteration: "hieron", phonetic_spelling: "(hee-er-on')", short_definition: "a temple", medium_definition: "a temple, either the whole building, or specifically the outer courts, open to worshippers.", long_definition: " neuter of ieroV - hieros <a>3485</a> denotes the central sanctuary itself) of the Temple (at Jerusalem or elsewhere):--temple." })
