NTGreekWord.create({strong_id: 2413, form: "ἱερός, ά, όν", pos: "Adjective", transliteration: "hieros", phonetic_spelling: "(hee-er-os')", short_definition: "sacred, holy", medium_definition: "sacred, holy, set apart.", long_definition: " of uncertain affinity; sacred:--holy." })
NTGreekWord.create({strong_id: 2414, form: "Ἱεροσόλυμα, ατος, τά, ἡ", pos: "Noun, Feminine; Noun, Neuter", transliteration: "Hierosoluma", phonetic_spelling: "(hee-er-os-ol'-oo-mah)", short_definition: "Jerusalem", medium_definition: "the Greek form of the Hebrew name: Jerusalem.", long_definition: " of Hebrew origin (Yruwshalaim <a>2419</a>." })
NTGreekWord.create({strong_id: 2415, form: "Ἱεροσολυμίτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "Hierosolumités", phonetic_spelling: "(hee-er-os-ol-oo-mee'-tace)", short_definition: "an inhabitant of Jerusalem", medium_definition: "an inhabitant of Jerusalem.", long_definition: " from ierosoluma - Hierosoluma <a>2414</a>; a Hierosolymite, i.e. inhabitant of Hierosolyma:--of Jerusalem." })
