NTGreekWord.create({strong_id: 2418, form: "ἱερουργέω", pos: "Verb", transliteration: "hierourgeó", phonetic_spelling: "(hee-er-oorg-eh'-o)", short_definition: "I minister in holy things", medium_definition: "I minister in holy things.", long_definition: " from a compound of ieron - hieron <a>2041</a>; to be a temple-worker, i.e. officiate as a priest (figuratively):--minister." })
NTGreekWord.create({strong_id: 2419, form: "Ἱερουσαλήμ, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Ierousalém", phonetic_spelling: "(hee-er-oo-sal-ame')", short_definition: "Jerusalem", medium_definition: "(Aramaic form), Jerusalem, the capital of Palestine: hence Judaism, and allegorically, Christendom, the Christian Church.", long_definition: " of Hebrew origin (Yruwshalaim <a>2414</a>." })
NTGreekWord.create({strong_id: 2420, form: "ἱερωσύνη, ης, ἡ", pos: "Noun, Feminine", transliteration: "hierósuné", phonetic_spelling: "(hee-er-o-soo'-nay)", short_definition: "the priestly office", medium_definition: "the abstract notion of the priestly office.", long_definition: " from ieroV - hieros <a>2413</a>; sacredness, i.e. (by implication) the priestly office:--priesthood." })
NTGreekWord.create({strong_id: 2421, form: "Ἰεσσαί, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Iessai", phonetic_spelling: "(es-es-sah'-ee)", short_definition: "Jesse", medium_definition: "(Hebrew), Jesse, son of Obed, and father of King David.", long_definition: " of Hebrew origin (Yishay <a>3448</a>; Jessae (i.e. Jishai), an Israelite:--Jesse." })
NTGreekWord.create({strong_id: 2422, form: "Ἰεφθάε, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Iephthae", phonetic_spelling: "(ee-ef-thah'-eh)", short_definition: "Jephthah", medium_definition: "(Hebrew), Jephthah, one of the Judges of Israel.", long_definition: " of Hebrew origin (Yiphtach <a>3316</a>; Jephthae (i.e. Jiphtach), an Israelite:--Jephthah." })
NTGreekWord.create({strong_id: 2423, form: "Ἰεχονίας, ου, ὁ", pos: "Noun, Masculine", transliteration: "Iechonias", phonetic_spelling: "(ee-ekh-on-ee'-as)", short_definition: "Jechoniah", medium_definition: "(Hebrew), Jechoniah, son of Josiah and father of Salathiel.", long_definition: " of Hebrew origin (Ykonyah <a>3204</a>; Jechonias (i.e. Jekonjah), an Israelite:--Jechonias." })
NTGreekWord.create({strong_id: 2424, form: "Ἰησοῦς, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "Iésous", phonetic_spelling: "(ee-ay-sooce')", short_definition: "Jesus", medium_definition: "Jesus; the Greek form of Joshua; Jesus, son of Eliezer; Jesus, surnamed Justus.", long_definition: " of Hebrew origin (Yhowshuwa` <a>3091</a>; Jesus (i.e. Jehoshua), the name of our Lord and two (three) other Israelites:--Jesus." })
NTGreekWord.create({strong_id: 2425, form: "ἱκανός, ή, όν", pos: "Adjective", transliteration: "hikanos", phonetic_spelling: "(hik-an-os')", short_definition: "sufficient, worthy, many, much", medium_definition: "(a) considerable, sufficient, of number, quantity, time, (b) of persons: sufficiently strong (good, etc.), worthy, suitable, with various constructions, (c) many, much.", long_definition: " from hiko (hikano or hikneomai, akin to 2240) (to arrive); competent (as if coming in season), i.e. ample (in amount) or fit (in character):--able, + content, enough, good, great, large, long (while), many, meet, much, security, sore, sufficient, worthy." })
NTGreekWord.create({strong_id: 2426, form: "ἱκανότης, ητος, ἡ", pos: "Noun, Feminine", transliteration: "hikanotés", phonetic_spelling: "(hik-an-ot'-ace)", short_definition: "sufficiency, ability, power", medium_definition: "sufficiency, ability, power, fitness.", long_definition: " from ikanoV - hikanos <a>2425</a>; ability:--sufficiency." })
NTGreekWord.create({strong_id: 2427, form: "ἱκανόω", pos: "Verb", transliteration: "hikanoó", phonetic_spelling: "(hik-an-o'-o)", short_definition: "I make sufficient", medium_definition: "I make sufficient, render fit, qualify.", long_definition: " from ikanoV - hikanos <a>2425</a>; to enable, i.e. qualify:--make able (meet)." })
NTGreekWord.create({strong_id: 2428, form: "ἱκετηρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "hiketéria", phonetic_spelling: "(hik-et-ay-ree'-ah)", short_definition: "supplication, entreaty", medium_definition: "(originally: the olive branch held in the hand of the suppliant), supplication, entreaty.", long_definition: " from a derivative of the base of ikanoV - hikanos <a>2425</a> (through the idea of approaching for a favor); intreaty:--supplication." })
NTGreekWord.create({strong_id: 2429, form: "ἰκμάς, άδος, ἡ", pos: "Noun, Feminine", transliteration: "ikmas", phonetic_spelling: "(hik-mas')", short_definition: "moisture", medium_definition: "moisture.", long_definition: " of uncertain affinity; dampness:--moisture." })
NTGreekWord.create({strong_id: 2430, form: "Ἰκόνιον, ου, τό", pos: "Noun, Neuter", transliteration: "Ikonion", phonetic_spelling: "(ee-kon'-ee-on)", short_definition: "Iconium", medium_definition: "Iconium, a Phrygian city of the Roman province Galatia (modern Konia).", long_definition: " perhaps from eikwn - eikon <a>1504</a>; image-like; Iconium, a place in Asia Minor:--Iconium." })
NTGreekWord.create({strong_id: 2431, form: "ἱλαρός, ά, όν", pos: "Adjective", transliteration: "hilaros", phonetic_spelling: "(hil-ar-os')", short_definition: "joyous, cheerful", medium_definition: "joyous, cheerful, not grudging.", long_definition: " from the same as hilewV - hileos <a>2436</a>; propitious or merry (\"hilarious\"), i.e. prompt or willing:--cheerful." })
NTGreekWord.create({strong_id: 2432, form: "ἱλαρότης, ητος, ἡ", pos: "Noun, Feminine", transliteration: "hilarotés", phonetic_spelling: "(hil-ar-ot'-ace)", short_definition: "cheerfulness", medium_definition: "cheerfulness, graciousness.", long_definition: " from ilaroV - hilaros <a>2431</a>; alacrity:--cheerfulness." })
NTGreekWord.create({strong_id: 2433, form: "ἱλάσκομαι", pos: "Verb", transliteration: "hilaskomai", phonetic_spelling: "(hil-as'-kom-ahee)", short_definition: "I have mercy on, forgive", medium_definition: "(a) I have mercy on, show favor to, (b) trans. with object of sins: I forgive, pardon.", long_definition: " middle voice from the same as hilewV - hileos <a>2436</a>; to conciliate, i.e. (transitively) to atone for (sin), or (intransitively) be propitious:--be merciful, make reconciliation for." })
NTGreekWord.create({strong_id: 2434, form: "ἱλασμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "hilasmos", phonetic_spelling: "(hil-as-mos')", short_definition: "a propitiation, atoning sacrifice", medium_definition: "a propitiation (of an angry god), atoning sacrifice.", long_definition: " atonement, i.e. (concretely) an expiator:--propitiation." })
NTGreekWord.create({strong_id: 2435, form: "ἱλαστήριον, ου, τό", pos: "Noun, Neuter", transliteration: "hilastérion", phonetic_spelling: "(hil-as-tay'-ree-on)", short_definition: "a sin offering, covering", medium_definition: "(a) a sin offering, by which the wrath of the deity shall be appeased; a means of propitiation, (b) the covering of the ark, which was sprinkled with the atoning blood on the Day of Atonement.", long_definition: " neuter of a derivative of ilaskomai - hilaskomai <a>2433</a>; an expiatory (place or thing), i.e. (concretely) an atoning victim, or (specially) the lid of the Ark (in the Temple):--mercyseat, propitiation." })
NTGreekWord.create({strong_id: 2436, form: "ἵλεως", pos: "Adjective", transliteration: "hileós", phonetic_spelling: "(hil'-eh-oce)", short_definition: "propitious, forgiving", medium_definition: "propitious, forgiving, merciful.", long_definition: " perhaps from the alternate form of aireomai - haireomai <a>138</a>; cheerful (as attractive), i.e. propitious; adverbially (by Hebraism) God be gracious!, i.e. (in averting some calamity) far be it:--be it far, merciful." })
NTGreekWord.create({strong_id: 2437, form: "Ἰλλυρικόν, οῦ, τό", pos: "Noun, Neuter", transliteration: "Illurikon", phonetic_spelling: "(il-loo-ree-kon')", short_definition: "Illyricum", medium_definition: "Illyricum, a Roman province, afterwards called Dalmatia, bounded by Pannonia on the north, Macedonia on the south, Moesia on the east, and the Adriatic Sea on the west.", long_definition: " neuter of an adjective from a name of uncertain derivation: (the) Illyrican (shore), i.e. (as a name itself) Illyricum, a region of Europe:--Illyricum." })
NTGreekWord.create({strong_id: 2438, form: "ἱμάς, άντος, ὁ", pos: "Noun, Masculine", transliteration: "himas", phonetic_spelling: "(hee-mas')", short_definition: "a thong, strap", medium_definition: "a thong, strap, (a) for binding a man who is to be flogged, (b) for fastening a sandal or shoe.", long_definition: " perhaps from the same as ama - hama <a>260</a>; a strap, i.e. (specially) the tie (of a sandal) or the lash (of a scourge):--latchet, thong." })
NTGreekWord.create({strong_id: 2439, form: "ἱματίζω", pos: "Verb", transliteration: "himatizó", phonetic_spelling: "(him-at-id'-zo)", short_definition: "I clothe", medium_definition: "I clothe, provide clothing for; pass: I am clothed.", long_definition: " from imation - himation <a>2440</a>; to dress:--clothe." })
