NTGreekWord.create({strong_id: 2499, form: "Ἰωσῆ", pos: "Noun, Masculine", transliteration: "Iósé", phonetic_spelling: "(ee-o-say')", short_definition: "gen. of Joses", medium_definition: "(Hebrew), gen. case of Joses (a) son of Eliezer, (b) son of Mary, brother of Jesus, (c) surnamed Barnabas (also called Joseph).", long_definition: " genitive case of IwshV - Ioses <a>2500</a>; Jose, an Israelite:--Jose." })
NTGreekWord.create({strong_id: 2500, form: "Ἰωσῆς, ῆτος, ὁ", pos: "Noun, Masculine", transliteration: "Iósés", phonetic_spelling: "(ee-o-sace')", short_definition: "Joses", medium_definition: "(Hebrew), Joses (a) son of Eliezer, (b) son of Mary, half-brother of Jesus, (c) surnamed Barnabas (also called Joseph).", long_definition: " perhaps for Iwshf - Ioseph <a>2499</a>." })
