NTGreekWord.create({strong_id: 2503, form: "ἰῶτα, τό", pos: "Indeclinable Letter (Noun)", transliteration: "ióta", phonetic_spelling: "(ee-o'-tah)", short_definition: "a small letter of the Greek alphabet", medium_definition: "iota, a small letter of the Greek alphabet, used in the NT (like yod, the Hebrew or rather Aramaic letter which was the smallest of all) to indicate the smallest part.", long_definition: " of Hebrew origin (the tenth letter of the Hebrew alphabet); \"iota\", the name of the eighth letter of the Greek alphabet, put (figuratively) for a very small part of anything:--jot." })
NTGreekWord.create({strong_id: 2504, form: "κἀγώ", pos: "Personal Pronoun", transliteration: "kagó", phonetic_spelling: "(kag-o')", short_definition: "I also, I too", medium_definition: "I also, I too, but I.", long_definition: "" })
