NTGreekWord.create({strong_id: 2506, form: "καθαίρεσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "kathairesis", phonetic_spelling: "(kath-ah'-ee-res-is)", short_definition: "taking down, destroying", medium_definition: "taking down, razing, destroying.", long_definition: " from kata - kata <a>3739</a>; according to which things, i.e. just as:--as." })
NTGreekWord.create({strong_id: 2507, form: "καθαιρέω", pos: "Verb", transliteration: "kathaireó", phonetic_spelling: "(kath-ahee-reh'-o)", short_definition: "I take down, depose, destroy", medium_definition: "(a) I take down, pull down, depose, destroy.", long_definition: " from kaqairew - kathaireo <a>2507</a>; demolition; figuratively, extinction:--destruction, pulling down." })
NTGreekWord.create({strong_id: 2508, form: "καθαίρω", pos: "Verb", transliteration: "kathairó", phonetic_spelling: "(kath-ah'-ee-ro)", short_definition: "I cleanse, purify, prune", medium_definition: "I cleanse, purify, prune.", long_definition: " from kata - kata <a>138</a> (including its alternate); to lower (or with violence) demolish (literally or figuratively):--cast (pull, put, take) down, destroy." })
