NTGreekWord.create({strong_id: 2510, form: "καθάπτω", pos: "Verb", transliteration: "kathaptó", phonetic_spelling: "(kath-ap'-to)", short_definition: "I lay hold of, fasten on to", medium_definition: "I lay hold of, fasten on to, seize, attack.", long_definition: " from kaqa - katha <a>4007</a>; exactly as:--(even, as well) as." })
NTGreekWord.create({strong_id: 2511, form: "καθαρίζω", pos: "Verb", transliteration: "katharizó", phonetic_spelling: "(kath-ar-id'-zo)", short_definition: "I make clean", medium_definition: "I cleanse, make clean, literally, ceremonially, or spiritually, according to context.", long_definition: " from kata - kata <a>680</a>; to seize upon:--fasten on." })
