NTGreekWord.create({strong_id: 2513, form: "καθαρός, ά, όν", pos: "Adjective", transliteration: "katharos", phonetic_spelling: "(kath-ar-os')", short_definition: "clean, pure, unstained", medium_definition: "clean, pure, unstained, either literally or ceremonially or spiritually; guiltless, innocent, upright.", long_definition: " from kaqarizw - katharizo <a>2511</a>; a washing off, i.e. (ceremonially) ablution, (morally) expiation:--cleansing, + purge, purification(-fying)." })
NTGreekWord.create({strong_id: 2514, form: "καθαρότης, ητος, ἡ", pos: "Noun, Feminine", transliteration: "katharotés", phonetic_spelling: "(kath-ar-ot'-ace)", short_definition: "cleanness, purity", medium_definition: "cleanness, purity.", long_definition: " of uncertain affinity; clean (literally or figuratively):--clean, clear, pure." })
NTGreekWord.create({strong_id: 2515, form: "καθέδρα, ας, ἡ", pos: "Noun, Feminine", transliteration: "kathedra", phonetic_spelling: "(kath-ed'-rah)", short_definition: "a seat, chair", medium_definition: "a seat, chair.", long_definition: " from kaqaroV - katharos <a>2513</a>; cleanness (ceremonially):--purification." })
NTGreekWord.create({strong_id: 2516, form: "καθέζομαι", pos: "Verb", transliteration: "kathezomai", phonetic_spelling: "(kath-ed'-zom-ahee)", short_definition: "I am sitting, sit, am seated", medium_definition: "I am sitting, sit down, am seated.", long_definition: " from kata - kata <a>1476</a>; a bench (literally or figuratively):--seat." })
NTGreekWord.create({strong_id: 2517, form: "καθεξῆς", pos: "Adverb", transliteration: "kathexés", phonetic_spelling: "(kath-ex-ace')", short_definition: "in order, just after", medium_definition: "in order, in succession, in the time immediately after, just after.", long_definition: " from kata - kata <a>1476</a>; to sit down:--sit." })
NTGreekWord.create({strong_id: 2518, form: "καθεύδω", pos: "Verb", transliteration: "katheudó", phonetic_spelling: "(kath-yoo'-do)", short_definition: "I sleep, am sleeping", medium_definition: "I sleep, am sleeping.", long_definition: " from kata - kata <a>1836</a>; thereafter, i.e. consecutively; as a noun (by ellipsis of noun) a subsequent person or time:--after(-ward), by (in) order." })
NTGreekWord.create({strong_id: 2519, form: "καθηγητής, ου, ὁ", pos: "Noun, Masculine", transliteration: "kathégétés", phonetic_spelling: "(kath-ayg-ay-tace')", short_definition: "a leader, teacher, guide", medium_definition: "a leader, teacher, guide, master.", long_definition: " from kata - kata <a>2596</a> and heudo (to sleep); to lie down to rest, i.e. (by implication) to fall asleep (literally or figuratively):--(be a-)sleep." })
NTGreekWord.create({strong_id: 2520, form: "καθήκω", pos: "Verb", transliteration: "kathékó", phonetic_spelling: "(kath-ay'-ko)", short_definition: "it is fitting", medium_definition: "I come down, come to; I am unfit, proper.", long_definition: " from a compound of kata - kata <a>2233</a>; a guide, i.e. (figuratively) a teacher:--master." })
NTGreekWord.create({strong_id: 2521, form: "κάθημαι", pos: "Verb", transliteration: "kathémai", phonetic_spelling: "(kath'-ay-mahee)", short_definition: "I sit, am seated", medium_definition: "I sit, am seated, enthroned; I dwell, reside.", long_definition: " from kata - kata <a>2240</a>; to reach to, i.e. (neuter of present active participle, figuratively as adjective) becoming:-- convenient, fit." })
