NTGreekWord.create({strong_id: 2523, form: "καθίζω", pos: "Verb", transliteration: "kathizó", phonetic_spelling: "(kath-id'-zo)", short_definition: "I set, make to sit", medium_definition: "(a) trans: I make to sit; I set, appoint, (b) intrans: I sit down, am seated, stay.", long_definition: " from kata - kata <a>2250</a>; quotidian:--daily." })
NTGreekWord.create({strong_id: 2524, form: "καθίημι", pos: "Verb", transliteration: "kathiémi", phonetic_spelling: "(kath-ee'-ay-mee)", short_definition: "I let down", medium_definition: "I send, let down, lower.", long_definition: " another (active) form for kaqezomai - kathezomai <a>2516</a>; to seat down, i.e. set (figuratively, appoint); intransitively, to sit (down); figuratively, to settle (hover, dwell):--continue, set, sit (down), tarry." })
NTGreekWord.create({strong_id: 2525, form: "καθίστημι", pos: "Verb", transliteration: "kathistémi", phonetic_spelling: "(kath-is'-tay-mee)", short_definition: "I set, establish, appoint, conduct", medium_definition: "I set down, bring down to a place; I set in order, appoint, make, constitute.", long_definition: " from kata - kata <a>2596</a>; and hiemi (to send); to lower:--let down." })
NTGreekWord.create({strong_id: 2526, form: "καθό", pos: "Adverb", transliteration: "katho", phonetic_spelling: "(kath-o')", short_definition: "as, according as", medium_definition: "according to which thing, as, according as.", long_definition: " from kata - kata <a>2476</a>; to place down (permanently), i.e. (figuratively) to designate, constitute, convoy:--appoint, be, conduct, make, ordain, set." })
