NTGreekWord.create({strong_id: 2528, form: "καθοπλίζω", pos: "Verb", transliteration: "kathoplizó", phonetic_spelling: "(kath-op-lid'-zo)", short_definition: "I arm completely", medium_definition: "I arm completely.", long_definition: " from kata - kata <a>3650</a>; on the whole, i.e. entirely:--at all." })
