NTGreekWord.create({strong_id: 2531, form: "καθώς", pos: "Adverb", transliteration: "kathos", phonetic_spelling: "(kath-oce')", short_definition: "just as, as", medium_definition: "according to the manner in which, in the degree that, just as, as.", long_definition: " from kata - kata <a>5100</a>; according to which certain thing, i.e. as far (or inasmuch) as:--(according, forasmuch) as, because (that)." })
