NTGreekWord.create({strong_id: 2533, form: "Καϊάφας, ᾶ, ὁ", pos: "Noun, Masculine", transliteration: "Kaiaphas", phonetic_spelling: "(kah-ee-af'-as)", short_definition: "Caiaphas", medium_definition: "Caiaphas, Jewish high priest.", long_definition: " apparently, a primary particle, having a copulative and sometimes also a cumulative force; and, also, even, so then, too, etc.; often used in connection (or composition) with other particles or small words:--and, also, both, but, even, for, if, or, so, that, then, therefore, when, yet." })
NTGreekWord.create({strong_id: 2534, form: "καίγε", pos: "kai ge", transliteration: "(kah'-ee-gheh)", phonetic_spelling: "and", short_definition: "see ", medium_definition: " and ", long_definition: " of Chaldee origin; the dell; Caiaphas (i.e. Cajepha), an Israelite:--Caiaphas." })
NTGreekWord.create({strong_id: 2535, form: "Κάϊν, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Kain", phonetic_spelling: "(kah'-in)", short_definition: "Cain", medium_definition: "(Hebrew), Cain, son of Adam and Eve and brother of Abel.", long_definition: " from kai - kai <a>1065</a>; and at least (or even, indeed):--and, at least." })
