NTGreekWord.create({strong_id: 2537, form: "καινός, ή, όν", pos: "Adjective", transliteration: "kainos", phonetic_spelling: "(kahee-nos')", short_definition: "fresh, new", medium_definition: "fresh, new, unused, novel.", long_definition: " of Hebrew origin (Qeynan <a>7018</a>; Cainan (i.e. Kenan), the name of two patriarchs:--Cainan." })
NTGreekWord.create({strong_id: 2538, form: "καινότης, ητος, ἡ", pos: "Noun, Feminine", transliteration: "kainotés", phonetic_spelling: "(kahee-not'-ace)", short_definition: "freshness, newness", medium_definition: "freshness, newness, novelty.", long_definition: " of uncertain affinity; new (especially in freshness; while neoV - neos <a>3501</a> is properly so with respect to age:--new." })
