NTGreekWord.create({strong_id: 2540, form: "καιρός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "kairos", phonetic_spelling: "(kahee-ros')", short_definition: "fitting season, opportunity, time", medium_definition: "fitting season, season, opportunity, occasion, time.", long_definition: " from kai - kai <a>4007</a>; and indeed, i.e. nevertheless or notwithstanding:--and yet, although." })
NTGreekWord.create({strong_id: 2541, form: "Καῖσαρ, αρος, ὁ", pos: "Noun, Masculine", transliteration: "Kaisar", phonetic_spelling: "(kah'-ee-sar)", short_definition: "Caesar", medium_definition: "Caesar, a surname of the gens Iulia, which became practically synonymous with the Emperor for the time being; in the Gospels it always refers to Tiberias.", long_definition: " of uncertain affinity; an occasion, i.e. set or proper time:--X always, opportunity, (convenient, due) season, (due, short, while) time, a while. Compare cronoV - chronos <a>5550</a>." })
NTGreekWord.create({strong_id: 2542, form: "Καισάρεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "Kaisareia", phonetic_spelling: "(kahee-sar'-i-a)", short_definition: "Caesarea", medium_definition: "Two cities of Palestine: one in Galilee (Caesarea Philippi), the other on the coast of the Mediterranean.", long_definition: " of Latin origin; Caesar, a title of the Roman emperor:--Caesar." })
NTGreekWord.create({strong_id: 2543, form: "καίτοι", pos: "Conjunction", transliteration: "kaitoi", phonetic_spelling: "(kah'-ee-toy)", short_definition: "and yet, although", medium_definition: "and yet, although, though.", long_definition: " from Kaisar - Kaisar <a>2541</a>; Caesaria, the name of two places in Palestine:--Caesarea." })
