NTGreekWord.create({strong_id: 2546, form: "κἀκεῖ", pos: "Adverb, Correlative", transliteration: "kakei", phonetic_spelling: "(kak-i')", short_definition: "and there, and yonder", medium_definition: "and there, and yonder, there also.", long_definition: " apparently a primary verb; to set on fire, i.e. kindle or (by implication) consume:--burn, light." })
