NTGreekWord.create({strong_id: 2549, form: "κακία, ας, ἡ", pos: "Noun, Feminine", transliteration: "kakia", phonetic_spelling: "(kak-ee'-ah)", short_definition: "evil, wickedness, malice", medium_definition: "(a) evil (i.e. trouble, labor, misfortune), (b) wickedness, (c) vicious disposition, malice, spite.", long_definition: " from kai - kai <a>1565</a>; likewise that (or those):--and him (other, them), even he, him also, them (also), (and) they." })
NTGreekWord.create({strong_id: 2550, form: "κακοήθεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "kakoétheia", phonetic_spelling: "(kak-o-ay'-thi-ah)", short_definition: "evil-mindedness", medium_definition: "evil-mindedness, malignity, malevolence.", long_definition: " from kakoV - kakos <a>2556</a>; badness, i.e. (subjectively) depravity, or (actively) malignity, or (passively) trouble:--evil, malice(-iousness), naughtiness, wickedness." })
NTGreekWord.create({strong_id: 2551, form: "κακολογέω", pos: "Verb", transliteration: "kakologeó", phonetic_spelling: "(kak-ol-og-eh'-o)", short_definition: "I speak evil of, curse", medium_definition: "I speak evil of, curse, revile, abuse.", long_definition: " from a compound of kakoV - kakos <a>2239</a>; bad character, i.e. (specially) mischievousness:--malignity." })
NTGreekWord.create({strong_id: 2552, form: "κακοπάθεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "kakopatheia", phonetic_spelling: "(kak-op-ath'-i-ah)", short_definition: "suffering", medium_definition: "experience of evil, suffering, distress, affliction, perseverance.", long_definition: " from a compound of kakoV - kakos <a>3056</a>; to revile:--curse, speak evil of." })
NTGreekWord.create({strong_id: 2553, form: "κακοπαθέω", pos: "Verb", transliteration: "kakopatheó", phonetic_spelling: "(kak-op-ath-eh'-o)", short_definition: "I suffer evil, endure affliction", medium_definition: "I suffer evil, endure affliction.", long_definition: " from a compound of hmiwrion - hemiorion <a>3806</a>; hardship:--suffering affliction." })
