NTGreekWord.create({strong_id: 2555, form: "κακοποιός, όν", pos: "Adjective", transliteration: "kakopoios", phonetic_spelling: "(kak-op-oy-os')", short_definition: "an evil-doer", medium_definition: "doing evil; subst: an evil-doer.", long_definition: " from kakopoioV - kakopoios <a>2555</a>; to be a bad-doer, i.e. (objectively) to injure, or (genitive) to sin:--do(ing) evil." })
NTGreekWord.create({strong_id: 2556, form: "κακός, ή, όν", pos: "Adjective", transliteration: "kakos", phonetic_spelling: "(kak-os')", short_definition: "bad, evil", medium_definition: "bad, evil, in the widest sense.", long_definition: " from kakoV - kakos <a>4160</a>; a bad-doer; (specially), a criminal:--evil-doer, malefactor." })
