NTGreekWord.create({strong_id: 2740, form: "καῦσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "kausis", phonetic_spelling: "(kow'-sis)", short_definition: "a burning up", medium_definition: "a burning up, being burned.", long_definition: " from kaiw - kaio <a>2545</a>; burning (the act):--be burned." })
NTGreekWord.create({strong_id: 2741, form: "καυσόω", pos: "Verb", transliteration: "kausoo", phonetic_spelling: "(kow-so'-o)", short_definition: "I burn up", medium_definition: "I burn with great heat.", long_definition: " from kausiV - kausis <a>2740</a>; to set on fire:--fervent heat." })
NTGreekWord.create({strong_id: 2742, form: "καύσων, ῶνος, ὁ", pos: "Noun, Masculine", transliteration: "kausón", phonetic_spelling: "(kow'-sone)", short_definition: "a scorching heat, hot wind", medium_definition: "a scorching heat, hot wind.", long_definition: " from kausow - kausoo <a>2741</a>; a glare:--(burning) heat." })
NTGreekWord.create({strong_id: 2743, form: "καυτηριάζω", pos: "Verb", transliteration: "kautériazó", phonetic_spelling: "(kow-tay-ree-ad'-zo)", short_definition: "I cauterize, sear", medium_definition: "I cauterize, burn with a hot iron; hence met: I sear.", long_definition: " from a derivative of kaiw - kaio <a>2545</a>; to brand (\"cauterize\"), i.e. (by implication) to render unsensitive (figuratively):--sear with a hot iron." })
NTGreekWord.create({strong_id: 2744, form: "καυχάομαι", pos: "Verb", transliteration: "kauchaomai", phonetic_spelling: "(kow-khah'-om-ahee)", short_definition: "I boast, glory", medium_definition: "I boast; I glory (exult) proudly.", long_definition: " from some (obsolete) base akin to that of aucheo (to boast) and eucomai - euchomai <a>2172</a>; to vaunt (in a good or a bad sense):--(make) boast, glory, joy, rejoice." })
NTGreekWord.create({strong_id: 2745, form: "καύχημα, ατος, τό", pos: "Noun, Neuter", transliteration: "kauchéma", phonetic_spelling: "(kow'-khay-mah)", short_definition: "a boasting", medium_definition: "a boasting; a ground of boasting (glorying, exultation).", long_definition: " from kaucaomai - kauchaomai <a>2744</a>; a boast (properly, the object; by implication, the act) in a good or a bad sense:--boasting, (whereof) to glory (of), glorying, rejoice(-ing)." })
NTGreekWord.create({strong_id: 2746, form: "καύχησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "kauchesis", phonetic_spelling: "(kow'-khay-sis)", short_definition: "the act of boasting, exultation", medium_definition: "the act of boasting, glorying, exultation.", long_definition: " from kaucaomai - kauchaomai <a>2744</a>; boasting (properly, the act; by implication, the object), in a good or a bad sense:--boasting, whereof I may glory, glorying, rejoicing." })
NTGreekWord.create({strong_id: 2747, form: "Κεγχρεαί, ας, ἡ", pos: "Noun, Feminine", transliteration: "Kegchreai", phonetic_spelling: "(keng-khreh-a'-hee)", short_definition: "Cenchreae", medium_definition: "Cenchreae, the port of Corinth on the Saronic Gulf.", long_definition: " probably from kegchros (millet); Cenchreae, a port of Corinth:--Cencrea." })
NTGreekWord.create({strong_id: 2748, form: "Κεδρών, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Kedrón", phonetic_spelling: "(ked-rone')", short_definition: "Kidron", medium_definition: "Kidron, a valley near Jerusalem.", long_definition: " of Hebrew origin (Qidrown <a>6939</a>; Cedron (i.e. Kidron), a brook near Jerusalem:--Cedron." })
NTGreekWord.create({strong_id: 2749, form: "κεῖμαι", pos: "Verb", transliteration: "keimai", phonetic_spelling: "(ki'-mahee)", short_definition: "I lie, recline, am laid", medium_definition: "I lie, recline, am placed, am laid, set, specially appointed, destined.", long_definition: " middle voice of a primary verb; to lie outstretched (literally or figuratively):--be (appointed, laid up, made, set), lay, lie. Compare tiqhmi - tithemi <a>5087</a>." })
NTGreekWord.create({strong_id: 2750, form: "κειρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "keiria", phonetic_spelling: "(ki-ree'-ah)", short_definition: "a bandage, grave clothes", medium_definition: "a kind of girdle made of cords; a bandage, grave clothes.", long_definition: " of uncertain affinity; a swathe, i.e. winding-sheet:--graveclothes." })
NTGreekWord.create({strong_id: 2751, form: "κείρω", pos: "Verb", transliteration: "keiró", phonetic_spelling: "(ki'-ro)", short_definition: "I shear, cut the hair of", medium_definition: "I shear, cut the hair of; mid: I cut my own hair, have my hair cut.", long_definition: " a primary verb; to shear:--shear(-er)." })
NTGreekWord.create({strong_id: 2752, form: "κέλευσμα, ατος, τό", pos: "Noun, Neuter", transliteration: "keleusma", phonetic_spelling: "(kel'-yoo-mah)", short_definition: "a word of command, a call", medium_definition: "a word of command, a call, an arousing outcry.", long_definition: " from keleuw - keleuo <a>2753</a>; a cry of incitement:--shout." })
NTGreekWord.create({strong_id: 2753, form: "κελεύω", pos: "Verb", transliteration: "keleuó", phonetic_spelling: "(kel-yoo'-o)", short_definition: "I command, order", medium_definition: "I command, order, direct, bid.", long_definition: " from a primary kello (to urge on); \"hail\"; to incite by word, i.e. order:--bid, (at, give) command(-ment)." })
NTGreekWord.create({strong_id: 2754, form: "κενοδοξία, ας, ἡ", pos: "Noun, Feminine", transliteration: "kenodoxia", phonetic_spelling: "(ken-od-ox-ee'-ah)", short_definition: "vainglory, empty pride", medium_definition: "vainglory, empty pride.", long_definition: " from kenodoxoV - kenodoxos <a>2755</a>; empty glorying, i.e. self-conceit:--vain-glory." })
NTGreekWord.create({strong_id: 2755, form: "κενόδοξας, ον", pos: "Adjective", transliteration: "kenodoxos", phonetic_spelling: "(ken-od'-ox-os)", short_definition: "vainglorious", medium_definition: "vainglorious, boastful.", long_definition: " from kenoV - kenos <a>1391</a>; vainly glorifying, i.e. self-conceited:--desirous of vain-glory." })
NTGreekWord.create({strong_id: 2756, form: "κενός, ή, όν", pos: "Adjective", transliteration: "kenos", phonetic_spelling: "(ken-os')", short_definition: "empty, vain, hollow", medium_definition: "(a) empty, (b) met: empty (in moral content), vain, ineffective, foolish, worthless, (c) false, unreal, pretentious, hollow.", long_definition: " apparently a primary word; empty (literally or figuratively):--empty, (in) vain." })
NTGreekWord.create({strong_id: 2757, form: "κενοφωνία, ας, ἡ", pos: "Noun, Feminine", transliteration: "kenophónia", phonetic_spelling: "(ken-of-o-nee'-ah)", short_definition: "empty disputing, worthless babble", medium_definition: "empty disputing, worthless babble.", long_definition: " from a presumed compound of kenoV - kenos <a>5456</a>; empty sounding, i.e. fruitless discussion:--vain." })
NTGreekWord.create({strong_id: 2758, form: "κενόω", pos: "Verb", transliteration: "kenoó", phonetic_spelling: "(ken-o'-o)", short_definition: "I empty, deprive of content, make unreal", medium_definition: "(a) I empty, (b) I deprive of content, make unreal.", long_definition: " from kenoV - kenos <a>2756</a>; to make empty, i.e. (figuratively) to abase, neutralize, falsify:--make (of none effect, of no reputation, void), be in vain." })
NTGreekWord.create({strong_id: 2759, form: "κέντρον, ου, τό", pos: "Noun, Neuter", transliteration: "kentron", phonetic_spelling: "(ken'-tron)", short_definition: "a sting, goad", medium_definition: "a sting, goad; met: of death.", long_definition: " from kenteo (to prick); a point (\"centre\"), i.e. a sting (figuratively, poison) or goad (figuratively, divine impulse):--prick, sting." })
NTGreekWord.create({strong_id: 2760, form: "κεντυρίων, ῶνος, ὁ", pos: "Noun, Masculine", transliteration: "kenturión", phonetic_spelling: "(ken-too-ree'-ohn)", short_definition: "a centurion", medium_definition: "a centurion, an officer commanding about a hundred infantry in the Roman army.", long_definition: " of Latin origin; a centurion, i.e. captain of one hundred soldiers:--centurion." })
NTGreekWord.create({strong_id: 2761, form: "κενῶς", pos: "Adverb", transliteration: "kenós", phonetic_spelling: "(ken-oce')", short_definition: "falsely, in vain", medium_definition: "falsely, in vain, to no purpose.", long_definition: " adverb from kenoV - kenos <a>2756</a>; vainly, i.e. to no purpose:--in vain." })
NTGreekWord.create({strong_id: 2762, form: "κεραία, ας, ἡ", pos: "Noun, Feminine", transliteration: "keraia", phonetic_spelling: "(ker-ah'-yah)", short_definition: "an apostrophe", medium_definition: "a little hook, an apostrophe on letters of the alphabet, distinguishing them from other little letters, or a separation stroke between letters.", long_definition: " feminine of a presumed derivative of the base of keraV - keras <a>2768</a>; something horn-like, i.e. (specially) the apex of a Hebrew letter (figuratively, the least particle):--tittle." })
NTGreekWord.create({strong_id: 2763, form: "κεραμεύς, έως, ὁ", pos: "Noun, Masculine", transliteration: "kerameus", phonetic_spelling: "(ker-am-yooce')", short_definition: "a potter", medium_definition: "a potter.", long_definition: " from keramoV - keramos <a>2766</a>; a potter:--potter." })
NTGreekWord.create({strong_id: 2764, form: "κεραμικός, ή, όν", pos: "Adjective", transliteration: "keramikos", phonetic_spelling: "(ker-am-ik-os')", short_definition: "of clay, made by a potter", medium_definition: "of clay, made by a potter, earthen.", long_definition: " from keramoV - keramos <a>2766</a>; made of clay, i.e. earthen:--of a potter." })
NTGreekWord.create({strong_id: 2765, form: "κεράμιον, ου, τό", pos: "Noun, Neuter", transliteration: "keramion", phonetic_spelling: "(ker-am'-ee-on)", short_definition: "a pitcher, earthen vessel", medium_definition: "a pitcher, earthen vessel, jar.", long_definition: " neuter of a presumed derivative of keramoV - keramos <a>2766</a>; an earthenware vessel, i.e. jar:--pitcher." })
NTGreekWord.create({strong_id: 2766, form: "κέραμος, ου, ὁ", pos: "Noun, Masculine", transliteration: "keramos", phonetic_spelling: "(ker'-am-os)", short_definition: "a tile, the roof", medium_definition: "a tile; practically: the roof.", long_definition: " probably from the base of kerannumi - kerannumi <a>2767</a> (through the idea of mixing clay and water); earthenware, i.e. a tile (by analogy, a thin roof or awning):--tiling." })
