NTGreekWord.create({strong_id: 2768, form: "κέρας, ατος, τό", pos: "Noun, Neuter", transliteration: "keras", phonetic_spelling: "(ker'-as)", short_definition: "a horn", medium_definition: "(a) a horn, (b) a horn-like projection at the corner of an altar, (c) a horn as a symbol of power.", long_definition: " from a primary kar (the hair of the head); a horn (literally or figuratively):--horn." })
NTGreekWord.create({strong_id: 2769, form: "κεράτιον, ου, τό", pos: "Noun, Neuter", transliteration: "keration", phonetic_spelling: "(ker-at'-ee-on)", short_definition: "a husk of the carob", medium_definition: "a husk (pod) of the carob.", long_definition: " neuter of a presumed derivative of keraV - keras <a>2768</a>; something horned, i.e. (specially) the pod of the carob-tree:--husk." })
NTGreekWord.create({strong_id: 2770, form: "κερδαίνω", pos: "Verb", transliteration: "kerdainó", phonetic_spelling: "(ker-dah'-ee-no)", short_definition: "I gain, win, avoid loss", medium_definition: "I gain, acquire, win (over), avoid loss.", long_definition: " from kerdoV - kerdos <a>2771</a>; to gain (literally or figuratively):--(get) gain, win." })
NTGreekWord.create({strong_id: 2771, form: "κέρδος, ους, τό", pos: "Noun, Neuter", transliteration: "kerdos", phonetic_spelling: "(ker'-dos)", short_definition: "gain, advantage", medium_definition: "gain, advantage, profit.", long_definition: " of uncertain affinity; gain (pecuniary or genitive case):--gain, lucre." })
NTGreekWord.create({strong_id: 2772, form: "κέρμα, ατος, τό", pos: "Noun, Neuter", transliteration: "kerma", phonetic_spelling: "(ker'-mah)", short_definition: "a small coin", medium_definition: "a small coin; plur: small change.", long_definition: " from keirw - keiro <a>2751</a>; a clipping (bit), i.e. (specially) a coin:--money." })
NTGreekWord.create({strong_id: 2773, form: "κερματιστής, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "kermatistés", phonetic_spelling: "(ker-mat-is-tace')", short_definition: "a money-changer", medium_definition: "properly: a changer of large into smaller coins, a money-changer.", long_definition: " from a derivative of kerma - kerma <a>2772</a>; a handler of coins, i.e. money-broker:--changer of money." })
NTGreekWord.create({strong_id: 2774, form: "κεφάλαιον, ου, τό", pos: "Noun, Neuter", transliteration: "kephalaion", phonetic_spelling: "(kef-al'-ah-yon)", short_definition: "the chief matter, a sum of money", medium_definition: "(a) the chief matter, the main point, (b) a sum of money.", long_definition: " neuter of a derivative of kefalh - kephale <a>2776</a>; a principal thing, i.e. main point; specially, an amount (of money):--sum." })
NTGreekWord.create({strong_id: 2775, form: "κεφαλαιόω", pos: "Verb", transliteration: "kephalaioó", phonetic_spelling: "(kef-al-ahee-o'-o)", short_definition: "I wound in the head", medium_definition: "I wound in the head.", long_definition: " from the same as kefalaion - kephalaion <a>2774</a>; (specially) to strike on the head:--wound in the head." })
NTGreekWord.create({strong_id: 2776, form: "κεφαλή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "kephalé", phonetic_spelling: "(kef-al-ay')", short_definition: "the head", medium_definition: "(a) the head, (b) met: a corner stone, uniting two walls; head, ruler, lord.", long_definition: " from the primary kapto (in the sense of seizing); the head (as the part most readily taken hold of), literally or figuratively:--head." })
NTGreekWord.create({strong_id: 2777, form: "κεφαλίς, ίδος, ἡ", pos: "Noun, Feminine", transliteration: "kephalis", phonetic_spelling: "(kef-al-is')", short_definition: "a roll, volume", medium_definition: "(lit: little head, then: the knob at the end of the wooden core of a roll of papyrus, then) a roll, volume, division (of a book).", long_definition: " from kefalh - kephale <a>2776</a>; properly, a knob, i.e. (by implication) a roll (by extension from the end of a stick on which the manuscript was rolled):--volume." })
NTGreekWord.create({strong_id: 2778, form: "κῆνσος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kensos", phonetic_spelling: "(kane'-sos)", short_definition: "a poll-tax", medium_definition: "a poll-tax.", long_definition: " of Latin origin; properly, an enrollment (\"census\"), i.e. (by implication) a tax:--tribute." })
NTGreekWord.create({strong_id: 2779, form: "κῆπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "képos", phonetic_spelling: "(kay'-pos)", short_definition: "a garden", medium_definition: "a garden, any place planted with trees and herbs.", long_definition: " of uncertain affinity; a garden:--garden." })
