NTGreekWord.create({strong_id: 2781, form: "κηρίον, ου, τό", pos: "Noun, Neuter", transliteration: "kérion", phonetic_spelling: "(kay-ree'-on)", short_definition: "a honeycomb", medium_definition: "a honeycomb.", long_definition: " diminutive from keos (wax); a cell for honey, i.e. (collectively) the comb:--(honey-)comb." })
NTGreekWord.create({strong_id: 2782, form: "κήρυγμα, ατος, τό", pos: "Noun, Neuter", transliteration: "kérugma", phonetic_spelling: "(kay'-roog-mah)", short_definition: "a proclamation, preaching", medium_definition: "a proclamation, preaching.", long_definition: " from khrussw - kerusso <a>2784</a>; a proclamation (especially of the gospel; by implication, the gospel itself):--preaching." })
NTGreekWord.create({strong_id: 2783, form: "κῆρυξ, υκος, ὁ", pos: "Noun, Masculine", transliteration: "kérux", phonetic_spelling: "(kay'-roox)", short_definition: "a herald, preacher", medium_definition: "a herald, preacher, proclaimer.", long_definition: " from khrussw - kerusso <a>2784</a>; a herald, i.e. of divine truth (especially of the gospel):--preacher." })
NTGreekWord.create({strong_id: 2784, form: "κηρύσσω", pos: "Verb", transliteration: "kérussó", phonetic_spelling: "(kay-roos'-so)", short_definition: "I proclaim, herald, preach", medium_definition: "I proclaim, herald, preach.", long_definition: " of uncertain affinity; to herald (as a public crier), especially divine truth (the gospel):--preacher(-er), proclaim, publish." })
NTGreekWord.create({strong_id: 2785, form: "κῆτος, ους, τό", pos: "Noun, Neuter", transliteration: "kétos", phonetic_spelling: "(kay'-tos)", short_definition: "a sea monster, huge fish", medium_definition: "a sea monster, huge sea fish, whale.", long_definition: " probably from the base of casma - chasma <a>5490</a>; a huge fish (as gaping for prey):--whale." })
NTGreekWord.create({strong_id: 2786, form: "Κηφᾶς, ᾶ, ὁ", pos: "Noun, Masculine", transliteration: "Képhas", phonetic_spelling: "(kay-fas')", short_definition: "Cephas", medium_definition: "Cephas (Aramaic for rock), the new name given to Simon Peter, the apostle.", long_definition: " of Chaldee origin (compare keph <a>3710</a>; the Rock; Cephas (i.e. Kepha), a surname of Peter:--Cephas." })
NTGreekWord.create({strong_id: 2787, form: "κιβωτός, οῦ, ἡ", pos: "Noun, Feminine", transliteration: "kibótos", phonetic_spelling: "(kib-o-tos')", short_definition: "an ark", medium_definition: "(properly: a wooden box, hence) the Ark, in which Noah sailed; the Ark of the Covenant.", long_definition: " of uncertain derivation; a box, i.e. the sacred ark and that of Noah:--ark." })
NTGreekWord.create({strong_id: 2788, form: "κιθάρα, ας, ἡ", pos: "Noun, Feminine", transliteration: "kithara", phonetic_spelling: "(kith-ar'-ah)", short_definition: "a harp", medium_definition: "a harp, lyre.", long_definition: " of uncertain affinity; a lyre:--harp." })
NTGreekWord.create({strong_id: 2789, form: "κιθαρίζω", pos: "Verb", transliteration: "kitharizó", phonetic_spelling: "(kith-ar-id'-zo)", short_definition: "I play on the harp", medium_definition: "intrans. and trans: I play on the harp, I harp, with acc. of the tune.", long_definition: " from kiqara - kithara <a>2788</a>; to play on a lyre:--harp." })
NTGreekWord.create({strong_id: 2790, form: "κιθαρῳδός, ου, ὁ", pos: "Noun, Masculine", transliteration: "kitharódos", phonetic_spelling: "(kith-ar-o'-dos)", short_definition: "a harpist", medium_definition: "a harpist, one who sings with harp as accompaniment.", long_definition: " from kiqara - kithara <a>5603</a>; a lyre-singer(-player), i.e. harpist:--harper." })
NTGreekWord.create({strong_id: 2791, form: "Κιλικία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Kilikia", phonetic_spelling: "(kil-ik-ee'-ah)", short_definition: "Cilicia", medium_definition: "Cilicia, a Roman province between the Taurus range of mountains and the coast in the south-east corner of Asia Minor, linked up with the province of Syria.", long_definition: " probably of foreign origin; Cilicia, a region of Asia Minor:--Cilicia." })
NTGreekWord.create({strong_id: 2792, form: "κινάμωμον, ου, τό", pos: "Noun, Neuter", transliteration: "kinamómon", phonetic_spelling: "(kin-am'-o-mon)", short_definition: "cinnamon", medium_definition: "(a Semitic word) cinnamon.", long_definition: " of foreign origin (compare qinnamown <a>7076</a>; cinnamon:--cinnamon." })
NTGreekWord.create({strong_id: 2793, form: "κινδυνεύω", pos: "Verb", transliteration: "kinduneuó", phonetic_spelling: "(kin-doon-yoo'-o)", short_definition: "I am in danger", medium_definition: "I am in danger or peril.", long_definition: " from kindunoV - kindunos <a>2794</a>; to undergo peril:--be in danger, be (stand) in jeopardy." })
NTGreekWord.create({strong_id: 2794, form: "κίνδυνος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kindunos", phonetic_spelling: "(kin'-doo-nos)", short_definition: "danger, peril, risk", medium_definition: "danger, peril, risk.", long_definition: " of uncertain derivation; danger:--peril." })
NTGreekWord.create({strong_id: 2795, form: "κινέω", pos: "Verb", transliteration: "kineó", phonetic_spelling: "(kin-eh'-o)", short_definition: "I move, stir, excite", medium_definition: "I set in motion, move, remove, excite, stir up.", long_definition: " from kio (poetic for eimi, to go); to stir (transitively), literally or figuratively:--(re-)move(-r), way." })
NTGreekWord.create({strong_id: 2796, form: "κίνησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "kinesis", phonetic_spelling: "(kin'-ay-sis)", short_definition: "a moving, stirring", medium_definition: "a moving, stirring.", long_definition: " from kinew - kineo <a>2795</a>; a stirring:--moving." })
NTGreekWord.create({strong_id: 2797, form: "Κίς, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Kis", phonetic_spelling: "(kis)", short_definition: "Kish", medium_definition: "Kish, the father of Saul.", long_definition: " of Hebrew origin (Qiysh <a>7027</a>; Cis (i.e. Kish), an Israelite:--Cis." })
NTGreekWord.create({strong_id: 2798, form: "κλάδος, ου, ὁ", pos: "Noun, Masculine", transliteration: "klados", phonetic_spelling: "(klad'-os)", short_definition: "a branch", medium_definition: "a young tender shoot, then: a branch; met: of descendants.", long_definition: " from klaw - klao <a>2806</a>; a twig or bough (as if broken off):--branch." })
