NTGreekWord.create({strong_id: 2858, form: "Κολοσσαεύς", pos: "(kol-os-sayoos')", transliteration: "colossians", phonetic_spelling: "", short_definition: "", medium_definition: "", long_definition: " from Kolossai - Kolossai <a>2857</a>; a Colossaean, (i.e. inhabitant of Colossae:--Colossian." })
NTGreekWord.create({strong_id: 2859, form: "κόλπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kolpos", phonetic_spelling: "(kol'-pos)", short_definition: "bosom, bosom of a garment, a bay, gulf", medium_definition: "(a) sing. and plur: bosom; (sinus) the overhanging fold of the garment used as a pocket, (b) a bay, gulf.", long_definition: " apparently a primary word; the bosom; by analogy, a bay:--bosom, creek." })
NTGreekWord.create({strong_id: 2860, form: "κολυμβάω", pos: "Verb", transliteration: "kolumbaó", phonetic_spelling: "(kol-oom-bah'-o)", short_definition: "I swim", medium_definition: "(properly: I dive, hence) I swim.", long_definition: " from kolumbos (a diver); to plunge into water:--swim." })
NTGreekWord.create({strong_id: 2861, form: "κολυμβήθρα, ας, ἡ", pos: "Noun, Feminine", transliteration: "kolumbéthra", phonetic_spelling: "(kol-oom-bay'-thrah)", short_definition: "a pool, swimming-place", medium_definition: "(lit: a diving or swimming place), a pool.", long_definition: " a diving-place, i.e. pond for bathing (or swimming):--pool." })
NTGreekWord.create({strong_id: 2862, form: "κολωνία, ας, ἡ", pos: "Noun, Feminine", transliteration: "kolónia", phonetic_spelling: "(kol-o-nee'-ah)", short_definition: "a colony, garrison city", medium_definition: "a colony, a city settlement of Roman (soldier) citizens; a garrison city.", long_definition: " of Latin origin; a Roman \"colony\" for veterans:--colony." })
NTGreekWord.create({strong_id: 2863, form: "κομάω", pos: "Verb", transliteration: "komaó", phonetic_spelling: "(kom-ah'-o)", short_definition: "I wear the hair long", medium_definition: "I wear the hair long, allow the hair to grow out.", long_definition: " from komh - kome <a>2864</a>; to wear tresses of hair:--have long hair." })
NTGreekWord.create({strong_id: 2864, form: "κόμη, ης, ἡ", pos: "Noun, Feminine", transliteration: "komé", phonetic_spelling: "(kom'-ay)", short_definition: "hair, long hair", medium_definition: "hair, long hair.", long_definition: " apparently from the same as komizw - komizo <a>2359</a>; which properly denotes merely the scalp):--hair." })
NTGreekWord.create({strong_id: 2865, form: "κομίζω", pos: "Verb", transliteration: "komizó", phonetic_spelling: "(kom-id'-zo)", short_definition: "I bring, receive, recover", medium_definition: "(a) act: I convey, bring, carry, (b) mid: I receive back, receive what has belonged to myself but has been lost, or else promised but kept back, or: I get what has come to be my own by earning, recover.", long_definition: " from a primary komeo (to tend, i.e. take care of); properly, to provide for, i.e. (by implication) to carry off (as if from harm; genitive case obtain):--bring, receive." })
NTGreekWord.create({strong_id: 2866, form: "κομψότερον", pos: "Adverb, Comparative", transliteration: "kompsoteron", phonetic_spelling: "(komp-sot'-er-on)", short_definition: "in better health", medium_definition: "in better health.", long_definition: " neuter comparative of a derivative of the base of komizw - komizo <a>2865</a> (meaning, properly, well dressed, i.e. nice); figuratively, convalescent:--+ began to amend." })
NTGreekWord.create({strong_id: 2867, form: "κονιάω", pos: "Verb", transliteration: "koniaó", phonetic_spelling: "(kon-ee-ah'-o)", short_definition: "I whitewash", medium_definition: "I whitewash, plaster over.", long_definition: " from konia (dust; by analogy, lime); to whitewash:--whiten." })
NTGreekWord.create({strong_id: 2868, form: "κονιορτός, ου, ὁ", pos: "Noun, Masculine", transliteration: "koniortos", phonetic_spelling: "(kon-ee-or-tos')", short_definition: "dust", medium_definition: "dust.", long_definition: " from the base of koniaw - koniao <a>2867</a> and ornumi (to \"rouse\"); pulverulence (as blown about):--dust." })
NTGreekWord.create({strong_id: 2869, form: "κοπάζω", pos: "Verb", transliteration: "kopazó", phonetic_spelling: "(kop-ad'-zo)", short_definition: "I cease, drop", medium_definition: "I abate, cease raging, am stilled.", long_definition: " from kopoV - kopos <a>2873</a>; to tire, i.e. (figuratively) to relax:--cease." })
NTGreekWord.create({strong_id: 2870, form: "κοπετός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "kopetos", phonetic_spelling: "(kop-et-os')", short_definition: "lamentation", medium_definition: "beating of the breast or head in lamentation, lamentation.", long_definition: " from koptw - kopto <a>2875</a>; mourning (properly, by beating the breast):--lamentation." })
NTGreekWord.create({strong_id: 2871, form: "κοπή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "kopé", phonetic_spelling: "(kop-ay')", short_definition: "slaughter", medium_definition: "slaughter, smiting in battle.", long_definition: " from koptw - kopto <a>2875</a>; cutting, i.e. carnage:--slaughter." })
NTGreekWord.create({strong_id: 2872, form: "κοπιάω", pos: "Verb", transliteration: "kopiaó", phonetic_spelling: "(kop-ee-ah'-o)", short_definition: "I grow weary, toil", medium_definition: "(a) I grow weary, (b) I toil, work with effort (of bodily and mental labor alike).", long_definition: " from a derivative of kopoV - kopos <a>2873</a>; to feel fatigue; by implication, to work hard:--(bestow) labour, toil, be wearied." })
NTGreekWord.create({strong_id: 2873, form: "κόπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kopos", phonetic_spelling: "(kop'-os)", short_definition: "trouble, toil, labor", medium_definition: "(a) trouble, (b) toil, labor, laborious toil, involving weariness and fatigue.", long_definition: " from koptw - kopto <a>2875</a>; a cut, i.e. (by analogy) toil (as reducing the strength), literally or figuratively; by implication, pains:--labour, + trouble, weariness." })
NTGreekWord.create({strong_id: 2874, form: "κοπρία, ας, ἡ", pos: "Noun, Feminine; Noun, Neuter", transliteration: "kopria", phonetic_spelling: "(kop-ree'-ah)", short_definition: "manure", medium_definition: "manure; a dung-hill.", long_definition: " from kopros (ordure; perhaps akin to 2875); manure:--dung(-hill)." })
NTGreekWord.create({strong_id: 2875, form: "κόπτω", pos: "Verb", transliteration: "koptó", phonetic_spelling: "(kop'-to)", short_definition: "I cut off, mourn", medium_definition: "(a) I cut, cut off, strike, smite, (b) mid: I beat my breast or head in lamentation, lament, mourn, sometimes with acc. of person whose loss is mourned.", long_definition: " a primary verb; to \"chop\"; specially, to beat the breast in grief:--cut down, lament, mourn, (be-)wail. Compare the base of tomwteroV - tomoteros <a>5114</a>." })
NTGreekWord.create({strong_id: 2876, form: "κόραξ, ός, ὁ", pos: "Noun, Masculine", transliteration: "korax", phonetic_spelling: "(kor'-ax)", short_definition: "a raven", medium_definition: "a raven, crow.", long_definition: " perhaps from korennumi - korennumi <a>2880</a>; a crow (from its voracity):--raven." })
NTGreekWord.create({strong_id: 2877, form: "κοράσιον, ου, τό", pos: "Noun, Neuter", transliteration: "korasion", phonetic_spelling: "(kor-as'-ee-on)", short_definition: "a girl, little girl", medium_definition: "a little girl, a young girl; a girl, maiden.", long_definition: " neuter of a presumed derivative of kore (a maiden); a (little) girl:--damsel, maid." })
NTGreekWord.create({strong_id: 2878, form: "κορβᾶν", pos: "Hebrew Noun, Masculin", transliteration: "korban", phonetic_spelling: "(kor-ban')", short_definition: "a gift, offering", medium_definition: "a gift, offering, anything consecrated to God.", long_definition: " and  korbanas kor-ban-as' of Hebrew and Chaldee origin respectively (qorban <a>7133</a>; a votive offering and the offering; a consecrated present (to the Temple fund); by extension (the latter term) the Treasury itself, i.e. the room where the contribution boxes stood:--Corban, treasury." })
NTGreekWord.create({strong_id: 2879, form: "Κορέ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Kore", phonetic_spelling: "(kor-eh')", short_definition: "Korah", medium_definition: "(Hebrew) Korah.", long_definition: " of Hebrew origin (Qorach <a>7141</a>; Core (i.e. Korach), an Israelite:--Core." })
NTGreekWord.create({strong_id: 2880, form: "κορέννυμι", pos: "Verb", transliteration: "korennumi", phonetic_spelling: "(kor-en'-noo-mee)", short_definition: "I fill, feed full", medium_definition: "I fill, sate, glut, feed full, satisfy.", long_definition: " a primary verb; to cram, i.e. glut or sate:--eat enough, full." })
NTGreekWord.create({strong_id: 2881, form: "Κορίνθιος, ου, ὁ", pos: "Adjective", transliteration: "Korinthios", phonetic_spelling: "(kor-in'-thee-os)", short_definition: "Corinthian", medium_definition: "Corinthian, of Corinth.", long_definition: " from KorinqoV - Korinthos <a>2882</a>; a Corinthian, i.e. inhabitant of Corinth:--Corinthian." })
NTGreekWord.create({strong_id: 2882, form: "Κόρινθος, ου, ἡ", pos: "Noun, Feminine", transliteration: "Korinthos", phonetic_spelling: "(kor'-in-thos)", short_definition: "Corinth", medium_definition: "Corinth, in north-east Peloponnese, the capital of the Roman province Achaia.", long_definition: " of uncertain derivation; Corinthus, a city of Greece:--Corinth." })
NTGreekWord.create({strong_id: 2883, form: "Κορνήλιος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Kornélios", phonetic_spelling: "(kor-nay'-lee-os)", short_definition: "Cornelius", medium_definition: "Cornelius, a centurion of the Roman army, stationed at Caesarea.", long_definition: " of Latin origin; Cornelius, a Roman:--Cornelius." })
NTGreekWord.create({strong_id: 2884, form: "κόρος, ου, ὁ", pos: "Noun, Masculine", transliteration: "koros", phonetic_spelling: "(kor'-os)", short_definition: "a dry measure, 120 gallons", medium_definition: "(Hebrew) a (dry) measure, equivalent to 120 gallons.", long_definition: " of Hebrew origin (kor <a>3734</a>; a cor, i.e. a specific measure:--measure." })
NTGreekWord.create({strong_id: 2885, form: "κοσμέω", pos: "Verb", transliteration: "kosmeó", phonetic_spelling: "(kos-meh'-o)", short_definition: "I put into order, adorn", medium_definition: "I put into order; I decorate, deck, adorn.", long_definition: " from kosmoV - kosmos <a>2889</a>; to put in proper order, i.e. decorate (literally or figuratively); specially, to snuff (a wick):--adorn, garnish, trim." })
NTGreekWord.create({strong_id: 2886, form: "κοσμικός, ή, όν", pos: "Adjective", transliteration: "kosmikos", phonetic_spelling: "(kos-mee-kos')", short_definition: "earthly, worldly", medium_definition: "earthly, worldly (belonging to the present earthly world as opposed to the heavenly and future).", long_definition: " from kosmoV - kosmos <a>2889</a> (in its secondary sense); terrene (\"cosmic\"), literally (mundane) or figuratively (corrupt):--worldly." })
NTGreekWord.create({strong_id: 2887, form: "κόσμιος, ία, ον", pos: "Adjective", transliteration: "kosmios", phonetic_spelling: "(kos'-mee-os)", short_definition: "orderly, virtuous", medium_definition: "orderly, virtuous, decent, modest, well-ordered.", long_definition: " from kosmoV - kosmos <a>2889</a> (in its primary sense); orderly, i.e. decorous:--of good behaviour, modest." })
NTGreekWord.create({strong_id: 2888, form: "κοσμοκράτωρ, ορος, ὁ", pos: "Noun, Masculine", transliteration: "kosmokratór", phonetic_spelling: "(kos-mok-fat'-ore)", short_definition: "ruler of this world", medium_definition: "ruler of this world, that is, of the world as asserting its independence of God; used of the angelic or demonic powers controlling the sublunary world.", long_definition: " from kosmoV - kosmos <a>2902</a>; a world-ruler, an epithet of Satan:--ruler." })
NTGreekWord.create({strong_id: 2889, form: "κόσμος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kosmos", phonetic_spelling: "(kos'-mos)", short_definition: "the world, universe", medium_definition: "the world, universe; worldly affairs; the inhabitants of the world; adornment.", long_definition: " probably from the base of komizw - komizo <a>2865</a>; orderly arrangement, i.e. decoration; by implication, the world (in a wide or narrow sense, including its inhabitants, literally or figuratively (morally)):--adorning, world." })
NTGreekWord.create({strong_id: 2890, form: "Κούαρτος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Kouartos", phonetic_spelling: "(koo'-ar-tos)", short_definition: "Quartus", medium_definition: "Quartus, a Christian, brother of Erastus the Corinthian.", long_definition: " of Latin origin (fourth); Quartus, a Christian:--Quartus." })
NTGreekWord.create({strong_id: 2891, form: "κοῦμι", pos: "Aramaic Transliterated Word (Indeclinable)", transliteration: "koum", phonetic_spelling: "(koo'-mee)", short_definition: "arise", medium_definition: "(Aramaic) arise, stand up.", long_definition: " of Chaldee origin (quwm <a>6966</a>; cumi (i.e. rise!):--cumi." })
NTGreekWord.create({strong_id: 2892, form: "κουστωδία, ας, ἡ", pos: "Noun, Feminine", transliteration: "koustódia", phonetic_spelling: "(koos-to-dee'-ah)", short_definition: "a guard", medium_definition: "a guard, watch.", long_definition: " of Latin origin; \"custody\", i.e. a Roman sentry:--watch." })
NTGreekWord.create({strong_id: 2893, form: "κουφίζω", pos: "Verb", transliteration: "kouphizó", phonetic_spelling: "(koo-fid'-zo)", short_definition: "I lighten", medium_definition: "I lighten, make light.", long_definition: " from kouphos (light in weight); to unload:--lighten." })
NTGreekWord.create({strong_id: 2894, form: "κόφινος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kophinos", phonetic_spelling: "(kof'-ee-nos)", short_definition: "a large basket", medium_definition: "a large basket.", long_definition: " of uncertain derivation; a (small) basket:--basket." })
NTGreekWord.create({strong_id: 2895, form: "κράβαττος, ου, ὁ", pos: "Noun, Masculine", transliteration: "krabattos", phonetic_spelling: "(krab'-bat-os)", short_definition: "a bed, mattress, mat", medium_definition: "a bed, mattress, mat of a poor man.", long_definition: " probably of foreign origin; a mattress:--bed." })
NTGreekWord.create({strong_id: 2896, form: "κράζω", pos: "Verb", transliteration: "krazó", phonetic_spelling: "(krad'-zo)", short_definition: "I cry aloud, shriek", medium_definition: "I cry aloud, shriek.", long_definition: " a primary verb; properly, to \"croak\" (as a raven) or scream, i.e. (genitive case) to call aloud (shriek, exclaim, intreat):--cry (out)." })
NTGreekWord.create({strong_id: 2897, form: "κραιπάλη, ης, ἡ", pos: "Noun, Feminine", transliteration: "kraipalé", phonetic_spelling: "(krahee-pal'-ay)", short_definition: "drunken dissipation", medium_definition: "drunken dissipation, surfeiting.", long_definition: " probably from the same as arpazw - harpazo <a>726</a>; properly, a headache (as a seizure of pain) from drunkenness, i.e. (by implication) a debauch (by analogy, a glut):--surfeiting." })
NTGreekWord.create({strong_id: 2898, form: "κρανίον, ου, τό", pos: "Noun, Neuter", transliteration: "kranion", phonetic_spelling: "(kran-ee'-on)", short_definition: "a skull", medium_definition: "a skull.", long_definition: " diminutive of a derivative of the base of keraV - keras <a>2768</a>; a skull (\"cranium\"):--Calvary, skull." })
NTGreekWord.create({strong_id: 2899, form: "κράσπεδον, ου, τό", pos: "Noun, Neuter", transliteration: "kraspedon", phonetic_spelling: "(kras'-ped-on)", short_definition: "the fringe, edge", medium_definition: "the fringe, edge, corner, tassel.", long_definition: " of uncertain derivation; a margin, i.e. (specially), a fringe or tassel:--border, hem." })
NTGreekWord.create({strong_id: 2900, form: "κραταιός, ά, όν", pos: "Adjective", transliteration: "krataios", phonetic_spelling: "(krat-ah-yos')", short_definition: "strong, powerful", medium_definition: "strong, powerful, mighty.", long_definition: " from kratoV - kratos <a>2904</a>; powerful:--mighty." })
NTGreekWord.create({strong_id: 2901, form: "κραταιόω", pos: "Verb", transliteration: "krataioó", phonetic_spelling: "(krat-ah-yo'-o)", short_definition: "I strengthen, confirm, grow strong", medium_definition: "I strengthen, confirm; pass: I grow strong, become strong.", long_definition: " from krataioV - krataios <a>2900</a>; to empower, i.e. (passively) increase in vigor:--be strengthened, be (wax) strong." })
NTGreekWord.create({strong_id: 2902, form: "κρατέω", pos: "Verb", transliteration: "krateó", phonetic_spelling: "(krat-eh'-o)", short_definition: "I lay hold of, obtain", medium_definition: "I am strong, mighty, hence: I rule, am master, prevail; I obtain, take hold of; I hold, hold fast.", long_definition: " from kratoV - kratos <a>2904</a>; to use strength, i.e. seize or retain (literally or figuratively):--hold (by, fast), keep, lay hand (hold) on, obtain, retain, take (by)." })
NTGreekWord.create({strong_id: 2903, form: "κράτιστος, η, ον", pos: "Adjective", transliteration: "kratistos", phonetic_spelling: "(krat'-is-tos)", short_definition: "most excellent", medium_definition: "most excellent, an official epithet, used in addressing a Roman of high rank, and in the second century one of equestrian (as distinguished from senatorial) rank.", long_definition: " superlative of a derivative of kratoV - kratos <a>2904</a>; strongest, i.e. (in dignity) very honorable:--most excellent (noble)." })
NTGreekWord.create({strong_id: 2904, form: "κράτος, ους, τό", pos: "Noun, Neuter", transliteration: "kratos", phonetic_spelling: "(krat'-os)", short_definition: "dominion, strength, power", medium_definition: "dominion, strength, power; a mighty deed.", long_definition: " perhaps a primary word; vigor (\"great\") (literally or figuratively):--dominion, might(-ily), power, strength." })
NTGreekWord.create({strong_id: 2905, form: "κραυγάζω", pos: "Verb", transliteration: "kraugazó", phonetic_spelling: "(krow-gad'-zo)", short_definition: "I cry aloud, shout", medium_definition: "I cry aloud, shout, exclaim.", long_definition: " from kraugh - krauge <a>2906</a>; to clamor:--cry out." })
NTGreekWord.create({strong_id: 2906, form: "κραυγή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "kraugé", phonetic_spelling: "(krow-gay')", short_definition: "a shout, clamor, outcry", medium_definition: "(a) a shout, cry, clamor, (b) outcry, clamoring against another.", long_definition: " from krazw - krazo <a>2896</a>; an outcry (in notification, tumult or grief):--clamour, cry(-ing)." })
NTGreekWord.create({strong_id: 2907, form: "κρέας, έως, τό", pos: "Noun, Neuter", transliteration: "kreas", phonetic_spelling: "(kreh'-as)", short_definition: "flesh, kinds of flesh", medium_definition: "flesh; plur: pieces of flesh, kinds of flesh.", long_definition: " perhaps a primary word; (butcher's) meat:--flesh." })
NTGreekWord.create({strong_id: 2908, form: "κρείσσων, ον", pos: "Adjective", transliteration: "kreisson", phonetic_spelling: "(krice'-son)", short_definition: "stronger, more excellent", medium_definition: "stronger, more excellent.", long_definition: " neuter of an alternate form of kreittwn - kreitton <a>2909</a>; (as noun) better, i.e. greater advantage:--better." })
NTGreekWord.create({strong_id: 2909, form: "κρείττων, ον", pos: "Adjective", transliteration: "kreittón or kreissón", phonetic_spelling: "(krite'-tohn)", short_definition: "stronger, more excellent", medium_definition: "stronger, more excellent.", long_definition: " comparative of a derivative of kratoV - kratos <a>2904</a>; stronger, i.e. (figuratively) better, i.e. nobler:--best, better." })
NTGreekWord.create({strong_id: 2910, form: "κρεμάννυμι", pos: "Verb", transliteration: "kremannumi", phonetic_spelling: "(krem-an'-noo-mee)", short_definition: "I hang up, suspend", medium_definition: "I hang, hang up, suspend; mid: I am hanging, hang.", long_definition: " a prolonged form of a primary verb; to hang:--hang." })
NTGreekWord.create({strong_id: 2911, form: "κρημνός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "krémnos", phonetic_spelling: "(krame-nos')", short_definition: "a crag, precipice", medium_definition: "a crag, precipice, steep bank.", long_definition: " from kremannumi - kremannumi <a>2910</a>; overhanging, i.e. a precipice:--steep place." })
NTGreekWord.create({strong_id: 2912, form: "Κρής, ητός, ὁ", pos: "Noun, Masculine", transliteration: "Krés", phonetic_spelling: "(krace)", short_definition: "a Cretan", medium_definition: "a Cretan, an inhabitant of Crete.", long_definition: " from Krhth - Krete <a>2914</a>; a Cretan, i.e. inhabitant of Crete:--Crete, Cretian." })
NTGreekWord.create({strong_id: 2913, form: "Κρήσκης, κεντος, ὁ", pos: "Noun, Masculine", transliteration: "Kréskés", phonetic_spelling: "(krace'-kace)", short_definition: "Crescens", medium_definition: "Crescens, a Christian, coadjutor of Paul.", long_definition: " of Latin origin; growing; Cresces (i.e. Crescens), a Christian:--Crescens." })
NTGreekWord.create({strong_id: 2914, form: "Κρήτη, ης, ἡ", pos: "Noun, Feminine", transliteration: "Krété", phonetic_spelling: "(kray'-tay)", short_definition: "Crete", medium_definition: "Crete.", long_definition: " of uncertain derivation; Crete, an island in the Mediterranean:--Crete." })
NTGreekWord.create({strong_id: 2915, form: "κριθή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "krithé", phonetic_spelling: "(kree-thay')", short_definition: "barley", medium_definition: "barley.", long_definition: " of uncertain derivation; barley:--barley." })
NTGreekWord.create({strong_id: 2916, form: "κρίθινος, η, ον", pos: "Adjective", transliteration: "krithinos", phonetic_spelling: "(kree'-thee-nos)", short_definition: "made of barley", medium_definition: "made of barley.", long_definition: " from kriqh - krithe <a>2915</a>; consisting of barley:--barley." })
NTGreekWord.create({strong_id: 2917, form: "κρίμα, ατος, τό", pos: "Noun, Neuter", transliteration: "krima", phonetic_spelling: "(kree'-mah)", short_definition: "a judgment, verdict, lawsuit", medium_definition: "(a) a judgment, a verdict; sometimes implying an adverse verdict, a condemnation, (b) a case at law, a lawsuit.", long_definition: " from krinw - krino <a>2919</a>; a decision (the function or the effect, for or against (\"crime\")):--avenge, condemned, condemnation, damnation, + go to law, judgment." })
NTGreekWord.create({strong_id: 2918, form: "κρίνον, ου, τό", pos: "Noun, Neuter", transliteration: "krinon", phonetic_spelling: "(kree'-non)", short_definition: "a lily", medium_definition: "a lily growing wild, variously identified with the red anemone, the whole lily, the sword lily.", long_definition: " perhaps a prim word; a lily:--lily." })
NTGreekWord.create({strong_id: 2919, form: "κρίνω", pos: "Verb", transliteration: "krinó", phonetic_spelling: "(kree'-no)", short_definition: "I judge, decide, think good", medium_definition: "(a) I judge, whether in a law-court or privately: sometimes with cognate nouns emphasizing the notion of the verb, (b) I decide, I think (it) good.", long_definition: " properly, to distinguish, i.e. decide (mentally or judicially); by implication, to try, condemn, punish:--avenge, conclude, condemn, damn, decree, determine, esteem, judge, go to (sue at the) law, ordain, call in question, sentence to, think." })
NTGreekWord.create({strong_id: 2920, form: "κρίσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "krisis", phonetic_spelling: "(kree'-sis)", short_definition: "judging, divine judgment", medium_definition: "judging, judgment, decision, sentence; generally: divine judgment; accusation.", long_definition: " decision (subjectively or objectively, for or against); by extension, a tribunal; by implication, justice (especially, divine law):--accusation, condemnation, damnation, judgment." })
