NTGreekWord.create({strong_id: 2982, form: "λιμά", pos: "Aramaic Transliterated Word (Indeclinable); Hebrew", transliteration: "lama", phonetic_spelling: "(lam-ah')", short_definition: "why", medium_definition: "(Hebrew), why.", long_definition: " from lalew - laleo <a>2980</a>; talk:--saying, speech." })
NTGreekWord.create({strong_id: 2983, form: "λαμβάνω", pos: "Verb", transliteration: "lambanó", phonetic_spelling: "(lam-ban'-o)", short_definition: "I receive, take", medium_definition: "(a) I receive, get, (b) I take, lay hold of.", long_definition: " or lamma lam-mah'; of Hebrew origin (mah <a>4100</a> with prepositional prefix); lama (i.e. why):--lama." })
NTGreekWord.create({strong_id: 2984, form: "Λάμεχ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Lamech", phonetic_spelling: "(lam'-ekh)", short_definition: "Lamech", medium_definition: "(Hebrew), Lamech, son of Methuselah and father of Noah.", long_definition: " a prolonged form of a primary verb, which is use only as an alternate in certain tenses; to take (in very many applications, literally and figuratively (properly objective or active, to get hold of; whereas decomai - dechomai <a>138</a> is more violent, to seize or remove)):--accept, + be amazed, assay, attain, bring, X when I call, catch, come on (X unto), + forget, have, hold, obtain, receive (X after), take (away, up)." })
NTGreekWord.create({strong_id: 2985, form: "λαμπάς, άδος, ἡ", pos: "Noun, Feminine", transliteration: "lampas", phonetic_spelling: "(lam-pas')", short_definition: "a torch, lamp, lantern", medium_definition: "a torch, lamp, lantern.", long_definition: " of Hebrew origin (Lemek <a>3929</a>; Lamech (i.e. Lemek), a patriarch:--Lamech." })
NTGreekWord.create({strong_id: 2986, form: "λαμπρός, ά, όν", pos: "Adjective", transliteration: "lampros", phonetic_spelling: "(lam-pros')", short_definition: "shining, magnificent, bright", medium_definition: "shining, magnificent, bright, splendid.", long_definition: " from lampw - lampo <a>2989</a>; a \"lamp\" or flambeau:--lamp, light, torch." })
NTGreekWord.create({strong_id: 2987, form: "λαμπρότης, τητος, ἡ", pos: "Noun, Feminine", transliteration: "lamprotés", phonetic_spelling: "(lam-prot'-ace)", short_definition: "splendor, brightness", medium_definition: "splendor, brightness, brilliancy.", long_definition: " from the same as lampaV - lampas <a>2985</a>; radiant; by analogy, limpid; figuratively, magnificent or sumptuous (in appearance):--bright, clear, gay, goodly, gorgeous, white." })
NTGreekWord.create({strong_id: 2988, form: "λαμπρῶς", pos: "Adverb", transliteration: "lamprós", phonetic_spelling: "(lam-proce')", short_definition: "magnificently, sumptuously", medium_definition: "magnificently, sumptuously, splendidly.", long_definition: " from lamproV - lampros <a>2986</a>; brilliancy:--brightness." })
NTGreekWord.create({strong_id: 2989, form: "λάμπω", pos: "Verb", transliteration: "lampó", phonetic_spelling: "(lam'-po)", short_definition: "I shine", medium_definition: "I shine, give light.", long_definition: " adverb from lamproV - lampros <a>2986</a>; brilliantly, i.e. figuratively, luxuriously:--sumptuously." })
NTGreekWord.create({strong_id: 2990, form: "λανθάνω", pos: "Verb", transliteration: "lanthanó", phonetic_spelling: "(lan-than'-o)", short_definition: "I am hidden, escape notice", medium_definition: "I am hidden (concealed), lie hid, escape notice, sometimes with acc. of person from whom concealment takes place; I do so and so unconsciously, unknown to myself, I shut my eyes to so and so.", long_definition: " a primary verb; to beam, i.e. radiate brilliancy (literally or figuratively):--give light, shine." })
NTGreekWord.create({strong_id: 2991, form: "λαξευτός, ή, όν", pos: "Adjective", transliteration: "laxeutos", phonetic_spelling: "(lax-yoo-tos')", short_definition: "hewn out of the rock", medium_definition: "hewn out of the rock.", long_definition: " a prolonged form of a primary verb, which is used only as an alternate in certain tenses; to lie hid (literally or figuratively); often used adverbially, unwittingly:--be hid, be ignorant of, unawares." })
NTGreekWord.create({strong_id: 2992, form: "λαός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "laos", phonetic_spelling: "(lah-os')", short_definition: "a people, the crowd", medium_definition: "(a) a people, characteristically of God's chosen people, first the Jews, then the Christians, (b) sometimes, but rarely, the people, the crowd.", long_definition: " from a compound of las (a stone) and the base of xhroV - xeros <a>3584</a> (in its original sense of scraping); rock-quarried:--hewn in stone." })
NTGreekWord.create({strong_id: 2993, form: "Λαοδικεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Laodikeia", phonetic_spelling: "(lah-od-ik'-i-ah)", short_definition: "Laodicea", medium_definition: "Laodicea, a city in the Lycos valley in the Roman province Asia, near Colossae and Hierapolis.", long_definition: " apparently a primary word; a people (in general; thus differing from dhmoV - demos <a>1218</a>, which denotes one's own populace):--people." })
NTGreekWord.create({strong_id: 2994, form: "Λαοδικεύς, έως, ὁ", pos: "Noun, Masculine", transliteration: "Laodikeus", phonetic_spelling: "(lah-od-ik-yooce')", short_definition: "a Laodicean", medium_definition: "a Laodicean, an inhabitant of Laodicea.", long_definition: " from a compound of laoV - laos <a>1349</a>; Laodicia, a place in Asia Minor:--Laodicea." })
NTGreekWord.create({strong_id: 2995, form: "λάρυγξ, υγγος, ὁ", pos: "Noun, Masculine", transliteration: "larugx", phonetic_spelling: "(lar'-oongks)", short_definition: "the throat", medium_definition: "the throat, gullet.", long_definition: " from Laodikeia - Laodikeia <a>2993</a>; a Laodicean, i.e. inhabitant of Laodicia:--Laodicean." })
NTGreekWord.create({strong_id: 2996, form: "Λασαία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Lasaia", phonetic_spelling: "(las-ah'-yah)", short_definition: "Lasea", medium_definition: "Lasea, a city in Crete, about the middle of the south coast.", long_definition: " of uncertain derivation; the throat (\"larynx\"):--throat." })
NTGreekWord.create({strong_id: 2997, form: "λάσκω", pos: "Verb", transliteration: "laskó", phonetic_spelling: "(las'-kho)", short_definition: "I burst asunder with a loud noise", medium_definition: "I burst asunder with a loud noise.", long_definition: " of uncertain origin; Lasaea, a place in Crete:--Lasea." })
NTGreekWord.create({strong_id: 2998, form: "λατομέω", pos: "Verb", transliteration: "latomeó", phonetic_spelling: "(lat-om-eh'-o)", short_definition: "I hew stones", medium_definition: "I hew stones, cut stones.", long_definition: " a strengthened form of a primary verb, which only occurs in this and another prolonged form as alternate in certain tenses; to crack open (from a fall):--burst asunder." })
NTGreekWord.create({strong_id: 2999, form: "λατρεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "latreia", phonetic_spelling: "(lat-ri'-ah)", short_definition: "service, worship", medium_definition: "service rendered to God, perhaps simply: worship.", long_definition: " from the same as the first part of laxeutoV - laxeutos <a>5114</a>; to quarry:--hew." })
NTGreekWord.create({strong_id: 3000, form: "λατρεύω", pos: "Verb", transliteration: "latreuó", phonetic_spelling: "(lat-ryoo'-o)", short_definition: "I serve, worship", medium_definition: "I serve, especially God, perhaps simply: I worship.", long_definition: " from latreuw - latreuo <a>3000</a>; ministration of God, i.e. worship:--(divine) service." })
NTGreekWord.create({strong_id: 3001, form: "λάχανον, ου, τό", pos: "Noun, Neuter", transliteration: "lachanon", phonetic_spelling: "(lakh'-an-on)", short_definition: "an herb, garden plant", medium_definition: "an herb, garden plant, vegetable.", long_definition: " from lachaino (to dig); a vegetable:--herb." })
NTGreekWord.create({strong_id: 3002, form: "Λεββαῖος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Lebbaios", phonetic_spelling: "(leb-bah'-yos)", short_definition: "Lebbaeus", medium_definition: "Lebbaeus, a pet-name for Thaddaeus, one of the twelve apostles of Jesus; the full form of the name is not known.", long_definition: " of uncertain origin; Lebbaeus, a Christian:--Lebbaeus." })
NTGreekWord.create({strong_id: 3003, form: "λεγεών, ῶνος, ἡ", pos: "Noun, Feminine; Noun, Masculine", transliteration: "legión", phonetic_spelling: "(leg-eh-ohn')", short_definition: "a legion, very large number", medium_definition: "properly: a division of the Roman army, numbering about 6,000 infantry with additional cavalry; hence: a very large number; a legion.", long_definition: " of Latin origin; a \"legion\", i.e. Roman regiment (figuratively):--legion." })
NTGreekWord.create({strong_id: 3004, form: "λέγω", pos: "Verb", transliteration: "legó", phonetic_spelling: "(leg'-o)", short_definition: "I say, speak", medium_definition: "(denoting speech in progress), (a) I say, speak; I mean, mention, tell, (b) I call, name, especially in the pass., (c) I tell, command.", long_definition: " a primary verb; properly, to \"lay\" forth, i.e. (figuratively) relate (in words (usually of systematic or set discourse; whereas epw - epo <a>2980</a> means an extended or random harangue)); by implication, to mean:--ask, bid, boast, call, describe, give out, name, put forth, say(-ing, on), shew, speak, tell, utter." })
NTGreekWord.create({strong_id: 3005, form: "λεῖμμα, ατος, τό", pos: "Noun, Neuter", transliteration: "leimma", phonetic_spelling: "(lime'-mah)", short_definition: "a remnant, remainder", medium_definition: "a remnant, remainder.", long_definition: " from leipw - leipo <a>3007</a>; a remainder:--remnant." })
NTGreekWord.create({strong_id: 3006, form: "λεῖος, α, ον", pos: "Adjective", transliteration: "leios", phonetic_spelling: "(li'-os)", short_definition: "smooth, level", medium_definition: "smooth, level, plain.", long_definition: " apparently a primary word; smooth, i.e. \"level\":--smooth." })
NTGreekWord.create({strong_id: 3007, form: "λείπω", pos: "Verb", transliteration: "leipó", phonetic_spelling: "(li'-po)", short_definition: "I am wanting, am left behind", medium_definition: "(earlier: I leave behind, abandon), (a) I am wanting, (b) mid: e.g. with gen: I come behind (in a race), am left behind in, fall short of (some standard), am wanting in.", long_definition: " a primary verb; to leave, i.e. (intransitively or passively) to fail or be absent:--be destitute (wanting), lack." })
NTGreekWord.create({strong_id: 3008, form: "λειτουργέω", pos: "Verb", transliteration: "leitourgeó", phonetic_spelling: "(li-toorg-eh'-o)", short_definition: "I minister, serve publicly", medium_definition: "I act in the public service, render service, minister, in the widest sense, of some special public religious service, but also of the service of priests and Levites.", long_definition: " from leitourgoV - leitourgos <a>3011</a>; to be a public servant, i.e. (by analogy) to perform religious or charitable functions (worship, obey, relieve):--minister." })
