NTGreekWord.create({strong_id: 3010, form: "λειτουργικός, ή, όν", pos: "Adjective", transliteration: "leitourgikos", phonetic_spelling: "(li-toorg-ik-os')", short_definition: "ministering", medium_definition: "given to serving (ministration), ministering.", long_definition: " from the same as leitourgew - leitourgeo <a>3008</a>; functional publicly (\"liturgic\"); i.e. beneficient:--ministering." })
