NTGreekWord.create({strong_id: 3012, form: "λέντιον, ου, τό", pos: "Noun, Neuter", transliteration: "lention", phonetic_spelling: "(len'-tee-on)", short_definition: "a towel, apron", medium_definition: "a towel, apron, coarse cloth.", long_definition: " of Latin origin; a \"linen\" cloth, i.e. apron:--towel." })
NTGreekWord.create({strong_id: 3013, form: "λεπίς, ίδος, ἡ", pos: "Noun, Feminine", transliteration: "lepis", phonetic_spelling: "(lep-is')", short_definition: "a scale, scaly substance", medium_definition: "a scale, a scaly substance thrown off from the body.", long_definition: " from lepo (to peel); a flake:--scale." })
NTGreekWord.create({strong_id: 3014, form: "λέπρα, ας, ἡ", pos: "Noun, Feminine", transliteration: "lepra", phonetic_spelling: "(lep'-rah)", short_definition: "leprosy", medium_definition: "leprosy.", long_definition: " from the same as lepiV - lepis <a>3013</a>; scaliness, i.e. \"leprosy\":--leprosy." })
NTGreekWord.create({strong_id: 3015, form: "λεπρός, οῦ, ὁ", pos: "Adjective", transliteration: "lepros", phonetic_spelling: "(lep-ros')", short_definition: "a leper", medium_definition: "a leprous person, a leper.", long_definition: " from the same as lepra - lepra <a>3014</a>; scaly, i.e. leprous (a leper):--leper." })
NTGreekWord.create({strong_id: 3016, form: "λεπτόν, οῦ, τό", pos: "Noun, Neuter", transliteration: "leptos", phonetic_spelling: "(lep-ton')", short_definition: "a small piece of money", medium_definition: "a small piece of money, probably the smallest piece of money.", long_definition: " neuter of a derivative of the same as lepiV - lepis <a>3013</a>; something scaled (light), i.e. a small coin:--mite." })
NTGreekWord.create({strong_id: 3017, form: "Λευΐ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Leui", phonetic_spelling: "(lyoo'-ee)", short_definition: "Levi", medium_definition: "(Hebrew), Levi, (a) an ancestor of Jesus, (b) another ancestor of Jesus, (c) third son of Jacob, the patriarch, and founder of a tribe named after him, (d) son of Alphaeus, and called Matthew, a revenue officer and one of the twelve apostles of Jesus.", long_definition: " of Hebrew origin (Leviy <a>3018</a>." })
NTGreekWord.create({strong_id: 3018, form: "Λευΐς, ὁ", pos: "Noun, Masculine; Proper Noun, Indeclinable", transliteration: "Leuis", phonetic_spelling: "(lyoo-is')", short_definition: "Levi", medium_definition: "(Hebrew), Levi, son of Alphaeus, the publican.", long_definition: " a form of Leui - Leui <a>3017</a>; Lewis (i.e. Levi), a Christian:--Levi." })
NTGreekWord.create({strong_id: 3019, form: "Λευΐτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "Leuités", phonetic_spelling: "(lyoo-ee'-tace)", short_definition: "a Levite", medium_definition: "a Levite, properly a man of the tribe of Levi; hence: a priest's assistant, an under priest, as the members of that tribe were charged with this duty.", long_definition: " from Leui - Leui <a>3017</a>; a Levite, i.e. descendant of Levi:--Levite." })
NTGreekWord.create({strong_id: 3020, form: "Λευϊτικός, ή, όν", pos: "Adjective", transliteration: "Leuitikos", phonetic_spelling: "(lyoo-it'-ee-kos)", short_definition: "Levitical", medium_definition: "belonging to the tribe of Levi; Levitical.", long_definition: " from LeuithV - Leuites <a>3019</a>; Levitic, i.e. relating to the Levites:--Levitical." })
NTGreekWord.create({strong_id: 3021, form: "λευκαίνω", pos: "Verb", transliteration: "leukainó", phonetic_spelling: "(lyoo-kah'-ee-no)", short_definition: "I whiten", medium_definition: "I whiten, make white.", long_definition: " from leukoV - leukos <a>3022</a>; to whiten:--make white, whiten." })
NTGreekWord.create({strong_id: 3022, form: "λευκός, ή, όν", pos: "Adjective", transliteration: "leukos", phonetic_spelling: "(lyoo-kos')", short_definition: "white, bright", medium_definition: "white, bright, brilliant.", long_definition: " from luke (\"light\"); white:--white." })
NTGreekWord.create({strong_id: 3023, form: "λέων, οντος, ὁ", pos: "Noun, Masculine", transliteration: "león", phonetic_spelling: "(leh-ohn')", short_definition: "a lion", medium_definition: "a lion.", long_definition: " a primary word; a \"lion\":--lion." })
NTGreekWord.create({strong_id: 3024, form: "λήθη, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "léthé", phonetic_spelling: "(lay'-thay)", short_definition: "forgetfulness", medium_definition: "forgetfulness, oblivion.", long_definition: " from lanqanw - lanthano <a>2990</a>; forgetfulness:--+ forget." })
NTGreekWord.create({strong_id: 3025, form: "ληνός, οῦ, ὁ, ἡ", pos: "Noun, Feminine", transliteration: "lenos", phonetic_spelling: "(lay-nos')", short_definition: "a winepress", medium_definition: "a trough, vat, winepress.", long_definition: " apparently a primary word; a trough, i.e. wine-vat:--winepress." })
NTGreekWord.create({strong_id: 3026, form: "λῆρος, ου, ὁ", pos: "Noun, Masculine", transliteration: "léros", phonetic_spelling: "(lay'-ros)", short_definition: "folly, nonsense, idle talk", medium_definition: "folly, nonsense, idle talk.", long_definition: " apparently a primary word; twaddle, i.e. an incredible story:--idle tale." })
NTGreekWord.create({strong_id: 3027, form: "λῃστής, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "léstés", phonetic_spelling: "(lace-tace')", short_definition: "a robber, brigand, bandit", medium_definition: " a robber, brigand, bandit.", long_definition: " from leizomai (to plunder); a brigand:--robber, thief." })
NTGreekWord.create({strong_id: 3028, form: "λῆψις, εως, ἡ", pos: "Noun, Feminine", transliteration: "lépsis", phonetic_spelling: "(lape'-sis)", short_definition: "a receiving", medium_definition: "a receiving.", long_definition: " from lambanw - lambano <a>2983</a>; receipt (the act):--receiving." })
NTGreekWord.create({strong_id: 3029, form: "λίαν", pos: "Adverb", transliteration: "lian", phonetic_spelling: "(lee'-an)", short_definition: "very, very much, exceedingly", medium_definition: "very; very much, exceedingly, greatly.", long_definition: " of uncertain affinity; much (adverbially):--exceeding, great(-ly), sore, very (+ chiefest)." })
