NTGreekWord.create({strong_id: 3034, form: "λιθάζω", pos: "Verb", transliteration: "lithazó", phonetic_spelling: "(lith-ad'-zo)", short_definition: "I stone", medium_definition: "I stone, pelt with stones.", long_definition: " from liqoV - lithos <a>3037</a>; to lapidate:--stone." })
NTGreekWord.create({strong_id: 3035, form: "λίθινος, η, ον", pos: "Adjective", transliteration: "lithinos", phonetic_spelling: "(lith-ee'-nos)", short_definition: "made of stone", medium_definition: "made of stone.", long_definition: " from liqoV - lithos <a>3037</a>; stony, i.e. made of stone:--of stone." })
