NTGreekWord.create({strong_id: 3037, form: "λίθος, ου, ὁ", pos: "Noun, Masculine", transliteration: "lithos", phonetic_spelling: "(lee'-thos)", short_definition: "a stone", medium_definition: "a stone; met: of Jesus as the chief stone in a building.", long_definition: " apparently a primary word; a stone (literally or figuratively):--(mill-, stumbling-)stone." })
NTGreekWord.create({strong_id: 3038, form: "λιθόστρωτον, ου, τό", pos: "Adjective", transliteration: "lithostrótos", phonetic_spelling: "(lith-os'-tro-tos)", short_definition: "a mosaic pavement", medium_definition: "(adj: paved with stone), a mosaic pavement.", long_definition: " from liqoV - lithos <a>4766</a>; stone-strewed, i.e. a tessellated mosaic on which the Roman tribunal was placed:--Pavement." })
NTGreekWord.create({strong_id: 3039, form: "λικμάω", pos: "Verb", transliteration: "likmaó", phonetic_spelling: "(lik-mah'-o)", short_definition: "I crush to powder", medium_definition: "I crush to powder, scatter like chaff.", long_definition: " from likmos, the equivalent of liknon (a winnowing fan or basket); to winnow, i.e. (by analogy), to triturate:--grind to powder." })
NTGreekWord.create({strong_id: 3040, form: "λιμήν, ένος, ὁ", pos: "Noun, Masculine", transliteration: "limén", phonetic_spelling: "(lee-mane')", short_definition: "a harbor, port", medium_definition: "a harbor, port, haven.", long_definition: " apparently a primary word; a harbor:--haven. Compare Kaloi LimeneV - Kaloi Limenes <a>2568</a>." })
