NTGreekWord.create({strong_id: 3166, form: "μεγαλαυχέω", pos: "Verb", transliteration: "megalaucheó", phonetic_spelling: "(meg-al-ow-kheh'-o)", short_definition: "I boast, am arrogant, vaunt", medium_definition: "I boast, am arrogant, vaunt.", long_definition: " from a compound of megaV - megas <a>837</a> and 2744); to talk big, i.e. be grandiloquent (arrogant, egotistic):--boast great things." })
