NTGreekWord.create({strong_id: 3170, form: "μεγαλύνω", pos: "Verb", transliteration: "megalunó", phonetic_spelling: "(meg-al-oo'-no)", short_definition: "I enlarge, magnify, extol", medium_definition: "(a) I enlarge, lengthen, (b) I increase, magnify, extol.", long_definition: " from megaV - megas <a>3173</a>; to make (or declare) great, i.e. increase or (figuratively) extol:--enlarge, magnify, shew great." })
