NTGreekWord.create({strong_id: 3534, form: "νῖκος, ους, τό", pos: "Noun, Neuter", transliteration: "nikos", phonetic_spelling: "(nee'-kos)", short_definition: "victory", medium_definition: "victory.", long_definition: " from nikh - nike <a>3529</a>; a conquest (concretely), i.e. (by implication) triumph:--victory." })
NTGreekWord.create({strong_id: 3535, form: "Νινευΐ, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Nineui", phonetic_spelling: "(nin-yoo-ee')", short_definition: "Nineveh", medium_definition: "Nineveh, a city on the Tigris in Assyria.", long_definition: " of Hebrew origin (Niynveh <a>5210</a>; Ninevi (i.e. Nineveh), the capital of Assyria:--Nineve." })
NTGreekWord.create({strong_id: 3536, form: "Νινευίτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "Nineuités", phonetic_spelling: "(nin-yoo-ee'-tace)", short_definition: "a Ninevite", medium_definition: "a Ninevite, an inhabitant of Nineveh, a city on the Tigris in Assyria.", long_definition: " from Nineui - Nineui <a>3535</a>; a Ninevite, i.e. inhabitant of Nineveh:--of Nineve, Ninevite." })
NTGreekWord.create({strong_id: 3537, form: "νιπτήρ, ῆρος, ὁ", pos: "Noun, Masculine", transliteration: "niptér", phonetic_spelling: "(nip-tare')", short_definition: "a basin", medium_definition: "a basin for washing hands or feet.", long_definition: " from niptw - nipto <a>3538</a>; a ewer:--bason." })
NTGreekWord.create({strong_id: 3538, form: "νίπτω", pos: "Verb", transliteration: "niptó", phonetic_spelling: "(nip'-to)", short_definition: "I wash", medium_definition: "I wash; mid. I wash my own (hands, etc.).", long_definition: " to cleanse (especially the hands or the feet or the face); ceremonially, to perform ablution:--wash. Compare louw - louo <a>3068</a>." })
NTGreekWord.create({strong_id: 3539, form: "νοέω", pos: "Verb", transliteration: "noeó", phonetic_spelling: "(noy-eh'-o)", short_definition: "I understand, consider", medium_definition: "I understand, think, consider, conceive, apprehend; aor. possibly: realize.", long_definition: " from nouV - nous <a>3563</a>; to exercise the mind (observe), i.e. (figuratively) to comprehend, heed:--consider, perceive, think, understand." })
