NTGreekWord.create({strong_id: 3541, form: "νόθος, η, ον", pos: "Adjective", transliteration: "nothos", phonetic_spelling: "(noth'-os)", short_definition: "illegitimate, bastard", medium_definition: "illegitimate, base-born.", long_definition: " of uncertain affinity; a spurious or illegitimate son:--bastard." })
NTGreekWord.create({strong_id: 3542, form: "νομή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "nomé", phonetic_spelling: "(nom-ay')", short_definition: "pasturage, growth", medium_definition: "(a) pasture, pasturage, (b) met: growth, increase.", long_definition: " feminine from the same as nomoV - nomos <a>3551</a>; pasture, i.e. (the act) feeding (figuratively, spreading of a gangrene), or (the food) pasturage:--X eat, pasture." })
NTGreekWord.create({strong_id: 3543, form: "νομίζω", pos: "Verb", transliteration: "nomizó", phonetic_spelling: "(nom-id'-zo)", short_definition: "I think, suppose", medium_definition: "I practice, hold by custom; I deem, think, consider, suppose.", long_definition: " from nomoV - nomos <a>3551</a>; properly, to do by law (usage), i.e. to accustom (passively, be usual); by extension, to deem or regard:-- suppose, thing, be wont." })
NTGreekWord.create({strong_id: 3544, form: "νομικός, ή, όν", pos: "Adjective", transliteration: "nomikos", phonetic_spelling: "(nom-ik-os')", short_definition: "about law, one learned in the Law", medium_definition: "(a) adj: connected with law, about law, (b) noun: a lawyer, one learned in the Law, one learned in the Old Testament.", long_definition: " from nomoV - nomos <a>3551</a>; according (or pertaining) to law, i.e. legal (ceremonially); as noun, an expert in the (Mosaic) law:--about the law, lawyer." })
NTGreekWord.create({strong_id: 3545, form: "νομίμως", pos: "Adverb", transliteration: "nomimós", phonetic_spelling: "(nom-im'-oce)", short_definition: "lawfully", medium_definition: "lawfully, rightfully.", long_definition: " adverb from a derivative of nomoV - nomos <a>3551</a>; legitimately (specially, agreeably to the rules of the lists):--lawfully." })
NTGreekWord.create({strong_id: 3546, form: "νόμισμα, ατος, τό", pos: "Noun, Neuter", transliteration: "nomisma", phonetic_spelling: "(nom'-is-mah)", short_definition: "money, coin", medium_definition: "money, coin.", long_definition: " from nomizw - nomizo <a>3543</a>; what is reckoned as of value (after the Latin numisma), i.e. current coin:--money." })
NTGreekWord.create({strong_id: 3547, form: "νομοδιδάσκαλος, ου, ὁ", pos: "Noun, Masculine", transliteration: "nomodidaskalos", phonetic_spelling: "(nom-od-id-as'-kal-os)", short_definition: "a teacher and interpreter of the Mosaic Law", medium_definition: "a teacher and interpreter of the Mosaic Law.", long_definition: " from nomoV - nomos <a>1320</a>; an expounder of the (Jewish) law, i.e. a Rabbi:--doctor (teacher) of the law." })
NTGreekWord.create({strong_id: 3548, form: "νομοθεσία, ας, ἡ", pos: "Noun, Feminine", transliteration: "nomothesia", phonetic_spelling: "(nom-oth-es-ee'-ah)", short_definition: "lawgiving, legislation", medium_definition: "lawgiving, legislation.", long_definition: " from nomoqethV - nomothetes <a>3550</a>; legislation (specially, the institution of the Mosaic code):--giving of the law." })
NTGreekWord.create({strong_id: 3549, form: "νομοθετέω", pos: "Verb", transliteration: "nomotheteó", phonetic_spelling: "(nom-oth-et-eh'-o)", short_definition: "I ordain, enact", medium_definition: "(a) I ordain, lay down, give the sanction of law to, enact, (b) I base legally, regulate, direct.", long_definition: " from nomoqethV - nomothetes <a>3550</a>; to legislate, i.e. (passively) to have (the Mosaic) enactments injoined, be sanctioned (by them):--establish, receive the law." })
NTGreekWord.create({strong_id: 3550, form: "νομοθέτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "nomothetés", phonetic_spelling: "(nom-oth-et'-ace)", short_definition: "a law-giver, legislator", medium_definition: "a law-giver, legislator.", long_definition: " from nomoV - nomos <a>5087</a>; a legislator:--lawgiver." })
NTGreekWord.create({strong_id: 3551, form: "νόμος, ου, ὁ", pos: "Noun, Masculine", transliteration: "nomos", phonetic_spelling: "(nom'-os)", short_definition: "a law, the Mosaic Law", medium_definition: "usage, custom, law; in NT: of law in general, plur: of divine laws; of a force or influence impelling to action; of the Mosaic law; meton: of the books which contain the law, the Pentateuch, the Old Testament scriptures in general.", long_definition: " from a primary nemo (to parcel out, especially food or grazing to animals); law (through the idea of prescriptive usage), genitive case (regulation), specially, (of Moses (including the volume); also of the Gospel), or figuratively (a principle):--law." })
NTGreekWord.create({strong_id: 3552, form: "νοσέω", pos: "Verb", transliteration: "noseó", phonetic_spelling: "(nos-eh'-o)", short_definition: "I am diseased", medium_definition: "I am diseased, hence of mental or spiritual disease.", long_definition: " from nosoV - nosos <a>3554</a>; to be sick, i.e. (by implication, of a diseased appetite) to hanker after (figuratively, to harp upon):--dote." })
NTGreekWord.create({strong_id: 3553, form: "νόσημα, ατος, τό", pos: "Noun, Neuter", transliteration: "noséma", phonetic_spelling: "(nos'-ay-ma)", short_definition: "a trouble, disease", medium_definition: "a trouble, disease, sickness.", long_definition: " from nosew - noseo <a>3552</a>; an ailment:--disease." })
NTGreekWord.create({strong_id: 3554, form: "νόσος, ου, ἡ", pos: "Noun, Feminine", transliteration: "nosos", phonetic_spelling: "(nos'-os)", short_definition: "a disease, malady", medium_definition: "a disease, malady, sickness.", long_definition: " of uncertain affinity; a malady (rarely figuratively, of moral disability):--disease, infirmity, sickness." })
NTGreekWord.create({strong_id: 3555, form: "νοσσιά, ᾶς, ἡ", pos: "Noun, Feminine", transliteration: "nossia", phonetic_spelling: "(nos-see-ah')", short_definition: "a brood of young birds", medium_definition: "a brood of young birds.", long_definition: " from neossoV - neossos <a>3502</a>; a brood (of chickens):--brood." })
NTGreekWord.create({strong_id: 3556, form: "νοσσίον, ου, τό", pos: "Noun, Neuter", transliteration: "nossion", phonetic_spelling: "(nos-see'-on)", short_definition: "a nestling, the young of birds", medium_definition: "a nestling, the young of birds.", long_definition: " diminutive of neossoV - neossos <a>3502</a>; a birdling:--chicken." })
NTGreekWord.create({strong_id: 3557, form: "νοσφίζω", pos: "Verb", transliteration: "nosphizó", phonetic_spelling: "(nos-fid'-zom-ahee)", short_definition: "I rob, purloin", medium_definition: "I rob; mid: I set apart for myself, appropriate for my own benefit, purloin.", long_definition: " middle voice from nosphi (apart or clandestinely); to sequestrate for oneself, i.e. embezzle:--keep back, purloin." })
NTGreekWord.create({strong_id: 3558, form: "νότος, ου, ὁ", pos: "Noun, Masculine", transliteration: "notos", phonetic_spelling: "(not'-os)", short_definition: "the south wind, the South", medium_definition: "the south wind, the South.", long_definition: " of uncertain affinity; the south(-west) wind; by extension, the southern quarter itself:--south (wind)." })
NTGreekWord.create({strong_id: 3559, form: "νουθεσία, ας, ἡ", pos: "Noun, Feminine", transliteration: "nouthesia", phonetic_spelling: "(noo-thes-ee'-ah)", short_definition: "a warning, admonition", medium_definition: "a warning, admonition, counsel.", long_definition: " from nouV - nous <a>5087</a>; calling attention to, i.e. (by implication) mild rebuke or warning:--admonition." })
