NTGreekWord.create({strong_id: 3563, form: "νοῦς, νοός, νοΐ, νοῦν, ὁ", pos: "Noun, Masculine", transliteration: "nous", phonetic_spelling: "(nooce)", short_definition: "the mind, reasoning faculty", medium_definition: "the mind, the reason, the reasoning faculty, intellect.", long_definition: " probably from the base of ginwskw - ginosko <a>5590</a>." })
NTGreekWord.create({strong_id: 3564, form: "Νυμφᾶς, ᾶ, ὁ", pos: "Noun, Masculine", transliteration: "Numpha", phonetic_spelling: "(noom-fas')", short_definition: "Nymphas", medium_definition: "Nymphas, a proper name.", long_definition: " probably contracted for a compound of numfh - numphe <a>1435</a>; nymph-given (i.e. -born); Nymphas, a Christian:--Nymphas." })
