NTGreekWord.create({strong_id: 3568, form: "νῦν", pos: "Adverb", transliteration: "nun", phonetic_spelling: "(noon)", short_definition: "now, already, at present", medium_definition: "adv. (a) of time: just now, even now; just at hand, immediately, (b) of logical connection: now then, (c) in commands and appeals: at this instant.", long_definition: " a primary particle of present time; \"now\" (as adverb of date, a transition or emphasis); also as noun or adjective present or immediate:--henceforth, + hereafter, of late, soon, present, this (time). See also tanun - tanun <a>3570</a>." })
