NTGreekWord.create({strong_id: 3571, form: "νύξ, νυκτός, ἡ", pos: "Noun, Feminine", transliteration: "nux", phonetic_spelling: "(noox)", short_definition: "the night, night-time", medium_definition: "the night, night-time.", long_definition: " a primary word; \"night\" (literally or figuratively):-- (mid-)night." })
