NTGreekWord.create({strong_id: 3573, form: "νυστάζω", pos: "Verb", transliteration: "nustazó", phonetic_spelling: "(noos-tad'-zo)", short_definition: "I nod in sleep, am drowsy, slumber", medium_definition: "I nod in sleep, am drowsy, slumber.", long_definition: " from a presumed derivative of neuw - neuo <a>3506</a>; to nod, i.e. (by implication) to fall asleep; figuratively, to delay:--slumber." })
