NTGreekWord.create({strong_id: 3575, form: "Νῶε, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Nóe", phonetic_spelling: "(no'-eh)", short_definition: "Noah", medium_definition: "(Hebrew) Noah.", long_definition: " of Hebrew origin (Noach <a>5146</a>; Noe, (i.e. Noach), a patriarch:--Noe." })
