NTGreekWord.create({strong_id: 3578, form: "ξενία, ας, ἡ", pos: "Noun, Feminine", transliteration: "xenia", phonetic_spelling: "(xen-ee'-ah)", short_definition: "lodging, hospitality", medium_definition: "lodging, hospitality.", long_definition: "" })
