NTGreekWord.create({strong_id: 3584, form: "ξηρός, ά, όν", pos: "Adjective", transliteration: "xéros", phonetic_spelling: "(xay-ros')", short_definition: "dry, withered, dry land", medium_definition: "dry, withered; noun: dry land.", long_definition: " from xhroV - xeros <a>3584</a>; to desiccate; by implication, to shrivel, to mature:--dry up, pine away, be ripe, wither (away)." })
NTGreekWord.create({strong_id: 3585, form: "ξύλινος, η, ον", pos: "Adjective", transliteration: "xulinos", phonetic_spelling: "(xoo'-lin-os)", short_definition: "wooden", medium_definition: "wooden.", long_definition: " from the base of xesthV - xestes <a>3582</a> (through the idea of scorching); arid; by implication, shrunken, earth (as opposed to water):--dry land, withered." })
