NTGreekWord.create({strong_id: 3589, form: "ὀγδοήκοντα", pos: "Indeclinable Numeral (Adjective)", transliteration: "ogdoékonta", phonetic_spelling: "(og-do-ay'-kon-tah)", short_definition: "eighty", medium_definition: "eighty.", long_definition: "" })
