NTGreekWord.create({strong_id: 3593, form: "ὁδεύω", pos: "Verb", transliteration: "hodeuó", phonetic_spelling: "(hod-yoo'-o)", short_definition: "I journey, travel", medium_definition: "I journey, travel.", long_definition: " probably from the same as agkalh - agkale <a>43</a>; a mass (as bending or bulging by its load), i.e. burden (hindrance):--weight." })
NTGreekWord.create({strong_id: 3594, form: "ὁδηγέω", pos: "Verb", transliteration: "hodégeó", phonetic_spelling: "(hod-ayg-eh'-o)", short_definition: "I lead, guide", medium_definition: "I lead, guide; met: I instruct, teach.", long_definition: "    hede  hay'-deh, and the neuter    tode  tod'-e from o - ho <a>1161</a>; the same, i.e. this or that one (plural these or those); often used as a personal pronoun:--he, she, such, these, thus." })
NTGreekWord.create({strong_id: 3595, form: "ὁδηγός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "hodégos", phonetic_spelling: "(hod-ayg-os')", short_definition: "a leader, guide", medium_definition: "a leader, guide; met: an instructor, teacher.", long_definition: " from odoV - hodos <a>3598</a>; to travel:--journey." })
