NTGreekWord.create({strong_id: 3599, form: "ὀδούς, όντος, ὁ", pos: "Noun, Masculine", transliteration: "odous", phonetic_spelling: "(od-ooce)", short_definition: "a tooth", medium_definition: "a tooth.", long_definition: " from the same as odoiporew - hodoiporeo <a>3596</a>; travel:--journey(-ing)." })
NTGreekWord.create({strong_id: 3600, form: "ὀδυνάω", pos: "Verb", transliteration: "odunaó", phonetic_spelling: "(od-oo-nah'-o)", short_definition: "I torment, pain", medium_definition: "I torment, pain; mid. and pass: I am tormented, pained; I suffer acute pain, physical or mental.", long_definition: " apparently a primary word; a road; by implication, a progress (the route, act or distance); figuratively, a mode or means:--journey, (high-)way." })
NTGreekWord.create({strong_id: 3601, form: "ὀδύνη, ης, ἡ", pos: "Noun, Feminine", transliteration: "oduné", phonetic_spelling: "(od-oo'-nay)", short_definition: "pain, distress", medium_definition: "pain, sorrow, distress, of body or mind.", long_definition: " from dunw - duno <a>1416</a>; grief (as dejecting):--sorrow." })
