NTGreekWord.create({strong_id: 3604, form: "Ὀζίας, ου, ὁ", pos: "Noun, Masculine", transliteration: "Ozias", phonetic_spelling: "(od-zee'-as)", short_definition: "Uzziah", medium_definition: "Uzziah, son of Joram and father of Jotham, and king of Judah from about 785 to 746 B.C., an ancestor of Jesus.", long_definition: " of Hebrew origin (`Uzziyah <a>5818</a>; Ozias (i.e. Uzzijah), an Israelite:--Ozias." })
NTGreekWord.create({strong_id: 3605, form: "ὄζω", pos: "Verb", transliteration: "ozó", phonetic_spelling: "(od'-zo)", short_definition: "I stink, am offensive", medium_definition: "I stink, am offensive.", long_definition: " a primary verb (in a strengthened form); to scent (usually an ill \"odor\"): stink." })
