NTGreekWord.create({strong_id: 3607, form: "ὀθόνη, ης, ἡ", pos: "Noun, Feminine", transliteration: "othoné", phonetic_spelling: "(oth-on'-ay)", short_definition: "a linen cloth, sheet", medium_definition: "a linen cloth, a sheet, sail.", long_definition: " of uncertain affinity; a linen cloth, i.e. (especially) a sail:--sheet." })
NTGreekWord.create({strong_id: 3608, form: "ὀθόνιον, ου, τό", pos: "Noun, Neuter", transliteration: "othonion", phonetic_spelling: "(oth-on'-ee-on)", short_definition: "a linen bandage", medium_definition: "a linen bandage, a wrapping.", long_definition: " neuter of a presumed derivative of oqonh - othone <a>3607</a>; a linen bandage:--linen clothes." })
NTGreekWord.create({strong_id: 3609, form: "οἰκεῖος, α, ον", pos: "Adjective", transliteration: "oikeios", phonetic_spelling: "(oy-ki'-os)", short_definition: "of one's family, domestic", medium_definition: "of one's family, domestic, intimate.", long_definition: " from oikoV - oikos <a>3624</a>; domestic, i.e. (as noun), a relative, adherent:--(those) of the (his own) house(-hold)." })
NTGreekWord.create({strong_id: 3610, form: "οἰκέτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "oiketes", phonetic_spelling: "(oy-ket'-ace)", short_definition: "a household servant", medium_definition: "a household servant.", long_definition: " from oikew - oikeo <a>3611</a>; a fellow resident, i.e. menial domestic:--(household) servant." })
NTGreekWord.create({strong_id: 3611, form: "οἰκέω", pos: "Verb", transliteration: "oikeó", phonetic_spelling: "(oy-keh'-o)", short_definition: "I inhabit, dwell", medium_definition: "I inhabit, dwell, indwell.", long_definition: " from oikoV - oikos <a>3625</a>." })
NTGreekWord.create({strong_id: 3612, form: "οἴκημα, ατος, τό", pos: "Noun, Neuter", transliteration: "oikéma", phonetic_spelling: "(oy'-kay-mah)", short_definition: "a prison", medium_definition: "a prison cell.", long_definition: " from oikew - oikeo <a>3611</a>; a tenement, i.e. (specially), a jail:--prison." })
