NTGreekWord.create({strong_id: 3615, form: "οἰκειακός, ή, όν", pos: "Adjective", transliteration: "oikiakos", phonetic_spelling: "(oy-kee-ak-os')", short_definition: "one of a family", medium_definition: "one of a family, whether child or servant.", long_definition: " from oikia - oikia <a>3614</a>; familiar, i.e. (as noun) relatives:--they (them) of (his own) household." })
