NTGreekWord.create({strong_id: 3620, form: "οἰκοδομία", pos: "oikodomia", transliteration: "(oy-kod-om-ee'-ah)", phonetic_spelling: "edifying", short_definition: "", medium_definition: "", long_definition: " from the same as oikodomh - oikodome <a>3619</a>; confirmation:--edifying." })
NTGreekWord.create({strong_id: 3621, form: "οἰκονομέω", pos: "Verb", transliteration: "oikonomeó", phonetic_spelling: "(oy-kon-om-eh'-o)", short_definition: "I am a steward", medium_definition: "I am a steward, manage a household.", long_definition: " from oikonomoV - oikonomos <a>3623</a>; to manage (a house, i.e. an estate):--be steward." })
NTGreekWord.create({strong_id: 3622, form: "οἰκονομία, ας, ἡ", pos: "Noun, Feminine", transliteration: "oikonomia", phonetic_spelling: "(oy-kon-om-ee'-ah)", short_definition: "stewardship", medium_definition: "management of household affairs, stewardship, administration.", long_definition: " from oikonomoV - oikonomos <a>3623</a>; administration (of a household or estate); specially, a (religious) \"economy\":--dispensation, stewardship." })
