NTGreekWord.create({strong_id: 3624, form: "οἶκος, ου, ὁ", pos: "Noun, Masculine", transliteration: "oikos", phonetic_spelling: "(oy'-kos)", short_definition: "a house, household", medium_definition: "(a) a house, the material building, (b) a household, family, lineage, nation.", long_definition: " of uncertain affinity; a dwelling (more or less extensive, literal or figurative); by implication, a family (more or less related, literally or figuratively):--home, house(-hold), temple." })
