NTGreekWord.create({strong_id: 3626, form: "οὐκουρός, οῦ, ὁ, ἡ", pos: "Adjective", transliteration: "oikourgos", phonetic_spelling: "(oy-koo-ros')", short_definition: "a housekeeper", medium_definition: "a keeper-at-home, a housekeeper.", long_definition: " from oikoV - oikos <a>3624</a> and ouros (a guard; be \"ware\"); a stayer at home, i.e. domestically inclined (a \"good housekeeper\"):--keeper at home." })
NTGreekWord.create({strong_id: 3627, form: "οἰκτείρω", pos: "Verb", transliteration: "oiktiró", phonetic_spelling: "(oyk-ti'-ro)", short_definition: "I pity, have compassion on", medium_definition: "I pity, have compassion on.", long_definition: "    oiktereo oyk-ter-eh'-o from oiktos (pity); to exercise pity:--have compassion on." })
