NTGreekWord.create({strong_id: 3633, form: "οἴμαι", pos: "Verb", transliteration: "oiomai and oimai", phonetic_spelling: "(oy'-om-ahee)", short_definition: "I think, suppose", medium_definition: "I think, suppose, expect, imagine.", long_definition: "    oimai  oy'-mahee     middle voice apparently from oioV - hoios <a>3634</a>; to make like (oneself), i.e. imagine (be of the opinion):--suppose, think." })
