NTGreekWord.create({strong_id: 3646, form: "ὁλοκαύτωμα, ατος, τό", pos: "Noun, Neuter", transliteration: "holokautóma", phonetic_spelling: "(hol-ok-ow'-to-mah)", short_definition: "a whole burnt offering", medium_definition: "a whole burnt offering.", long_definition: " from a derivative of a compound of oloV - holos <a>2545</a>; a wholly-consumed sacrifice (\"holocaust\"):--(whole) burnt offering." })
NTGreekWord.create({strong_id: 3647, form: "ὁλοκληρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "holokléria", phonetic_spelling: "(hol-ok-lay-ree'-ah)", short_definition: "perfect soundness", medium_definition: "perfect soundness, completeness.", long_definition: " from oloklhroV - holokleros <a>3648</a>; integrity, i.e. physical wholeness:--perfect soundness." })
