NTGreekWord.create({strong_id: 3649, form: "ὀλολύζω", pos: "Verb", transliteration: "ololuzó", phonetic_spelling: "(ol-ol-odd'-zo)", short_definition: "I howl, lament loudly", medium_definition: "I howl, lament loudly, cry aloud, bewail.", long_definition: " a reduplicated primary verb; to \"howl\" or \"halloo\", i.e. shriek:--howl." })
NTGreekWord.create({strong_id: 3650, form: "ὅλος, η, ον", pos: "Adjective", transliteration: "holos", phonetic_spelling: "(hol'-os)", short_definition: "all, the whole, entire", medium_definition: "all, the whole, entire, complete.", long_definition: " a primary word; \"whole\" or \"all\", i.e. complete (in extent, amount, time or degree), especially (neuter) as noun or adverb:--all, altogether, every whit, + throughout, whole." })
