NTGreekWord.create({strong_id: 3775, form: "οὖς, ὠτός, τό", pos: "Noun, Neuter", transliteration: "ous", phonetic_spelling: "(ooce)", short_definition: "the ear", medium_definition: "(a) the ear, (b) met: the faculty of perception.", long_definition: " apparently a primary word; the ear (physically or mentally):--ear." })
NTGreekWord.create({strong_id: 3776, form: "οὐσία, ας, ἡ", pos: "Noun, Feminine", transliteration: "ousia", phonetic_spelling: "(oo-see'-ah)", short_definition: "property, wealth", medium_definition: "property, wealth, substance.", long_definition: " from the feminine of  wn - on <a>5607</a>; substance, i.e. property (possessions):--goods, substance." })
