NTGreekWord.create({strong_id: 3778, form: "οὗτος, αὕτη, τοῦτο", pos: "Demonstrative Pronoun", transliteration: "houtos, hauté, touto", phonetic_spelling: "(hoo'-tos)", short_definition: "this, he, she, it", medium_definition: "this; he, she, it.", long_definition: "    houtoi  hoo'-toy, nominative feminine singular    haute  how'-tay, and nominative feminine plural    hautai  how'-tahee from the article o - ho <a>846</a>; the he (she or it), i.e. this or that (often with article repeated):--he (it was that), hereof, it, she, such as, the same, these, they, this (man, same, woman), which, who." })
NTGreekWord.create({strong_id: 3779, form: "οὕτως", pos: "Adverb", transliteration: "houtó and houtós", phonetic_spelling: "(hoo'-to)", short_definition: "thus, so, in this manner", medium_definition: "thus, so, in this manner.", long_definition: "    houtos hoo'-toce adverb from outoV - houtos <a>3778</a>; in this way (referring to what precedes or follows):--after that, after (in) this manner, as, even (so), for all that, like(-wise), no more, on this fashion(-wise), so (in like manner), thus, what." })
NTGreekWord.create({strong_id: 3780, form: "οὐχί", pos: "Particle, Interrogative; Particle, Negative", transliteration: "ouchi", phonetic_spelling: "(oo-khee')", short_definition: "by no means, not at all", medium_definition: "by no means, not at all.", long_definition: " intensive of ou - ou <a>3756</a>; not indeed:--nay, not." })
NTGreekWord.create({strong_id: 3781, form: "ὀφειλέτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "opheiletés", phonetic_spelling: "(of-i-let'-ace)", short_definition: "a debtor, sinner", medium_definition: "(a) a debtor, one who owes, one who is indebted, (b) one who has sinned against another (an Aramaism), a sinner.", long_definition: " from ofeilw - opheilo <a>3784</a>; an ower, i.e. person indebted; figuratively, a delinquent; morally, a transgressor (against God):--debtor, which owed, sinner." })
NTGreekWord.create({strong_id: 3782, form: "ὀφειλή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "opheilé", phonetic_spelling: "(of-i-lay')", short_definition: "a debt, duty", medium_definition: "a debt, a duty, what is due.", long_definition: " from ofeilw - opheilo <a>3784</a>; indebtedness, i.e. (concretely) a sum owed; figuratively, obligation, i.e. (conjugal) duty:--debt, due." })
NTGreekWord.create({strong_id: 3783, form: "ὀφείλημα, ατος, τό", pos: "Noun, Neuter", transliteration: "opheiléma", phonetic_spelling: "(of-i'-lay-mah)", short_definition: "a debt, offense, sin", medium_definition: "a debt, offense, sin.", long_definition: " from (the alternate of) ofeilw - opheilo <a>3784</a>; something owed, i.e. (figuratively) a due; morally, a fault:--debt." })
NTGreekWord.create({strong_id: 3784, form: "ὀφείλω", pos: "Verb", transliteration: "opheiló", phonetic_spelling: "(of-i'-lo)", short_definition: "I owe, ought", medium_definition: "I owe, ought.", long_definition: "    opheileo of-i-leh'-o probably from the base of ofeloV - ophelos <a>3785</a>." })
NTGreekWord.create({strong_id: 3785, form: "ὄφελον", pos: "Verb", transliteration: "ophelon", phonetic_spelling: "(of'-el-on)", short_definition: "O that! I wish! Would that!", medium_definition: "O that! I wish! Would that!, followed by indicative.", long_definition: " first person singular of a past tense of ofeilw - opheilo <a>3784</a>; I ought (wish), i.e. (interjection) oh that!:--would (to God)." })
NTGreekWord.create({strong_id: 3786, form: "ὄφελος, ους, τό", pos: "Noun, Neuter", transliteration: "ophelos", phonetic_spelling: "(of'-el-os)", short_definition: "advantage, gain, profit", medium_definition: "advantage, gain, profit, help.", long_definition: " from ophello (to heap up, i.e. accumulate or benefit); gain:--advantageth, profit." })
NTGreekWord.create({strong_id: 3787, form: "ὀφθαλμοδουλεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "ophthalmodoulia", phonetic_spelling: "(of-thal-mod-oo-li'-ah)", short_definition: "service rendered only while the master watches", medium_definition: "eye-service; service rendered only while the master watches.", long_definition: " from ofqalmoV - ophthalmos <a>1397</a>; sight-labor, i.e. that needs watching (remissness):--eye-service." })
NTGreekWord.create({strong_id: 3788, form: "ὀφθαλμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "ophthalmos", phonetic_spelling: "(of-thal-mos')", short_definition: "the eye", medium_definition: "the eye; fig: the mind's eye.", long_definition: " from optanomai - optanomai <a>3700</a>; the eye (literally or figuratively); by implication, vision; figuratively, envy (from the jealous side-glance):--eye, sight." })
NTGreekWord.create({strong_id: 3789, form: "ὄφις, εως, ὁ", pos: "Noun, Masculine", transliteration: "ophis", phonetic_spelling: "(of'-is)", short_definition: "a serpent", medium_definition: "a serpent, snake; used of the devil or Satan.", long_definition: " probably from optanomai - optanomai <a>3700</a> (through the idea of sharpness of vision); a snake, figuratively, (as a type of sly cunning) an artful malicious person, especially Satan:--serpent." })
