NTGreekWord.create({strong_id: 3791, form: "ὀχλέω", pos: "Verb", transliteration: "ochleó", phonetic_spelling: "(okh-leh'-o)", short_definition: "I trouble, torment, worry", medium_definition: "I trouble, torment, worry, vex.", long_definition: " from ocloV - ochlos <a>3793</a>; to mob, i.e. (by implication) to harass:--vex." })
NTGreekWord.create({strong_id: 3792, form: "ὀχλοποιέω", pos: "Verb", transliteration: "ochlopoieó", phonetic_spelling: "(okh-lop-oy-eh'-o)", short_definition: "I gather a crowd", medium_definition: "I gather a crowd, make a riot.", long_definition: " from ocloV - ochlos <a>4160</a>; to make a crowd, i.e. raise a public disturbance:--gather a company." })
NTGreekWord.create({strong_id: 3793, form: "ὄχλος, ου, ὁ", pos: "Noun, Masculine", transliteration: "ochlos", phonetic_spelling: "(okh'los)", short_definition: "a crowd", medium_definition: "a crowd, mob, the common people.", long_definition: " from a derivative of ecw - echo <a>2192</a> (meaning a vehicle); a throng (as borne along); by implication, the rabble; by extension, a class of people; figuratively, a riot:--company, multitude, number (of people), people, press." })
NTGreekWord.create({strong_id: 3794, form: "ὀχύρωμα, ατος, τό", pos: "Noun, Neuter", transliteration: "ochuróma", phonetic_spelling: "(okh-oo'-ro-mah)", short_definition: "a fortress, strong defense", medium_definition: "a fortress, strong defense, stronghold.", long_definition: " from a remote derivative of ecw - echo <a>2192</a> (meaning to fortify, through the idea of holding safely); a castle (figuratively, argument):--stronghold." })
NTGreekWord.create({strong_id: 3795, form: "ὀψάριον, ου, τό", pos: "Noun, Neuter", transliteration: "opsarion", phonetic_spelling: "(op-sar'-ee-on)", short_definition: "a little fish", medium_definition: "a little fish.", long_definition: " neuter of a presumed derivative of the base of optoV - optos <a>3702</a>; a relish to other food (as if cooked sauce), i.e. (specially), fish (presumably salted and dried as a condiment):--fish." })
NTGreekWord.create({strong_id: 3796, form: "ὀψέ", pos: "Adverb", transliteration: "opse", phonetic_spelling: "(op-seh')", short_definition: "late, in the evening", medium_definition: "late, in the evening.", long_definition: " from the same as opisw - opiso <a>3694</a> (through the idea of backwardness); (adverbially) late in the day; by extension, after the close of the day:--(at) even, in the end." })
NTGreekWord.create({strong_id: 3797, form: "ὄψιμος, ον", pos: "Adjective", transliteration: "opsimos", phonetic_spelling: "(op'-sim-os)", short_definition: "late in the year", medium_definition: "late, latter.", long_definition: " from oye - opse <a>3796</a>; later, i.e. vernal (showering):--latter." })
