NTGreekWord.create({strong_id: 3799, form: "ὄψις, εως, ἡ", pos: "Noun, Feminine", transliteration: "opsis", phonetic_spelling: "(op'-sis)", short_definition: "the features, outward appearance", medium_definition: "(a) the face, countenance, (b) the features, outward appearance.", long_definition: " from optanomai - optanomai <a>3700</a>; properly, sight (the act), i.e. (by implication) the visage, an external show:--appearance, countenance, face." })
NTGreekWord.create({strong_id: 3800, form: "ὀψώνιον, ου, τό", pos: "Noun, Neuter", transliteration: "opsónion", phonetic_spelling: "(op-so'-nee-on)", short_definition: "pay, wages", medium_definition: "pay, wages, salary, reward.", long_definition: " neuter of a presumed derivative of the same as oyarion - opsarion <a>3795</a>; rations for a soldier, i.e. (by extension) his stipend or pay:-- wages." })
NTGreekWord.create({strong_id: 3801, form: "ὁ", pos: "ho ón kai ho én kai ho erchomenos", transliteration: "(ho en kai)", phonetic_spelling: "come", short_definition: "see ", medium_definition: ", ", long_definition: "    ho own kahee ho ane kahee ho er-khom'-en-os a phrase combining o - ho <a>2532</a>; the one being and the one that was and the one coming, i.e. the Eternal, as a divine epithet of Christ:--which art (is, was), and (which) wast (is, was), and art (is) to come (shalt be)." })
NTGreekWord.create({strong_id: 3802, form: "παγιδεύω", pos: "Verb", transliteration: "pagideuó", phonetic_spelling: "(pag-id-yoo'-o)", short_definition: "I ensnare, entrap", medium_definition: "I ensnare, entrap, entangle.", long_definition: "" })
