NTGreekWord.create({strong_id: 3804, form: "πάθημα, ατος, τό", pos: "Noun, Neuter", transliteration: "pathéma", phonetic_spelling: "(path'-ay-mah)", short_definition: "suffering, passion", medium_definition: "(a) suffering, affliction, (b) passion, emotion, (c) an undergoing, an enduring.", long_definition: " from phgnumi - pegnumi <a>4078</a>; a trap (as fastened by a noose or notch); figuratively, a trick or statagem (temptation):--snare." })
