NTGreekWord.create({strong_id: 3806, form: "πάθος, ους, τό", pos: "Noun, Neuter", transliteration: "pathos", phonetic_spelling: "(path'-os)", short_definition: "suffering, emotion, depraved passion, lust", medium_definition: "suffering, emotion, depraved passion, lust.", long_definition: " from the same as paqhma - pathema <a>3804</a>; liable (i.e. doomed) to experience pain:--suffer." })
