NTGreekWord.create({strong_id: 3808, form: "παιδάριον, ου, τό", pos: "Noun, Neuter", transliteration: "paidarion", phonetic_spelling: "(pahee-dar'-ee-on)", short_definition: "a little boy, lad", medium_definition: "a little boy, lad.", long_definition: " from paiV - pais <a>71</a>; a boy-leader, i.e. a servant whose office it was to take the children to school; (by implication, (figuratively) a tutor (\"paedagogue\")):-- instructor, schoolmaster." })
