NTGreekWord.create({strong_id: 3810, form: "παιδευτής, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "paideutés", phonetic_spelling: "(pahee-dyoo-tace')", short_definition: "an instructor", medium_definition: "an instructor, trainer; almost: a chastiser.", long_definition: " from paideuw - paideuo <a>3811</a>; tutorage, i.e. education or training; by implication, disciplinary correction:--chastening, chastisement, instruction, nurture." })
