NTGreekWord.create({strong_id: 3816, form: "παῖς, παιδός, ὁ, ἡ", pos: "Noun, Feminine; Noun, Masculine", transliteration: "pais", phonetic_spelling: "(paheece)", short_definition: "a boy or girl child", medium_definition: "(a) a male child, boy, (b) a male slave, servant; thus: a servant of God, especially as a title of the Messiah, (c) a female child, girl.", long_definition: " from paiV - pais <a>3816</a>; to sport (as a boy):--play." })
NTGreekWord.create({strong_id: 3817, form: "παίω", pos: "Verb", transliteration: "paió", phonetic_spelling: "(pah'-yo)", short_definition: "I strike, smite", medium_definition: "I strike, smite, sting.", long_definition: " perhaps from paiw - paio <a>3817</a>; a boy (as often beaten with impunity), or (by analogy), a girl, and (genitive case) a child; specially, a slave or servant (especially a minister to a king; and by eminence to God):--child, maid(-en), (man) servant, son, young man." })
