NTGreekWord.create({strong_id: 3822, form: "παλαιόω", pos: "Verb", transliteration: "palaioó", phonetic_spelling: "(pal-ah-yo'-o)", short_definition: "I make old, declare obsolete", medium_definition: "I make old, declare obsolete; pass: I grow old, become obsolete.", long_definition: " from palaioV - palaios <a>3820</a>; antiquatedness:--oldness." })
