NTGreekWord.create({strong_id: 3825, form: "πάλιν", pos: "Adverb", transliteration: "palin", phonetic_spelling: "(pal'-in)", short_definition: "again, further, on the other hand", medium_definition: "again, back, once more, further, on the other hand.", long_definition: " from palin - palin <a>1078</a>; (spiritual) rebirth (the state or the act), i.e. (figuratively) spiritual renovation; specially, Messianic restoration:--regeneration." })
