NTGreekWord.create({strong_id: 3828, form: "Παμφυλία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Pamphulia", phonetic_spelling: "(pam-fool-ee'-ah)", short_definition: "Pamphylia", medium_definition: "Pamphylia, a Roman province on the south coast of Asia Minor.", long_definition: " from paV - pas <a>4183</a>; full many, i.e. immense:--very great." })
NTGreekWord.create({strong_id: 3829, form: "πανδοχεῖον, ου, τό", pos: "Noun, Neuter", transliteration: "pandocheion", phonetic_spelling: "(pan-dokk-i'-on)", short_definition: "an inn", medium_definition: "an inn, khan, hotel.", long_definition: " from a compound of paV - pas <a>4443</a>; every-tribal, i.e. heterogeneous (5561 being implied); Pamphylia, a region of Asia Minor:--Pamphylia." })
