NTGreekWord.create({strong_id: 4314, form: "πρός", pos: "Preposition", transliteration: "pros", phonetic_spelling: "(pros)", short_definition: "to, towards, with", medium_definition: "to, towards, with.", long_definition: " a strengthened form of pro - pro <a>4253</a>; a preposition of direction; forward to, i.e. toward (with the genitive case, the side of, i.e. pertaining to; with the dative case, by the side of, i.e. near to; usually with the accusative case, the place, time, occasion, or respect, which is the destination of the relation, i.e. whither or for which it is predicated):--about, according to , against, among, at, because of, before, between, (where-)by, for, X at thy house, in, for intent, nigh unto, of, which pertain to, that, to (the end that), X together, to (you) -ward, unto, with(-in). In the comparative case, it denotes essentially the same applications, namely, motion towards, accession to, or nearness at." })
