NTGreekWord.create({strong_id: 4432, form: "πτωχεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "ptócheia", phonetic_spelling: "(pto-khi'-ah)", short_definition: "beggary, poverty", medium_definition: "beggary, poverty, destitution.", long_definition: " from ptwceuw - ptocheuo <a>4433</a>; beggary, i.e. indigence (literally or figuratively):--poverty." })
