NTGreekWord.create({strong_id: 4435, form: "πυγμή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "pugmé", phonetic_spelling: "(poog-may')", short_definition: "the fist", medium_definition: "the fist.", long_definition: " from a primary pux (the fist as a weapon); the clenched hand, i.e. (only in dative case as adverb) with the fist (hard scrubbing):--oft." })
