NTGreekWord.create({strong_id: 4439, form: "πύλη, ης, ἡ", pos: "Noun, Feminine", transliteration: "pulé", phonetic_spelling: "(poo'-lay)", short_definition: "a door, gate", medium_definition: "a gate.", long_definition: " apparently a primary word; a gate, i.e. the leaf or wing of a folding entrance (literally or figuratively):--gate." })
