NTGreekWord.create({strong_id: 4441, form: "πυνθάνομαι", pos: "Verb", transliteration: "punthanomai", phonetic_spelling: "(poon-than'-om-ahee)", short_definition: "I ask, inquire", medium_definition: "I ask, inquire, ascertain by inquiry, understand.", long_definition: " middle voice prolonged from a primary putho (which occurs only as an alternate in certain tenses); to question, i.e. ascertain by inquiry (as a matter of information merely; and thus differing from erwtaw - erotao <a>1189</a>, which involves the idea of urgent need); by implication, to learn (by casual intelligence):--ask, demand, enquire, understand." })
NTGreekWord.create({strong_id: 4442, form: "πῦρ, πυρός, τό", pos: "Noun, Neuter", transliteration: "pur", phonetic_spelling: "(poor)", short_definition: "fire, trials", medium_definition: "fire; the heat of the sun, lightning; fig: strife, trials; the eternal fire.", long_definition: " a primary word; \"fire\" (literally or figuratively, specially, lightning):--fiery, fire." })
