NTGreekWord.create({strong_id: 4487, form: "ῥῆμα, ατος, τό", pos: "Noun, Neuter", transliteration: "rhéma", phonetic_spelling: "(hray'-mah)", short_definition: "a thing spoken", medium_definition: "a thing spoken, (a) a word or saying of any kind, as command, report, promise, (b) a thing, matter, business.", long_definition: "    rhesso  hrace'-so both prolonged forms of rheko (which appears only in certain forms, and is itself probably a strengthened form of agnumi (see in 2608)) to \"break,\" \"wreck\" or \"crack\", i.e. (especially) to sunder (by separation of the parts; katagnumi - katagnumi <a>2352</a> a shattering to minute fragments; but not a reduction to the constituent particles, like 3089) or disrupt, lacerate; by implication, to convulse (with spasms); figuratively, to give vent to joyful emotions:--break (forth), burst, rend, tear." })
NTGreekWord.create({strong_id: 4488, form: "Ῥησά, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Rhésa", phonetic_spelling: "(hray-sah')", short_definition: "Rhesa", medium_definition: "Rhesa, an ancestor of Jesus.", long_definition: " from rew - rheo <a>4483</a>; an utterance (individually, collectively or specially),; by implication, a matter or topic (especially of narration, command or dispute); with a negative naught whatever:--+ evil, + nothing, saying, word." })
NTGreekWord.create({strong_id: 4489, form: "ῥήτωρ, ορος, ὁ", pos: "Noun, Masculine", transliteration: "rhétór", phonetic_spelling: "(hray'-tore)", short_definition: "an orator", medium_definition: "an orator, public speaker, advocate.", long_definition: " probably of Hebrew origin (apparently for Rphayah <a>7509</a>; Resa (i.e. Rephajah), an Israelite:--Rhesa." })
NTGreekWord.create({strong_id: 4490, form: "ῥητῶς", pos: "Adverb", transliteration: "rhétós", phonetic_spelling: "(hray-toce')", short_definition: "in so many words", medium_definition: "expressly, explicitly, in so many words.", long_definition: " from rew - rheo <a>4483</a>; a speaker, i.e. (by implication) a forensic advocate:--orator." })
NTGreekWord.create({strong_id: 4491, form: "ῥίζα, ης, ἡ", pos: "Noun, Feminine", transliteration: "rhiza", phonetic_spelling: "(hrid'-zah)", short_definition: "a root, that which comes from the root", medium_definition: "a root, shoot, source; that which comes from the root, a descendent.", long_definition: " adverb from a derivative of rew - rheo <a>4483</a>; out-spokenly, i.e. distinctly:--expressly." })
NTGreekWord.create({strong_id: 4492, form: "ῥιζόω", pos: "Verb", transliteration: "rhizoó", phonetic_spelling: "(hrid-zo'-o)", short_definition: "I root, fix by the root", medium_definition: "I cause to take root; met: I plant, fix firmly, establish.", long_definition: " apparently a primary word; a \"root\" (literally or figuratively):--root." })
NTGreekWord.create({strong_id: 4493, form: "ῥιπή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "rhipé", phonetic_spelling: "(hree-pay')", short_definition: "a glance, twinkle (of the eye)", medium_definition: "a glance, twinkle or flash of the eye; a rush of wind or flame; any rapid movement.", long_definition: " from riza - rhiza <a>4491</a>; to root (figuratively, become stable):--root." })
NTGreekWord.create({strong_id: 4494, form: "ῥιπίζω", pos: "Verb", transliteration: "rhipizó", phonetic_spelling: "(hrip-id'-zo)", short_definition: "I toss to and fro", medium_definition: "I toss to and fro, fan, blow.", long_definition: " from riptw - rhipto <a>4496</a>; a jerk (of the eye, i.e. (by analogy) an instant):--twinkling." })
NTGreekWord.create({strong_id: 4495, form: "ῥιπτέω", pos: "Verb", transliteration: "rhipteó", phonetic_spelling: "(hrip-teh'-o)", short_definition: "I throw away", medium_definition: "I throw off or away, cast, hurl.", long_definition: " from a derivative of riptw - rhipto <a>4496</a> (meaning a fan or bellows); to breeze up, i.e. (by analogy) to agitate (into waves):--toss." })
NTGreekWord.create({strong_id: 4496, form: "ῥίπτω", pos: "Verb", transliteration: "rhiptó", phonetic_spelling: "(hrip'-to)", short_definition: "I throw, cast, toss", medium_definition: "I throw, cast, toss, set down; pass: I am dispersed.", long_definition: " from a derivative of riptw - rhipto <a>4496</a>; to toss up:--cast off." })
NTGreekWord.create({strong_id: 4497, form: "Ῥοβοάμ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Rhoboam", phonetic_spelling: "(hrob-o-am')", short_definition: "Rehoboam", medium_definition: "Rehoboam, son of Solomon, and King of Israel.", long_definition: " a primary verb (perhaps rather akin to the base of rapizw - rhapizo <a>906</a>, which denotes a deliberate hurl; and from teino (see in 1614), which indicates an extended projection); by qualification, to deposit (as if a load); by extension, to disperse:--cast (down, out), scatter abroad, throw." })
NTGreekWord.create({strong_id: 4498, form: "Ῥόδη, ης, ἡ", pos: "Noun, Feminine", transliteration: "Rhodé", phonetic_spelling: "(hrod'-ay)", short_definition: "Rhoda", medium_definition: "Rhoda, a maidservant in the house of John Mark's mother at Jerusalem.", long_definition: " of Hebrew origin (Rchab`am <a>7346</a>; Roboam (i.e. Rechobam), an Israelite:--Roboam." })
NTGreekWord.create({strong_id: 4499, form: "Ῥόδος, ου, ἡ", pos: "Noun, Feminine", transliteration: "Rhodos", phonetic_spelling: "(hrod'-os)", short_definition: "Rhodes", medium_definition: "Rhodes, an island in the Aegean sea, south-west of Asia Minor.", long_definition: " probably for rhode (a rose); Rode, a servant girl:--Rhoda." })
NTGreekWord.create({strong_id: 4500, form: "ῥοιζηδόν", pos: "Adverb", transliteration: "rhoizédon", phonetic_spelling: "(hroyd-zay-don')", short_definition: "with a great noise", medium_definition: "with a great noise, with a rushing sound.", long_definition: " probably from rhodon (a rose); Rhodus, an island of the Mediterranean:--Rhodes." })
NTGreekWord.create({strong_id: 4501, form: "ῥομφαία, ας, ἡ", pos: "Noun, Feminine", transliteration: "rhomphaia", phonetic_spelling: "(hrom-fah'-yah)", short_definition: "a sword, piercing grief", medium_definition: "a sword, scimitar; fig: war, piercing grief.", long_definition: " probably of foreign origin; a sabre, i.e. a long and broad cutlass (any weapon of the kind, literally or figuratively):--sword." })
NTGreekWord.create({strong_id: 4502, form: "Ῥουβίμ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Rhoubén", phonetic_spelling: "(hroo-bane')", short_definition: "Reuben", medium_definition: "Reuben, eldest son of the patriarch Jacob and founder of a tribe.", long_definition: " of Hebrew origin (R'uwben <a>7205</a>; Ruben (i.e. Reuben), an Israelite:--Reuben." })
NTGreekWord.create({strong_id: 4503, form: "Ῥούθ, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Rhouth", phonetic_spelling: "(hrooth)", short_definition: "Ruth", medium_definition: "Ruth, wife of Boaz and mother of Obed.", long_definition: " of Hebrew origin (Ruwth <a>7327</a>; Ruth, a Moabitess:--Ruth." })
NTGreekWord.create({strong_id: 4504, form: "Ῥοῦφος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Rhouphos", phonetic_spelling: "(hroo'-fos)", short_definition: "Rufus", medium_definition: "Rufus, a Christian man in Rome, probably to be identified with the brother of Alexander and son of Simon of Cyrene.", long_definition: " of Latin origin; red; Rufus, a Christian:--Rufus." })
NTGreekWord.create({strong_id: 4505, form: "ῥύμη, ης, ἡ", pos: "Noun, Feminine", transliteration: "rhumé", phonetic_spelling: "(hroo'-may)", short_definition: "a street, lane", medium_definition: "a narrow street or lane in a town or city.", long_definition: " prolongation from roumai - rhoumai <a>4506</a> in its original sense; an alley or avenue (as crowded):--lane, street." })
NTGreekWord.create({strong_id: 4506, form: "ῥύομαι", pos: "Verb", transliteration: "rhuomai", phonetic_spelling: "(rhoo'-om-ahee)", short_definition: "I rescue", medium_definition: "I rescue, deliver (from danger or destruction).", long_definition: " middle voice of an obsolete verb, akin to rew - rheo <a>4482</a> (through the idea of a current; compare 4511); to rush or draw (for oneself), i.e. rescue:--deliver(-er)." })
NTGreekWord.create({strong_id: 4507, form: "ῥυπαρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "rhuparia", phonetic_spelling: "(hroo-par-ee'-ah)", short_definition: "filth, pollution", medium_definition: "filth, pollution, defilement.", long_definition: " from ruparoV - rhuparos <a>4508</a>; dirtiness (morally):--turpitude." })
NTGreekWord.create({strong_id: 4508, form: "ῥυπαρός, ά, όν", pos: "Adjective", transliteration: "rhuparos", phonetic_spelling: "(rhoo-par-os')", short_definition: "filthy, defiled", medium_definition: "filthy, defiled, dirty.", long_definition: " from rupoV - rhupos <a>4509</a>; dirty, i.e. (relatively) cheap or shabby; morally, wicked:--vile." })
NTGreekWord.create({strong_id: 4509, form: "ῥύπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "rhupos", phonetic_spelling: "(hroo'-pos)", short_definition: "filth, dirt", medium_definition: "filth, filthiness, dirt, squalor.", long_definition: " of uncertain affinity; dirt, i.e. (morally) depravity:--filth." })
