NTGreekWord.create({strong_id: 4511, form: "ῥύσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "rhusis", phonetic_spelling: "(hroo'-sis)", short_definition: "a flowing, an issue", medium_definition: "a flowing, an issue.", long_definition: " from roumai - rhoumai <a>4482</a>; a flux (of blood):--issue." })
