NTGreekWord.create({strong_id: 4513, form: "Ῥωμαϊκός, ή, όν", pos: "Adjective", transliteration: "Rhómaikos", phonetic_spelling: "(rho-mah-ee-kos')", short_definition: "Roman, Latin", medium_definition: "Roman, Latin.", long_definition: " from RwmaioV - Rhomaios <a>4514</a>; Romaic, i.e. Latin:--Latin." })
