NTGreekWord.create({strong_id: 4517, form: "ῥώννυμι", pos: "Verb", transliteration: "rhónnumi", phonetic_spelling: "(hrone'-noo-mee)", short_definition: "I strengthen, farewell", medium_definition: "I strengthen, render firm; imperative at the end of letters: farewell.", long_definition: " prolongation from rhoomai (to dart; probably akin to 4506); to strengthen, i.e. (impersonal passive) have health (as a parting exclamation, good-bye):--farewell." })
