NTGreekWord.create({strong_id: 4520, form: "σαββατισμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "sabbatismos", phonetic_spelling: "(sab-bat-is-mos')", short_definition: "a Sabbath rest", medium_definition: "a keeping of the Sabbath, a Sabbath rest.", long_definition: " of Hebrew origin (tsaba' <a>6635</a> in feminine plural); armies; sabaoth (i.e. tsebaoth), a military epithet of God:--sabaoth." })
