NTGreekWord.create({strong_id: 4528, form: "Σαλαθιήλ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Salathiél", phonetic_spelling: "(sal-ath-ee-ale')", short_definition: "Salathiel", medium_definition: "Salathiel, son of Jechoniah.", long_definition: " of Hebrew origin (Shelach <a>7974</a>; Sala (i.e. Shelach), a patriarch :--Sala." })
