NTGreekWord.create({strong_id: 4533, form: "Σαλμών, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Salmón", phonetic_spelling: "(sal-mone')", short_definition: "Salmon", medium_definition: "Salmon, son of Nahshon and father of Boaz.", long_definition: " of Hebrew origin (Shalem <a>8004</a>; Salem (i.e. Shalem), a place in Palestine:--Salem." })
