NTGreekWord.create({strong_id: 4536, form: "σάλπιγξ, ιγγος, ἡ", pos: "Noun, Feminine", transliteration: "salpigx", phonetic_spelling: "(sal'-pinx)", short_definition: "a trumpet", medium_definition: "a trumpet, the sound of a trumpet.", long_definition: " probably from the base of sainw - saino <a>4525</a>; a vibration, i.e. (specially), billow:--wave." })
NTGreekWord.create({strong_id: 4537, form: "σαλπίζω", pos: "Verb", transliteration: "salpizó", phonetic_spelling: "(sal-pid'-zo)", short_definition: "I sound a trumpet", medium_definition: "I sound a trumpet.", long_definition: " perhaps from saloV - salos <a>4535</a> (through the idea of quavering or reverberation); a trumpet:--trump(-et)." })
