NTGreekWord.create({strong_id: 4540, form: "Σαμάρεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "Samareia", phonetic_spelling: "(sam-ar'-i-ah)", short_definition: "Samaria", medium_definition: "Samaria, a small district of Palestine, bounded by Galilee on the north, and by Judaea on the south, and taking its name from the city of Samaria, the ancient capital of the kingdom of (northern) Israel.", long_definition: " probably of Hebrew origin (feminine from shalowm <a>7965</a>; Salome (i.e. Shelomah), an Israelitess:--Salome." })
