NTGreekWord.create({strong_id: 4542, form: "Σαμαρεῖτις, ιδος, ἡ", pos: "Noun, Feminine", transliteration: "Samaritis", phonetic_spelling: "(sam-ar-i'-tis)", short_definition: "a Samaritan woman", medium_definition: "a Samaritan woman.", long_definition: " from Samareia - Samareia <a>4540</a>; a Samarite, i.e. inhabitant of Samaria:--Samaritan." })
NTGreekWord.create({strong_id: 4543, form: "Σαμοθρᾴκη, ης, ἡ", pos: "Noun, Feminine", transliteration: "Samothraké", phonetic_spelling: "(sam-oth-rak'-ay)", short_definition: "Samothrace", medium_definition: "Samothrace, an island south of the province of Thrace.", long_definition: " feminine of SamareithV - Samareites <a>4541</a>; a Samaritess, i.e. woman of Samaria:--of Samaria." })
NTGreekWord.create({strong_id: 4544, form: "Σάμος, ου, ἡ", pos: "Noun, Feminine", transliteration: "Samos", phonetic_spelling: "(sam'-os)", short_definition: "Samos", medium_definition: "Samos, an island in the Aegean sea off the coast of Asia Minor, near Ephesus and Miletus.", long_definition: " from SamoV - Samos <a>4544</a> and Thraike (Thrace); Samo-thrace (Samos of Thrace), an island in the Mediterranean:--Samothracia." })
