NTGreekWord.create({strong_id: 4731, form: "στερεός, ά, όν", pos: "Adjective", transliteration: "stereos", phonetic_spelling: "(ster-eh-os')", short_definition: "solid, firm, steadfast", medium_definition: "solid, firm, steadfast.", long_definition: " from isthmi - histemi <a>2476</a>; stiff, i.e. solid, stable (literally or figuratively):--stedfast, strong, sure." })
