NTGreekWord.create({strong_id: 4737, form: "στεφανόω", pos: "Verb", transliteration: "stephanoó", phonetic_spelling: "(stef-an-o'-o)", short_definition: "I crown, adorn", medium_definition: "I crown, adorn, decorate.", long_definition: " from stefanoV - stephanos <a>4735</a>; to adorn with an honorary wreath (literally or figuratively):--crown." })
