NTGreekWord.create({strong_id: 4740, form: "στηριγμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "stérigmos", phonetic_spelling: "(stay-rig-mos')", short_definition: "firmness, steadfastness", medium_definition: "firmness, steadfastness.", long_definition: " from sthrizw - sterizo <a>4741</a>; stability (figuratively):--stedfastness." })
NTGreekWord.create({strong_id: 4741, form: "στηρίζω", pos: "Verb", transliteration: "stérizó", phonetic_spelling: "(stay-rid'-zo)", short_definition: "I fix firmly, strengthen", medium_definition: "(a) I fix firmly, direct myself towards, (b) generally met: I buttress, prop, support; I strengthen, establish.", long_definition: " from a presumed derivative of isthmi - histemi <a>2476</a> (like 4731); to set fast, i.e. (literally) to turn resolutely in a certain direction, or (figuratively) to confirm:--fix, (e-)stablish, stedfastly set, strengthen." })
NTGreekWord.create({strong_id: 4742, form: "στίγμα, ατος, τό", pos: "Noun, Neuter", transliteration: "stigma", phonetic_spelling: "(stig'-mah)", short_definition: "a mark or brand", medium_definition: "a mark or brand.", long_definition: " from a primary stizo (to \"stick\", i.e. prick); a mark incised or punched (for recognition of ownership), i.e. (figuratively) scar of service:--mark." })
