NTGreekWord.create({strong_id: 4744, form: "στίλβω", pos: "Verb", transliteration: "stilbó", phonetic_spelling: "(stil'-bo)", short_definition: "I shine, glisten, flash", medium_definition: "I shine, glisten, flash, am radiant.", long_definition: " apparently a primary verb; to gleam, i.e. flash intensely:--shining." })
NTGreekWord.create({strong_id: 4745, form: "στοά, ᾶς, ἡ", pos: "Noun, Feminine", transliteration: "stoa", phonetic_spelling: "(sto-ah')", short_definition: "a colonnade, portico", medium_definition: "a colonnade, portico.", long_definition: " probably from isthmi - histemi <a>2476</a>; a colonnade or interior piazza:--porch." })
NTGreekWord.create({strong_id: 4746, form: "στοιβάς, άδος, ἡ", pos: "Noun, Feminine", transliteration: "stoibas", phonetic_spelling: "(stoy-bas')", short_definition: "a bough, branch of a tree", medium_definition: "a bough, branch of a tree.", long_definition: " from a primary steibo (to \"step\" or \"stamp\"); a spread (as if tramped flat) of loose materials for a couch, i.e. (by implication) a bough of a tree so employed:--branch." })
NTGreekWord.create({strong_id: 4747, form: "στοιχεῖον, ου, τό", pos: "Noun, Neuter", transliteration: "stoicheion", phonetic_spelling: "(stoy-khi'-on)", short_definition: "a heavenly body, an element", medium_definition: "(a) plur: the heavenly bodies, (b) a rudiment, an element, a rudimentary principle, an elementary rule.", long_definition: " neuter of a presumed derivative of the base of stoicew - stoicheo <a>4748</a>; something orderly in arrangement, i.e. (by implication) a serial (basal, fundamental, initial) constituent (literally), proposition (figuratively):--element, principle, rudiment." })
