NTGreekWord.create({strong_id: 4750, form: "στόμα, ατος, τό", pos: "Noun, Neuter", transliteration: "stoma", phonetic_spelling: "(stom'-a)", short_definition: "the mouth, speech", medium_definition: "the mouth, speech, eloquence in speech, the point of a sword.", long_definition: " probably strengthened from a presumed derivative of the base of tomwteroV - tomoteros <a>5114</a>; the mouth (as if a gash in the face); by implication, language (and its relations); figuratively, an opening (in the earth); specially, the front or edge (of a weapon):--edge, face, mouth." })
NTGreekWord.create({strong_id: 4751, form: "στόμαχος, ου, ὁ", pos: "Noun, Masculine", transliteration: "stomachos", phonetic_spelling: "(stom'-akh-os)", short_definition: "the stomach", medium_definition: "the stomach.", long_definition: " from stoma - stoma <a>4750</a>; an orifice (the gullet), i.e. (specially), the \"stomach\":--stomach." })
NTGreekWord.create({strong_id: 4752, form: "στρατεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "strateia", phonetic_spelling: "(strat-i'-ah)", short_definition: "warfare, military service", medium_definition: "warfare, military service; of Christian warfare.", long_definition: " from strateuomai - strateuomai <a>4754</a>; military service, i.e. (figuratively) the apostolic career (as one of hardship and danger):--warfare." })
