NTGreekWord.create({strong_id: 4755, form: "στρατηγός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "stratégos", phonetic_spelling: "(strat-ay-gos')", short_definition: "a general, magistrate, captain of the temple", medium_definition: "(a) a general or leader of the army, (b) a magistrate or governor, (c) captain of the temple.", long_definition: " from the base of stratia - stratia <a>2233</a>; a general, i.e. (by implication or analogy) a (military) governor (praetor), the chief (praefect) of the (Levitical) temple-wardens:--captain, magistrate." })
