NTGreekWord.create({strong_id: 4760, form: "στρατόπεδον, ου, τό", pos: "Noun, Neuter", transliteration: "stratopedon", phonetic_spelling: "(strat-op'-ed-on)", short_definition: "an encamped army", medium_definition: "an encamped army.", long_definition: " from the base of stratia - stratia <a>3977</a>; a camping-ground, i.e. (by implication) a body of troops:--army." })
