NTGreekWord.create({strong_id: 4909, form: "συνευδοκέω", pos: "Verb", transliteration: "suneudokeó", phonetic_spelling: "(soon-yoo-dok-eh'-o)", short_definition: "I consent, agree, am of one mind with", medium_definition: "I consent, agree, am of one mind with, am willing.", long_definition: " from sun - sun <a>2106</a>; to think well of in common, i.e. assent to, feel gratified with:--allow, assent, be pleased, have pleasure." })
NTGreekWord.create({strong_id: 4910, form: "συνευωχέομαι", pos: "Verb", transliteration: "suneuócheomai", phonetic_spelling: "(soon-yoo-o-kheh'-o)", short_definition: "I feast sumptuously with", medium_definition: "I feast sumptuously with.", long_definition: " from sun - sun <a>2192</a> (meaning to be in good condition, i.e. (by implication) to fare well, or feast); to entertain sumptuously in company with, i.e. (middle voice or passive) to revel together:--feast with." })
