NTGreekWord.create({strong_id: 4913, form: "συνήδομαι", pos: "Verb", transliteration: "sunédomai", phonetic_spelling: "(soon-ay'-dom-ahee)", short_definition: "I delight inwardly in", medium_definition: "I delight inwardly in, congratulate.", long_definition: " middle voice from sun - sun <a>2237</a>; to rejoice in with oneself, i.e. feel satisfaction concerning:--delight." })
NTGreekWord.create({strong_id: 4914, form: "συνήθεια, ας, ἡ", pos: "Noun, Feminine", transliteration: "sunétheia", phonetic_spelling: "(soon-ay'-thi-ah)", short_definition: "a custom, habit", medium_definition: "a custom, habit, practice.", long_definition: " from a compound of sun - sun <a>2239</a>; mutual habituation, i.e. usage:--custom." })
NTGreekWord.create({strong_id: 4915, form: "συνηλικιώτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "sunélikiótés", phonetic_spelling: "(soon-ay-lik-ee-o'-tace)", short_definition: "one of the same age", medium_definition: "one of the same age.", long_definition: " from sun - sun <a>2244</a>; a co-aged person, i.e. alike in years:--equal." })
