NTGreekWord.create({strong_id: 4922, form: "συνοδεύω", pos: "Verb", transliteration: "sunodeuó", phonetic_spelling: "(soon-od-yoo'-o)", short_definition: "I journey with, accompany", medium_definition: "I journey with, accompany.", long_definition: " from sun - sun <a>3593</a>; to travel in company with:--journey with." })
