NTGreekWord.create({strong_id: 5144, form: "τριάκοντα, οἱ, αἱ, τά", pos: "Indeclinable Numeral (Adjective)", transliteration: "triakonta", phonetic_spelling: "(tree-ak'-on-tah)", short_definition: "thirty", medium_definition: "thirty.", long_definition: " the decade of treiV - treis <a>5140</a>; thirty:--thirty." })
NTGreekWord.create({strong_id: 5145, form: "τριακόσιοι, αι, α", pos: "Adjective", transliteration: "triakosioi", phonetic_spelling: "(tree-ak-os'-ee-oy)", short_definition: "three hundred", medium_definition: "three hundred.", long_definition: " plural from treiV - treis <a>1540</a>; three hundred:--three hundred." })
NTGreekWord.create({strong_id: 5146, form: "τρίβολος, ου, ὁ", pos: "Noun, Masculine", transliteration: "tribolos", phonetic_spelling: "(trib'-ol-os)", short_definition: "a thistle", medium_definition: "a thistle.", long_definition: " from treiV - treis <a>956</a>; properly, a crow-foot (three-pronged obstruction in war), i.e. (by analogy) a thorny plant (caltrop):--brier, thistle." })
NTGreekWord.create({strong_id: 5147, form: "τρίβος, ου, ἡ", pos: "Noun, Feminine", transliteration: "tribos", phonetic_spelling: "(tree'-bos)", short_definition: "a worn path, beaten way", medium_definition: "a worn path, beaten way, road, highway.", long_definition: " from tribo (to \"rub\"; akin to teiro, truo, and the base of tragoV - tragos <a>5131</a>, 5134); a rut or worn track:--path." })
NTGreekWord.create({strong_id: 5148, form: "τριετία, ας, ἡ", pos: "Noun, Feminine", transliteration: "trietia", phonetic_spelling: "(tree-et-ee'-ah)", short_definition: "a space of three years", medium_definition: "a space of three years.", long_definition: " from a compound of treiV - treis <a>2094</a>; a three years' period (triennium):--space of three years." })
NTGreekWord.create({strong_id: 5149, form: "τρίζω", pos: "Verb", transliteration: "trizó", phonetic_spelling: "(trid'-zo)", short_definition: "I grate, gnash", medium_definition: "I grate, gnash (as the teeth).", long_definition: " apparently a primary verb; to creak (squeak), i.e. (by analogy) to grate the teeth (in frenzy):--gnash." })
NTGreekWord.create({strong_id: 5150, form: "τρίμηνος, ον", pos: "Adjective", transliteration: "triménon", phonetic_spelling: "(trim'-ay-non)", short_definition: "lasting three months", medium_definition: "lasting three months.", long_definition: " neuter of a compound of treiV - treis <a>3376</a> as noun; a three months' space:--three months." })
NTGreekWord.create({strong_id: 5151, form: "τρίς", pos: "Adverb", transliteration: "tris", phonetic_spelling: "(trece)", short_definition: "three times", medium_definition: "three times.", long_definition: " adverb from treiV - treis <a>5140</a>; three times:--three times, thrice." })
NTGreekWord.create({strong_id: 5152, form: "τρίστεγος, ον", pos: "Noun, Neuter", transliteration: "tristegon", phonetic_spelling: "(tris'-teg-on)", short_definition: "having three stories, the third story", medium_definition: "having three stories; subst: the third story.", long_definition: " neuter of a compound of treiV - treis <a>4721</a> as noun; a third roof (story):--third loft." })
NTGreekWord.create({strong_id: 5153, form: "τρισχίλιοι, αι, α", pos: "Adjective", transliteration: "trischilioi", phonetic_spelling: "(tris-khil'-ee-oy)", short_definition: "three thousand", medium_definition: "three thousand.", long_definition: " from triV - tris <a>5507</a>; three times a thousand:--three thousand." })
NTGreekWord.create({strong_id: 5154, form: "τρίτος, η, ον", pos: "Adjective; Adverb", transliteration: "tritos", phonetic_spelling: "(tree'-tos)", short_definition: "third", medium_definition: "third.", long_definition: " ordinal from treiV - treis <a>5140</a>; third; neuter (as noun) a third part, or (as adverb) a (or the) third time, thirdly:--third(-ly)." })
NTGreekWord.create({strong_id: 5155, form: "τρίχινος, η, ον", pos: "Adjective", transliteration: "trichinos", phonetic_spelling: "(trikh'-ee-nos)", short_definition: "made of hair", medium_definition: "made of hair.", long_definition: " from qrix - thrix <a>2359</a>; hairy, i.e. made of hair (mohair):--of hair." })
NTGreekWord.create({strong_id: 5156, form: "τρόμος, ου, ὁ", pos: "Noun, Masculine", transliteration: "tromos", phonetic_spelling: "(trom'-os)", short_definition: "a trembling", medium_definition: "a trembling, quaking, fear.", long_definition: " from tremw - tremo <a>5141</a>; a \"trembling\", i.e. quaking with fear:--+ tremble(-ing)." })
NTGreekWord.create({strong_id: 5157, form: "τροπή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "tropé", phonetic_spelling: "(trop-ay')", short_definition: "a turning", medium_definition: "a turning, change, mutation.", long_definition: " from an apparently primary trepo to turn; a turn (\"trope\"), i.e. revolution (figuratively, variation):--turning." })
NTGreekWord.create({strong_id: 5158, form: "τρόπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "tropos", phonetic_spelling: "(trop'-os)", short_definition: "way, manner, character", medium_definition: "(a) way, manner, (b) manner of life, character.", long_definition: " from the same as troph - trope <a>5157</a>; a turn, i.e. (by implication) mode or style (especially with preposition or relative prefix as adverb, like); figuratively, deportment or character:--(even) as, conversation, (+ like) manner, (+ by any) means, way." })
NTGreekWord.create({strong_id: 5159, form: "τροποφορέω", pos: "Verb", transliteration: "tropophoreó", phonetic_spelling: "(trop-of-or-eh'-o)", short_definition: "I endure the ways of", medium_definition: "I endure the ways of, put up with.", long_definition: " from tropoV - tropos <a>5409</a>; to endure one's habits:--suffer the manners." })
NTGreekWord.create({strong_id: 5160, form: "τροφή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "trophé", phonetic_spelling: "(trof-ay')", short_definition: "food, nourishment", medium_definition: "food, nourishment, maintenance.", long_definition: " from trefw - trepho <a>5142</a>; nourishment (literally or figuratively); by implication, rations (wages):--food, meat." })
NTGreekWord.create({strong_id: 5161, form: "Τρόφιμος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Trophimos", phonetic_spelling: "(trof'-ee-mos)", short_definition: "Trophimus", medium_definition: "Trophimus, a Christian of Ephesus in Asia.", long_definition: " from trofh - trophe <a>5160</a>; nutritive; Trophimus, a Christian:--Trophimus." })
NTGreekWord.create({strong_id: 5162, form: "τροφός, οῦ, ἡ", pos: "Noun, Feminine", transliteration: "trophos", phonetic_spelling: "(trof-os')", short_definition: "a nurse", medium_definition: "a nurse.", long_definition: " from trefw - trepho <a>5142</a>; a nourisher, i.e. nurse:--nurse." })
NTGreekWord.create({strong_id: 5163, form: "τροχιά, ᾶς, ἡ", pos: "Noun, Feminine", transliteration: "trochia", phonetic_spelling: "(trokh-ee-ah')", short_definition: "the track of a wheel, a path", medium_definition: "the track of a wheel, a path.", long_definition: " from trocoV - trochos <a>5164</a>; a track (as a wheel-rut), i.e. (figuratively) a course of conduct:--path." })
NTGreekWord.create({strong_id: 5164, form: "τροχός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "trochos", phonetic_spelling: "(trokh-os')", short_definition: "a wheel, course", medium_definition: "a wheel, course.", long_definition: " from trecw - trecho <a>5143</a>; a wheel (as a runner), i.e. (figuratively) a circuit of physical effects:--course." })
NTGreekWord.create({strong_id: 5165, form: "τρύβλιον, ου, τό", pos: "Noun, Neuter", transliteration: "trublion", phonetic_spelling: "(troob'-lee-on)", short_definition: "a platter", medium_definition: "a deep dish, platter, bowl.", long_definition: " neuter of a presumed derivative of uncertain affinity; a bowl:--dish." })
NTGreekWord.create({strong_id: 5166, form: "τρυγάω", pos: "Verb", transliteration: "trugaó", phonetic_spelling: "(troo-gah'-o)", short_definition: "I gather", medium_definition: "I gather (as of grapes), harvest.", long_definition: " from a derivative of trugo (to dry) meaning ripe fruit (as if dry); to collect the vintage:--gather." })
NTGreekWord.create({strong_id: 5167, form: "τρυγών, όνος, ἡ", pos: "Noun, Feminine", transliteration: "trugón", phonetic_spelling: "(troo-gone')", short_definition: "a turtle-dove", medium_definition: "a turtle-dove.", long_definition: " from truzo (to murmur; akin to trizw - trizo <a>5149</a>, but denoting a duller sound); a turtle-dove (as cooing):--turtle-dove." })
