NTGreekWord.create({strong_id: 5169, form: "τρύπημα, ατος, τό", pos: "Noun, Neuter", transliteration: "trupéma", phonetic_spelling: "(troo'-pay-mah)", short_definition: "a hole, the eye of a needle", medium_definition: "a hole; the eye of a needle.", long_definition: " from a derivative of the base of trumalia - trumalia <a>5168</a>; an aperture, i.e. a needle's eye:--eye." })
NTGreekWord.create({strong_id: 5170, form: "Τρύφαινα, ης, ἡ", pos: "Noun, Feminine", transliteration: "Truphaina", phonetic_spelling: "(troo'-fahee-nah)", short_definition: "Tryphaena", medium_definition: "Tryphaena, a Christian woman in Rome.", long_definition: " from trufh - truphe <a>5172</a>; luxurious; Tryphoena, a Christian woman:--Tryphena." })
NTGreekWord.create({strong_id: 5171, form: "τρυφάω", pos: "Verb", transliteration: "truphaó", phonetic_spelling: "(troo-fah'-o)", short_definition: "I live a luxurious life", medium_definition: "I live a luxurious life, live self-indulgently.", long_definition: " from trufh - truphe <a>5172</a>; to indulge in luxury:--live in pleasure." })
NTGreekWord.create({strong_id: 5172, form: "τρυφή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "truphé", phonetic_spelling: "(troo-fay')", short_definition: "effeminate luxury", medium_definition: "effeminate luxury, softness, indulgent living.", long_definition: " from thrupto (to break up or (figuratively) enfeeble, especially the mind and body by indulgence); effeminacy, i.e. luxury or debauchery:--delicately, riot." })
NTGreekWord.create({strong_id: 5173, form: "Τρυφῶσα, ης, ἡ", pos: "Noun, Feminine", transliteration: "Truphósa", phonetic_spelling: "(troo-fo'-sah)", short_definition: "Tryphosa", medium_definition: "Tryphosa, a Christian woman in Rome, perhaps a sister of Tryphaena.", long_definition: " from trufh - truphe <a>5172</a>; luxuriating; Tryphosa, a Christian female:--Tryphosa." })
NTGreekWord.create({strong_id: 5174, form: "Τρῳάς, άδος, ἡ", pos: "Noun, Feminine", transliteration: "Tróas", phonetic_spelling: "(tro-as')", short_definition: "Troas", medium_definition: "Troas, a harbor city of Mysia.", long_definition: " from Tros (a Trojan); the Troad (or plain of Troy), i.e. Troas, a place in Asia Minor:--Troas." })
NTGreekWord.create({strong_id: 5175, form: "Τρωγύλλιον, ου, τό", pos: "Noun, Neuter", transliteration: "Trógullion", phonetic_spelling: "(tro-gool'-lee-on)", short_definition: "Trogyllium", medium_definition: "Trogyllium, a promontory somewhat to the south of Ephesus.", long_definition: " of uncertain derivation; Trogyllium, a place in Asia Minor:--Trogyllium." })
NTGreekWord.create({strong_id: 5176, form: "τρώγω", pos: "Verb", transliteration: "trógó", phonetic_spelling: "(tro'-go)", short_definition: "I eat", medium_definition: "I eat, partake of a meal.", long_definition: " probably strengthened from a collateral form of the base of trauma - trauma <a>5149</a> through the idea of a craunching sound; to gnaw or chew, i.e. (generally) to eat:--eat." })
NTGreekWord.create({strong_id: 5177, form: "τυγχάνω", pos: "Verb", transliteration: "tugchanó", phonetic_spelling: "(toong-khan'-o)", short_definition: "I obtain, I happen, perhaps", medium_definition: "(a) gen: I obtain, (b) absol: I chance, happen; ordinary, everyday, it may chance, perhaps.", long_definition: " probably for an obsolete tucho (for which the middle voice of another alternate teucho (to make ready or bring to pass) is used in certain tenses; akin to the base of tiktw - tikto <a>5180</a>." })
NTGreekWord.create({strong_id: 5178, form: "τυμπανίζω", pos: "Verb", transliteration: "tumpanizó", phonetic_spelling: "(toom-pan-id'-zo)", short_definition: "I torture, break on the wheel", medium_definition: "I torture, break on the wheel, beat to death.", long_definition: " from a derivative of tuptw - tupto <a>5180</a> (meaning a drum, \"tympanum\"); to stretch on an instrument of torture resembling a drum, and thus beat to death:--torture." })
NTGreekWord.create({strong_id: 5179, form: "τύπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "tupos", phonetic_spelling: "(too'-pos)", short_definition: "a figure, model, type", medium_definition: "(originally: the mark of a blow, then a stamp struck by a die), (a) a figure; a copy, image, (b) a pattern, model, (c) a type, prefiguring something or somebody.", long_definition: " from tuptw - tupto <a>5180</a>; a die (as struck), i.e. (by implication) a stamp or scar; by analogy, a shape, i.e. a statue, (figuratively) style or resemblance; specially, a sampler (\"type\"), i.e. a model (for imitation) or instance (for warning):--en-(ex-)ample, fashion, figure, form, manner, pattern, print." })
NTGreekWord.create({strong_id: 5180, form: "τύπτω", pos: "Verb", transliteration: "tuptó", phonetic_spelling: "(toop'-to)", short_definition: "I beat, strike, wound, inflict punishment", medium_definition: "I beat, strike, wound, inflict punishment.", long_definition: " a primary verb (in a strengthened form); to \"thump\", i.e. cudgel or pummel (properly, with a stick or bastinado), but in any case by repeated blows; thus differing from paiw - paio <a>5177</a>, an accidental collision); by implication, to punish; figuratively, to offend (the conscience):--beat, smite, strike, wound." })
NTGreekWord.create({strong_id: 5181, form: "Τύραννος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Turannos", phonetic_spelling: "(too'-ran-nos)", short_definition: "Tyrannus", medium_definition: "Tyrannus, an inhabitant of Ephesus, probably a rhetorician.", long_definition: " a provincial form of the derivative of the base of kurioV - kurios <a>2962</a>; a \"tyrant\"; Tyrannus, an Ephesian:--Tyrannus." })
NTGreekWord.create({strong_id: 5182, form: "τυρβάζω", pos: "Verb", transliteration: "turbazó", phonetic_spelling: "(toor-bad'-zo)", short_definition: "I agitate or disturb in mind", medium_definition: "I agitate or disturb in mind, trouble.", long_definition: " from turbe (Latin turba, a crowd; akin to 2351); to make \"turbid\", i.e. disturb:--trouble." })
NTGreekWord.create({strong_id: 5183, form: "Τύριος, ου, ὁ, ἡ", pos: "Noun, Masculine", transliteration: "Turios", phonetic_spelling: "(too'-ree-os)", short_definition: "an inhabitant of Tyre", medium_definition: "a Tyrian, an inhabitant of Tyre.", long_definition: " from TuroV - Turos <a>5184</a>; a Tyrian, i.e. inhabitant of Tyrus:--of Tyre." })
