NTGreekWord.create({strong_id: 5185, form: "τυφλός, ή, όν", pos: "Adjective", transliteration: "tuphlos", phonetic_spelling: "(toof-los')", short_definition: "blind", medium_definition: "blind, physically or mentally.", long_definition: " from, tufow - tuphoo <a>5187</a>; opaque (as if smoky), i.e. (by analogy) blind (physically or mentally):--blind." })
NTGreekWord.create({strong_id: 5186, form: "τυφλόω", pos: "Verb", transliteration: "tuphloó", phonetic_spelling: "(toof-lo'-o)", short_definition: "I make blind", medium_definition: "I make blind, physically or mentally.", long_definition: " from tufloV - tuphlos <a>5185</a>; to make blind, i.e. (figuratively) to obscure:--blind." })
NTGreekWord.create({strong_id: 5187, form: "τυφόω", pos: "Verb", transliteration: "tuphoó", phonetic_spelling: "(toof-o'-o)", short_definition: "I puff up, make haughty", medium_definition: "I puff up, make haughty; pass: I am puffed up, am haughty.", long_definition: " from a derivative of tufw - tupho <a>5188</a>; to envelop with smoke, i.e. (figuratively) to inflate with self-conceit:--high-minded, be lifted up with pride, be proud." })
NTGreekWord.create({strong_id: 5188, form: "τύφω", pos: "Verb", transliteration: "tuphó", phonetic_spelling: "(too'-fo)", short_definition: "I raise smoke", medium_definition: "I raise smoke, smolder.", long_definition: " apparently a primary verb; to make a smoke, i.e. slowly consume without flame:--smoke." })
NTGreekWord.create({strong_id: 5189, form: "τυφωνικός, ή, όν", pos: "Adjective", transliteration: "tuphónikos", phonetic_spelling: "(too-fo-nee-kos')", short_definition: "violent, tempestuous", medium_definition: "violent, tempestuous, stormy.", long_definition: " from a derivative of tufw - tupho <a>5188</a>; stormy (as if smoky):--tempestuous." })
NTGreekWord.create({strong_id: 5190, form: "Τυχικός, ου, ὁ", pos: "Noun, Masculine", transliteration: "Tuchikos", phonetic_spelling: "(too-khee-kos')", short_definition: "Tychicus", medium_definition: "Tychicus, a Christian of the Roman province Asia.", long_definition: " from a derivative of tugcanw - tugchano <a>5177</a>; fortuitous, i.e. fortunate; Tychicus, a Christian:--Tychicus." })
NTGreekWord.create({strong_id: 5191, form: "ὑακίνθινος, ίνη, ινον", pos: "Adjective", transliteration: "huakinthinos", phonetic_spelling: "(hoo-ak-in'-thee-nos)", short_definition: "dark purple", medium_definition: "dark purple or blue, of the color of hyacinth.", long_definition: "" })
NTGreekWord.create({strong_id: 5192, form: "ὑάκινθος, ου, ὁ", pos: "Noun, Masculine", transliteration: "huakinthos", phonetic_spelling: "(hoo-ak'-in-thos)", short_definition: "jacinth", medium_definition: "jacinth, a precious stone of the color of hyacinth.", long_definition: " from uakinqoV - huakinthos <a>5192</a>; \"hyacinthine\" or \"jacinthine\", i.e. deep blue:--jacinth." })
NTGreekWord.create({strong_id: 5193, form: "ὑάλινος, η, ον", pos: "Adjective", transliteration: "hualinos", phonetic_spelling: "(hoo-al'-ee-nos)", short_definition: "glassy, transparent", medium_definition: "glassy, made of glass, transparent.", long_definition: " of uncertain derivation; the \"hyacinth\" or \"jacinth\", i.e. some gem of a deep blue color, probably the zirkon:-- jacinth." })
NTGreekWord.create({strong_id: 5194, form: "ὕαλος, ου, ἡ", pos: "Noun, Masculine", transliteration: "hualos", phonetic_spelling: "(hoo'-al-os)", short_definition: "glass", medium_definition: "glass, crystal, clear transparent stone.", long_definition: " from ualoV - hualos <a>5194</a>; glassy, i.e. transparent:--of glass." })
NTGreekWord.create({strong_id: 5195, form: "ὑβρίζω", pos: "Verb", transliteration: "hubrizó", phonetic_spelling: "(hoo-brid'-zo)", short_definition: "I insult", medium_definition: "I insult, treat with insolence.", long_definition: " perhaps from the same as uetoV - huetos <a>5205</a> (as being transparent like rain); glass:--glass." })
NTGreekWord.create({strong_id: 5196, form: "ὕβρις, εως, ἡ", pos: "Noun, Feminine", transliteration: "hubris", phonetic_spelling: "(hoo'-bris)", short_definition: "insult, damage, loss", medium_definition: "(a) insult, injury, outrage, (b) damage, loss.", long_definition: " from ubriV - hubris <a>5196</a>; to exercise violence, i.e. abuse:--use despitefully, reproach, entreat shamefully (spitefully)." })
NTGreekWord.create({strong_id: 5197, form: "ὑβριστής, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "hubristés", phonetic_spelling: "(hoo-bris-tace')", short_definition: "an insolent, insulting man", medium_definition: "an insolent, insulting, or violent man.", long_definition: " from uper - huper <a>5228</a>; insolence (as over-bearing), i.e. insult, injury:--harm, hurt, reproach." })
NTGreekWord.create({strong_id: 5198, form: "ὑγιαίνω", pos: "Verb", transliteration: "hugiainó", phonetic_spelling: "(hoog-ee-ah'-ee-no)", short_definition: "I am well", medium_definition: "I am well, am in good health; I am right, reasonable, sound, pure, uncorrupted.", long_definition: " from ubrizw - hubrizo <a>5195</a>; an insulter, i.e. maltreater:--despiteful, injurious." })
NTGreekWord.create({strong_id: 5199, form: "ὑγιής, ές", pos: "Adjective", transliteration: "hugiés", phonetic_spelling: "(hoog-ee-ace')", short_definition: "sound, whole, wholesome", medium_definition: "(a) sound, healthy, pure, whole, (b) wholesome.", long_definition: " from ugihV - hugies <a>5199</a>; to have sound health, i.e. be well (in body); figuratively, to be uncorrupt (true in doctrine):--be in health, (be safe and) sound, (be) whole(-some)." })
