NTGreekWord.create({strong_id: 5201, form: "ὑδρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "hudria", phonetic_spelling: "(hoo-dree-ah')", short_definition: "a water pot", medium_definition: "a water pot, jar, pitcher.", long_definition: " from udwr - hudor <a>5204</a>; a water-jar, i.e. receptacle for family supply:--water-pot." })
NTGreekWord.create({strong_id: 5202, form: "ὑδροποτέω", pos: "Verb", transliteration: "hudropoteó", phonetic_spelling: "(hoo-drop-ot-eh'-o)", short_definition: "I am a water drinker", medium_definition: "I am only a water drinker.", long_definition: " from a compound of udwr - hudor <a>4095</a>; to be a water-drinker, i.e. to abstain from vinous beverages:--drink water." })
NTGreekWord.create({strong_id: 5203, form: "ὑδρωπικός, ή, όν", pos: "Adjective", transliteration: "hudrópikos", phonetic_spelling: "(hoo-dro-pik-os')", short_definition: "afflicted with dropsy", medium_definition: "afflicted with dropsy.", long_definition: " from a compound of udwr - hudor <a>3700</a> (as if looking watery); to be \"dropsical\":--have the dropsy." })
NTGreekWord.create({strong_id: 5204, form: "ὕδωρ, ὕδατος, τό", pos: "Noun, Neuter", transliteration: "hudór", phonetic_spelling: "(hoo'-dore)", short_definition: "water", medium_definition: "water.", long_definition: "    hudatos hoo'-dat-os, etc. from the base of uetoV - huetos <a>5205</a>; water (as if rainy) literally or figuratively:--water." })
NTGreekWord.create({strong_id: 5205, form: "ὑετός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "huetos", phonetic_spelling: "(hoo-et-os')", short_definition: "rain", medium_definition: "rain.", long_definition: " from a primary huo (to rain); rain, especially a shower:--rain." })
NTGreekWord.create({strong_id: 5206, form: "υἱοθεσία, ας, ἡ", pos: "Noun, Feminine", transliteration: "huiothesia", phonetic_spelling: "(hwee-oth-es-ee'-ah)", short_definition: "adoption", medium_definition: "adoption, as a son into the divine family.", long_definition: " from a presumed compound of uioV - huios <a>5087</a>; the placing as a son, i.e. adoption (figuratively, Christian sonship in respect to God):--adoption (of children, of sons)." })
NTGreekWord.create({strong_id: 5207, form: "υἱός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "huios", phonetic_spelling: "(hwee-os')", short_definition: "a son, descendent", medium_definition: "a son, descendent.", long_definition: " apparently a primary word; a \"son\" (sometimes of animals), used very widely of immediate, remote or figuratively, kinship:--child, foal, son." })
NTGreekWord.create({strong_id: 5208, form: "ὕλη, ης, ἡ", pos: "Noun, Feminine", transliteration: "hulé", phonetic_spelling: "(hoo-lay')", short_definition: "wood, fuel", medium_definition: "wood, fuel.", long_definition: " perhaps akin to xulon - xulon <a>3586</a>; a forest, i.e. (by implication) fuel:--matter." })
NTGreekWord.create({strong_id: 5209, form: "ὑμᾶς", pos: "humas", transliteration: "(hoo-mas')", phonetic_spelling: "you", short_definition: "acc. of ", medium_definition: ", q.v.", long_definition: " accusative case of umeiV - humeis <a>5210</a>; you (as the objective of a verb or preposition):--ye, you (+ -ward), your (+ own)." })
NTGreekWord.create({strong_id: 5210, form: "ὑμεῖς", pos: "humeis", transliteration: "(hoo-mice')", phonetic_spelling: "you", short_definition: "nom. pl. of ", medium_definition: ", q.v.", long_definition: " irregular plural of su - su <a>4771</a>; you (as subjective of verb):--ye (yourselves), you." })
NTGreekWord.create({strong_id: 5211, form: "Ὑμέναιος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Humenaios", phonetic_spelling: "(hoo-men-ah'-yos)", short_definition: "Hymenaeus", medium_definition: "Hymenaeus.", long_definition: " from Humen (the god of weddings); \"hymeneal\"; Hymeneus, an opponent of Christianity:--Hymenaeus." })
NTGreekWord.create({strong_id: 5212, form: "ὑμέτερος, α, ον", pos: "Possessive Pronoun", transliteration: "humeteros", phonetic_spelling: "(hoo-met'-er-os)", short_definition: "your", medium_definition: "your, yours.", long_definition: " from umeiV - humeis <a>5210</a>; yours, i.e. pertaining to you:--your (own)." })
NTGreekWord.create({strong_id: 5213, form: "ὑμῖν", pos: "humin", transliteration: "(hoo-min')", phonetic_spelling: "you", short_definition: "dat. of ", medium_definition: ", q.v.", long_definition: " irregular dative case of umeiV - humeis <a>5210</a>; to (with or by) you:--ye, you, your(-selves)." })
NTGreekWord.create({strong_id: 5214, form: "ὑμνέω", pos: "Verb", transliteration: "humneó", phonetic_spelling: "(hoom-neh'-o)", short_definition: "I sing, sing hymns to", medium_definition: "I sing, sing hymns to, praise.", long_definition: " from umnoV - humnos <a>5215</a>; to hymn, i.e. sing a religious ode; by implication, to celebrate (God) in song:--sing a hymn (praise unto)." })
NTGreekWord.create({strong_id: 5215, form: "ὕμνος, ου, ὁ", pos: "Noun, Masculine", transliteration: "humnos", phonetic_spelling: "(hoom'-nos)", short_definition: "a hymn, sacred song", medium_definition: "a hymn, sacred song, song of praise to God.", long_definition: " apparently from a simpler (obsolete) form of hudeo (to celebrate; probably akin to adw - aido <a>5667</a>; a \"hymn\" or religious ode (one of the Psalms):--hymn." })
NTGreekWord.create({strong_id: 5216, form: "ὑμῶν", pos: "humón", transliteration: "(hoo-mone')", phonetic_spelling: "you", short_definition: "gen. of ", medium_definition: ", q.v.", long_definition: " genitive case of umeiV - humeis <a>5210</a>; of (from or concerning) you:--ye, you, your (own, -selves)." })
NTGreekWord.create({strong_id: 5217, form: "ὑπάγω", pos: "Verb", transliteration: "hupagó", phonetic_spelling: "(hoop-ag'-o)", short_definition: "I go away, depart", medium_definition: "I go away, depart, begone, die.", long_definition: " from upo - hupo <a>71</a>; to lead (oneself) under, i.e. withdraw or retire (as if sinking out of sight), literally or figuratively:--depart, get hence, go (a-)way." })
NTGreekWord.create({strong_id: 5218, form: "ὑπακοή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "hupakoé", phonetic_spelling: "(hoop-ak-o-ay')", short_definition: "obedience", medium_definition: "obedience, submissiveness, compliance.", long_definition: " from upakouw - hupakouo <a>5219</a>; attentive hearkening, i.e. (by implication) compliance or submission:--obedience, (make) obedient, obey(-ing)." })
NTGreekWord.create({strong_id: 5219, form: "ὑπακούω", pos: "Verb", transliteration: "hupakouó", phonetic_spelling: "(hoop-ak-oo'-o)", short_definition: "I listen, obey", medium_definition: "I listen, hearken to, obey, answer.", long_definition: " from upo - hupo <a>191</a>; to hear under (as a subordinate), i.e. to listen attentively; by implication, to heed or conform to a command or authority:--hearken, be obedient to, obey." })
NTGreekWord.create({strong_id: 5220, form: "ὕπανδρος, ον", pos: "Adjective", transliteration: "hupandros", phonetic_spelling: "(hoop'-an-dros)", short_definition: "subject to a husband, married", medium_definition: "subject to a husband, married.", long_definition: " from upo - hupo <a>435</a>; in subjection under a man, i.e. a married woman:--which hath an husband." })
NTGreekWord.create({strong_id: 5221, form: "ὑπαντάω", pos: "Verb", transliteration: "hupantaó", phonetic_spelling: "(hoop-an-tah'-o)", short_definition: "I meet", medium_definition: "I meet, go to meet.", long_definition: " from upo - hupo <a>473</a>; to go opposite (meet) under (quietly), i.e. to encounter, fall in with:--(go to) meet." })
NTGreekWord.create({strong_id: 5222, form: "ὑπάντησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "hupantésis", phonetic_spelling: "(hoop-an'-tay-sis)", short_definition: "a meeting", medium_definition: "a meeting.", long_definition: " from upantaw - hupantao <a>1519</a> for infinitive, in order to fall in with):--meeting." })
NTGreekWord.create({strong_id: 5223, form: "ὕπαρξις, εως, ἡ", pos: "Noun, Feminine", transliteration: "huparxis", phonetic_spelling: "(hoop'-arx-is)", short_definition: "goods, substance, property", medium_definition: "goods, substance, property, possessions.", long_definition: " from uparcw - huparcho <a>5225</a>; existency or proprietorship, i.e. (concretely) property, wealth:--goods, substance." })
NTGreekWord.create({strong_id: 5224, form: "ὑπάρχοντα", pos: "Noun, Neuter", transliteration: "huparchonta", phonetic_spelling: "(hoop-ar'-khon-tah)", short_definition: "goods, property", medium_definition: "things which one possesses, goods, property, belongings.", long_definition: " neuter plural of present participle active of uparcw - huparcho <a>5225</a> as noun; things extant or in hand, i.e. property or possessions:--goods, that which one has, things which (one) possesseth, substance, that hast." })
NTGreekWord.create({strong_id: 5225, form: "ὑπάρχω", pos: "Verb", transliteration: "huparchó", phonetic_spelling: "(hoop-ar'-kho)", short_definition: "I am, exist, am in possession", medium_definition: "I begin, am, exist, am in possession.", long_definition: " from upo - hupo <a>756</a>; to begin under (quietly), i.e. come into existence (be present or at hand); expletively, to exist (as copula or subordinate to an adjective, participle, adverb or preposition, or as an auxiliary to a principal (verb):--after, behave, live." })
NTGreekWord.create({strong_id: 5226, form: "ὑπείκω", pos: "Verb", transliteration: "hupeikó", phonetic_spelling: "(hoop-i'-ko)", short_definition: "I yield", medium_definition: "I yield, submit to authority.", long_definition: " from upo - hupo <a>5259</a> and eiko (to yield, be \"weak\"); to surrender:--submit self." })
NTGreekWord.create({strong_id: 5227, form: "ὑπεναντίος, α, ον", pos: "Adjective", transliteration: "hupenantios", phonetic_spelling: "(hoop-en-an-tee'-os)", short_definition: "opposite to, adverse", medium_definition: "opposite to, adverse; subst: an adversary.", long_definition: " from upo - hupo <a>1727</a>; under (covertly) contrary to, i.e. opposed or (as noun) an opponent:--adversary, against." })
NTGreekWord.create({strong_id: 5228, form: "ὑπέρ", pos: "Preposition", transliteration: "huper", phonetic_spelling: "(hoop-er')", short_definition: "in behalf of, above", medium_definition: "gen: in behalf of; acc: above.", long_definition: " a primary preposition; \"over\", i.e. (with the genitive case) of place, above, beyond, across, or causal, for the sake of, instead, regarding; with the accusative case superior to, more than:--(+ exceeding, abundantly) above, in (on) behalf of, beyond, by, + very chiefest, concerning, exceeding (above, -ly), for, + very highly, more (than), of, over, on the part of, for sake of, in stead, than, to(-ward), very. In the comparative, it retains many of the above applications." })
NTGreekWord.create({strong_id: 5229, form: "ὑπεραίρω", pos: "Verb", transliteration: "huperairó", phonetic_spelling: "(hoop-er-ah'-ee-rom-ahee)", short_definition: "I raise beyond, uplift", medium_definition: "lit: I raise beyond, uplift; mid: I lift myself up, exalt myself, am arrogant.", long_definition: " middle voice from uper - huper <a>142</a>; to raise oneself over, i.e. (figuratively) to become haughty:--exalt self, be exalted above measure." })
NTGreekWord.create({strong_id: 5230, form: "ὑπέρακμος, ον", pos: "Adjective", transliteration: "huperakmos", phonetic_spelling: "(hoop-er'-ak-mos)", short_definition: "past the bloom of youth", medium_definition: "past the bloom of youth, of full age.", long_definition: " from uper - huper <a>188</a>; beyond the \"acme\", i.e. figuratively (of a daughter) past the bloom (prime) of youth:--+ pass the flower of (her) age." })
NTGreekWord.create({strong_id: 5231, form: "ὑπεράνω", pos: "Adverb", transliteration: "huperanó", phonetic_spelling: "(hoop-er-an'-o)", short_definition: "far above", medium_definition: "far above.", long_definition: " from uper - huper <a>507</a>; above upward, i.e. greatly higher (in place or rank):--far above, over." })
