NTGreekWord.create({strong_id: 5233, form: "ὑπερβαίνω", pos: "Verb", transliteration: "huperbainó", phonetic_spelling: "(hoop-er-bah'-ee-no)", short_definition: "I transgress, go beyond", medium_definition: "I transgress; I go beyond, overreach, defraud.", long_definition: " from uper - huper <a>939</a>; to transcend, i.e. (figuratively) to overreach:--go beyond." })
NTGreekWord.create({strong_id: 5234, form: "ὑπερβαλλόντως", pos: "Adverb", transliteration: "huperballontós", phonetic_spelling: "(hoop-er-bal-lon'-toce)", short_definition: "beyond measure", medium_definition: "beyond measure.", long_definition: " adverb from present participle active of uperballw - huperballo <a>5235</a>; excessively:--beyond measure." })
NTGreekWord.create({strong_id: 5235, form: "ὑπερβάλλω", pos: "Verb", transliteration: "huperballó", phonetic_spelling: "(hoop-er-bal'-lo)", short_definition: "I surpass", medium_definition: "I surpass, excel, exceed, transcend.", long_definition: " from uper - huper <a>906</a>; to throw beyod the usual mark, i.e. (figuratively) to surpass (only active participle supereminent):--exceeding, excel, pass." })
NTGreekWord.create({strong_id: 5236, form: "ὑπερβολή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "huperbolé", phonetic_spelling: "(hoop-er-bol-ay')", short_definition: "surpassing excellence, exceedingly", medium_definition: "excess, surpassing excellence, preeminence; adv: exceedingly.", long_definition: " from uperballw - huperballo <a>1519</a> or 2596) pre- eminently:--abundance, (far more) exceeding, excellency, more excellent, beyond (out of) measure." })
NTGreekWord.create({strong_id: 5237, form: "ὑπερεῖδον", pos: "Verb", transliteration: "hupereidon", phonetic_spelling: "(hoop-er-i'-do)", short_definition: "I overlook", medium_definition: "I overlook, take no notice of, disregard.", long_definition: " from uper - huper <a>1492</a>; to overlook, i.e. not punish:--wink at." })
NTGreekWord.create({strong_id: 5238, form: "ὑπερέκεινα", pos: "Adverb", transliteration: "huperekeina", phonetic_spelling: "(hoop-er-ek'-i-nah)", short_definition: "beyond", medium_definition: "beyond.", long_definition: " from uper - huper <a>1565</a>; above those parts, i.e. still farther:--beyond." })
NTGreekWord.create({strong_id: 5239, form: "ὑπερεκτείνω", pos: "Verb", transliteration: "huperekteino", phonetic_spelling: "(hoop-er-ek-ti'-no)", short_definition: "I over-stretch", medium_definition: "I over-stretch, stretch out beyond the measure assigned to me.", long_definition: " from uper - huper <a>1614</a>; to extend inordinately:--stretch beyond." })
NTGreekWord.create({strong_id: 5240, form: "ὑπερεκχύνω", pos: "Verb", transliteration: "huperekchunnó", phonetic_spelling: "(hoop-er-ek-khoo'-no)", short_definition: "I pour out so that it overflows", medium_definition: "I pour out so that it overflows.", long_definition: " from uper - huper <a>1632</a>; to pour out over, i.e. (passively) to overflow:--run over." })
NTGreekWord.create({strong_id: 5241, form: "ὑπερεντυγχάνω", pos: "Verb", transliteration: "huperentugchanó", phonetic_spelling: "(hoop-er-en-toong-khan'-o)", short_definition: "I intercede for", medium_definition: "I intercede for, make petition for.", long_definition: " from uper - huper <a>1793</a>; to intercede in behalf of:--make intercession for" })
NTGreekWord.create({strong_id: 5242, form: "ὑπερέχω", pos: "Verb", transliteration: "huperechó", phonetic_spelling: "(hoop-er-ekh'-o)", short_definition: "I excel, surpass", medium_definition: "I excel, surpass, am superior.", long_definition: " from uper - huper <a>2192</a>; to hold oneself above, i.e. (figuratively) to excel; participle (as adjective, or neuter as noun) superior, superiority:--better, excellency, higher, pass, supreme." })
NTGreekWord.create({strong_id: 5243, form: "ὑπερηφανία, ας, ἡ", pos: "Noun, Feminine", transliteration: "huperéphania", phonetic_spelling: "(hoop-er-ay-fan-ee'-ah)", short_definition: "pride, arrogance", medium_definition: "pride, arrogance, disdain.", long_definition: " from uperhfanoV - huperephanos <a>5244</a>; haughtiness:--pride." })
NTGreekWord.create({strong_id: 5244, form: "ὑπερήφανος, ον", pos: "Adjective", transliteration: "huperephanos", phonetic_spelling: "(hoop-er-ay'-fan-os)", short_definition: "proud, arrogant", medium_definition: "proud, arrogant, disdainful.", long_definition: " from uper - huper <a>5316</a>; appearing above others (conspicuous), i.e. (figuratively) haughty:--proud." })
NTGreekWord.create({strong_id: 5245, form: "ὑπερνικάω", pos: "Verb", transliteration: "hupernikaó", phonetic_spelling: "(hoop-er-nik-ah'-o)", short_definition: "I am more than conqueror", medium_definition: "I am more than conqueror, prevail mightily.", long_definition: " from uper - huper <a>3528</a>; to vanquish beyond, i.e. gain a decisive victory:--more than conquer." })
