NTGreekWord.create({strong_id: 5247, form: "ὑπεροχή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "huperoché", phonetic_spelling: "(hoop-er-okh-ay')", short_definition: "superiority, excellence", medium_definition: "superiority, excellence, preeminence, authority.", long_definition: " from uperecw - huperecho <a>5242</a>; prominence, i.e. (figuratively) superiority (in rank or character):--authority, excellency." })
