NTGreekWord.create({strong_id: 5249, form: "ὑπερπερισσῶς", pos: "Adverb", transliteration: "huperperissós", phonetic_spelling: "(hoop-er-per-is-soce')", short_definition: "beyond measure", medium_definition: "superabundantly, beyond measure.", long_definition: " from uper - huper <a>4057</a>; superabundantly, i.e. exceedingly:--beyond measure." })
NTGreekWord.create({strong_id: 5250, form: "ὑπερπλεονάζω", pos: "Verb", transliteration: "huperpleonazó", phonetic_spelling: "(hoop-er-pleh-on-ad'-zo)", short_definition: "I am exceedingly abundant", medium_definition: "I abound exceedingly, am exceedingly abundant.", long_definition: " from uper - huper <a>4121</a>; to superabound:--be exceeding abundant." })
NTGreekWord.create({strong_id: 5251, form: "ὑπερυψόω", pos: "Verb", transliteration: "huperupsoó", phonetic_spelling: "(hoop-er-oop-so'-o)", short_definition: "I highly exalt", medium_definition: "I highly exalt.", long_definition: " from uper - huper <a>5312</a>; to elevate above others, i.e. raise to the highest position:--highly exalt." })
NTGreekWord.create({strong_id: 5252, form: "ὑπερφρονέω", pos: "Verb", transliteration: "huperphroneó", phonetic_spelling: "(hoop-er-fron-eh'-o)", short_definition: "I have high notions", medium_definition: "I have high notions, am over-proud.", long_definition: " from uper - huper <a>5426</a>; to esteem oneself overmuch, i.e. be vain or arrogant:--think more highly." })
NTGreekWord.create({strong_id: 5253, form: "ὑπερῷον, ου, τό", pos: "Noun, Neuter", transliteration: "huperóon", phonetic_spelling: "(hoop-er-o'-on)", short_definition: "an upper room", medium_definition: "an upper room, the upper part of a house.", long_definition: " neuter of a derivative of uper - huper <a>5228</a>; a higher part of the house, i.e. apartment in the third story:--upper chamber (room)." })
NTGreekWord.create({strong_id: 5254, form: "ὑπέχω", pos: "Verb", transliteration: "hupechó", phonetic_spelling: "(hoop-ekh'-o)", short_definition: "I submit to, undergo", medium_definition: "I submit to, undergo, suffer.", long_definition: " from upo - hupo <a>2192</a>; to hold oneself under, i.e. endure with patience:--suffer." })
NTGreekWord.create({strong_id: 5255, form: "ὑπήκοος, ον", pos: "Adjective", transliteration: "hupékoos", phonetic_spelling: "(hoop-ay'-ko-os)", short_definition: "listening to, obedient", medium_definition: "listening to, obedient, submissive.", long_definition: " from upakouw - hupakouo <a>5219</a>; attentively listening, i.e. (by implication) submissive:--obedient." })
NTGreekWord.create({strong_id: 5256, form: "ὑπηρετέω", pos: "Verb", transliteration: "hupéreteó", phonetic_spelling: "(hoop-ay-ret-eh'-o)", short_definition: "I minister to, serve", medium_definition: "I minister to, serve.", long_definition: " from uperhthV - huperetes <a>5257</a>; to be a subordinate, i.e. (by implication) subserve:--minister (unto), serve." })
NTGreekWord.create({strong_id: 5257, form: "ὑπηρέτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "hupéretés", phonetic_spelling: "(hoop-ay-ret'-ace)", short_definition: "a servant, an attendant", medium_definition: "a servant, an attendant, (a) an officer, lictor, (b) an attendant in a synagogue, (c) a minister of the gospel.", long_definition: " from upo - hupo <a>5259</a> and a derivative of eresso (to row); an under-oarsman, i.e. (generally) subordinate (assistant, sexton, constable):--minister, officer, servant." })
NTGreekWord.create({strong_id: 5258, form: "ὕπνος, ου, ὁ", pos: "Noun, Masculine", transliteration: "hupnos", phonetic_spelling: "(hoop'-nos)", short_definition: "sleep", medium_definition: "sleep; fig: spiritual sleep.", long_definition: " from an obsolete primary (perhaps akin to upo - hupo <a>5259</a> through the idea of subsilience); sleep, i.e. (figuratively) spiritual torpor:--sleep." })
NTGreekWord.create({strong_id: 5259, form: "ὑπό", pos: "Preposition", transliteration: "hupo", phonetic_spelling: "(hoop-o')", short_definition: "by, under, about", medium_definition: "by, under, about.", long_definition: " a primary preposition; under, i.e. (with the genitive case) of place (beneath), or with verbs (the agency or means, through); (with the accusative case) of place (whither (underneath) or where (below) or time (when (at)):--among, by, from, in, of, under, with. In the comparative, it retains the same general applications, especially of inferior position or condition, and specially, covertly or moderately." })
NTGreekWord.create({strong_id: 5260, form: "ὑποβάλλω", pos: "Verb", transliteration: "hupoballó", phonetic_spelling: "(hoop-ob-al'-lo)", short_definition: "I suborn, instruct privately", medium_definition: "I throw or put under; met: I subject, submit, suggest, whisper, prompt, suborn, instigate.", long_definition: " from upo - hupo <a>906</a>; to throw in stealthily, i.e. introduce by collusion:--suborn." })
NTGreekWord.create({strong_id: 5261, form: "ὑπογραμμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "hupogrammos", phonetic_spelling: "(hoop-og-ram-mos')", short_definition: "a writing-copy, an example", medium_definition: "a writing-copy, an example, pattern.", long_definition: " from a compound of upo - hupo <a>1125</a>; an underwriting, i.e. copy for imitation (figuratively):--example." })
