NTGreekWord.create({strong_id: 5318, form: "φανερός, ά, όν", pos: "Adjective", transliteration: "phaneros", phonetic_spelling: "(fan-er-os')", short_definition: "apparent, clear, visible, manifest, clearly", medium_definition: "apparent, clear, visible, manifest; adv: clearly.", long_definition: " of Hebrew origin (Peleg <a>6389</a>; Phalek (i.e. Peleg), a patriarch:--Phalec." })
