NTGreekWord.create({strong_id: 5376, form: "Φίλιππος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Philippos", phonetic_spelling: "(fil'-ip-pos)", short_definition: "Philip", medium_definition: "Philip, (a) one of the twelve apostles of Jesus, (b) tetrarch of the Ituraean and Trachonitic region, half-brother of Herod Antipas, tetrarch of Galilee, (c) one of the seven original deacons at Jerusalem and a missionary.", long_definition: " plural of FilippoV - Philippos <a>5376</a>; Philippi, a place in Macedonia:--Philippi." })
NTGreekWord.create({strong_id: 5377, form: "φιλόθεος, ον", pos: "Adjective", transliteration: "philotheos", phonetic_spelling: "(fil-oth'-eh-os)", short_definition: "loving God", medium_definition: "loving God.", long_definition: " from filoV - philos <a>2462</a>; fond of horses; Philippus, the name of four Israelites:--Philip." })
NTGreekWord.create({strong_id: 5378, form: "Φιλόλογος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Philologos", phonetic_spelling: "(fil-ol'-og-os)", short_definition: "Philologus", medium_definition: "Philologus, a Roman Christian.", long_definition: " from filoV - philos <a>2316</a>; fond of God, i.e. pious:--lover of God." })
NTGreekWord.create({strong_id: 5379, form: "φιλονεικία, ας, ἡ", pos: "Noun, Feminine", transliteration: "philoneikia", phonetic_spelling: "(fil-on-i-kee'-ah)", short_definition: "love of dispute, contention", medium_definition: "love of dispute, contention.", long_definition: " from filoV - philos <a>3056</a>; fond of words, i.e. talkative (argumentative, learned, \"philological\"); Philologus, a Christian:--Philologus." })
NTGreekWord.create({strong_id: 5380, form: "φιλόνεικος, ον", pos: "Adjective", transliteration: "philoneikos", phonetic_spelling: "(fil-on'-i-kos)", short_definition: "strife-loving, contentious", medium_definition: "strife-loving, contentious.", long_definition: " from filoneikoV - philoneikos <a>5380</a>; quarrelsomeness, i.e. a dispute:--strife." })
NTGreekWord.create({strong_id: 5381, form: "φιλοξενία, ας, ἡ", pos: "Noun, Feminine", transliteration: "philoxenia", phonetic_spelling: "(fil-on-ex-ee'-ah)", short_definition: "hospitality", medium_definition: "love to strangers, hospitality.", long_definition: " from filoV - philos <a>5384</a> and neikos (a quarrel; probably akin to 3534); fond of strife, i.e. disputatious:--contentious." })
NTGreekWord.create({strong_id: 5382, form: "φιλόξενος, ον", pos: "Adjective", transliteration: "philoxenos", phonetic_spelling: "(fil-ox'-en-os)", short_definition: "hospitable", medium_definition: "hospitable, loving strangers.", long_definition: " from filoxenoV - philoxenos <a>5382</a>; hospitableness:--entertain stranger, hospitality." })
NTGreekWord.create({strong_id: 5383, form: "φιλοπρωτεύω", pos: "Verb", transliteration: "philopróteuó", phonetic_spelling: "(fil-op-rote-yoo'-o)", short_definition: "I desire preeminence", medium_definition: "I love the chief place, desire preeminence.", long_definition: " from filoV - philos <a>3581</a>; fond of guests, i.e. hospitable:--given to (lover of, use) hospitality." })
NTGreekWord.create({strong_id: 5384, form: "φίλος, η, ον", pos: "Adjective; Indeclinable Numeral (Adjective)", transliteration: "philos", phonetic_spelling: "(fee'-los)", short_definition: "friendly, a friend", medium_definition: "friendly; subst: a friend, an associate.", long_definition: " from a compound of filoV - philos <a>4413</a>; to be fond of being first, i.e. ambitious of distinction:--love to have the preeminence." })
NTGreekWord.create({strong_id: 5385, form: "φιλοσοφία, ας, ἡ", pos: "Noun, Feminine", transliteration: "philosophia", phonetic_spelling: "(fil-os-of-ee'-ah)", short_definition: "love of wisdom, philosophy", medium_definition: "love of wisdom, philosophy, in the NT of traditional Jewish theology.", long_definition: " properly, dear, i.e. a friend; actively, fond, i.e. friendly (still as a noun, an associate, neighbor, etc.):--friend." })
NTGreekWord.create({strong_id: 5386, form: "φιλόσοφος, ου, ὁ", pos: "Noun, Masculine", transliteration: "philosophos", phonetic_spelling: "(fil-os'-of-os)", short_definition: "a philosopher", medium_definition: "a philosopher.", long_definition: " from filosofoV - philosophos <a>5386</a>; \"philosophy\", i.e. (specially), Jewish sophistry:--philosophy." })
NTGreekWord.create({strong_id: 5387, form: "φιλόστοργος, ον", pos: "Adjective", transliteration: "philostorgos", phonetic_spelling: "(fil-os'-tor-gos)", short_definition: "tenderly loving", medium_definition: "tenderly loving, kindly affectionate to.", long_definition: " from filoV - philos <a>4680</a>; fond of wise things, i.e. a \"philosopher\":--philosopher." })
NTGreekWord.create({strong_id: 5388, form: "φιλότεκνος, ον", pos: "Adjective", transliteration: "philoteknos", phonetic_spelling: "(fil-ot'-ek-nos)", short_definition: "loving one's children", medium_definition: "loving one's children.", long_definition: " from filoV - philos <a>5384</a> and storge (cherishing one's kindred, especially parents or children); fond of natural relatives, i.e. fraternal towards fellow Christian:--kindly affectioned." })
NTGreekWord.create({strong_id: 5389, form: "φιλοτιμέομαι", pos: "Verb", transliteration: "philotimeomai", phonetic_spelling: "(fil-ot-im-eh'-om-ahee)", short_definition: "I desire very strongly", medium_definition: "I am zealous, strive eagerly, desire very strongly.", long_definition: " from filoV - philos <a>5043</a>; fond of one's children, i.e. maternal:--love their children." })
NTGreekWord.create({strong_id: 5390, form: "φιλοφρόνως", pos: "Adverb", transliteration: "philophronós", phonetic_spelling: "(fil-of-ron'-oce)", short_definition: "kindly", medium_definition: "kindly, in a friendly manner.", long_definition: " middle voice from a compound of filoV - philos <a>5092</a>; to be fond of honor, i.e. emulous (eager or earnest to do something):--labour, strive, study." })
NTGreekWord.create({strong_id: 5391, form: "φιλόφρων, ον", pos: "Adjective", transliteration: "philophrón", phonetic_spelling: "(fil-of'-rone)", short_definition: "friendly, kindly", medium_definition: "friendly, kindly, courteous.", long_definition: " adverb from filofrwn - philophron <a>5391</a>; with friendliness of mind, i.e. kindly:--courteously." })
NTGreekWord.create({strong_id: 5392, form: "φιμόω", pos: "Verb", transliteration: "phimoó", phonetic_spelling: "(fee-mo'-o)", short_definition: "I muzzle, silence", medium_definition: "I muzzle, silence.", long_definition: " from filoV - philos <a>5424</a>; friendly of mind, i.e. kind:--courteous." })
NTGreekWord.create({strong_id: 5393, form: "Φλέγων, οντος, ὁ", pos: "Noun, Masculine", transliteration: "Phlegón", phonetic_spelling: "(fleg'-one)", short_definition: "Phlegon", medium_definition: "Phlegon, a Roman Christian man.", long_definition: " from phimos (a muzzle); to muzzle:--muzzle." })
NTGreekWord.create({strong_id: 5394, form: "φλογίζω", pos: "Verb", transliteration: "phlogizó from NG5395", phonetic_spelling: "(flog-id'-zo)", short_definition: "I inflame, fire with passion", medium_definition: "I inflame, fire with passion, set on fire, burn up.", long_definition: " active participle of the base of flox - phlox <a>5395</a>; blazing; Phlegon, a Christian:--Phlegon." })
NTGreekWord.create({strong_id: 5395, form: "φλόξ, φλογός, ἡ", pos: "Noun, Feminine", transliteration: "phlox", phonetic_spelling: "(flox)", short_definition: "a flame", medium_definition: "a flame.", long_definition: " from flox - phlox <a>5395</a>; to cause a blaze, i.e. ignite (figuratively, to inflame with passion):--set on fire." })
NTGreekWord.create({strong_id: 5396, form: "φλυαρέω", pos: "Verb", transliteration: "phluareó", phonetic_spelling: "(floo-ar-eh'-o)", short_definition: "I gossip against", medium_definition: "I gossip against, talk idly, make empty charges against, talk nonsense.", long_definition: " from a primary phlego (to \"flash\" or \"flame\"); a blaze:--flame(-ing)." })
NTGreekWord.create({strong_id: 5397, form: "φλύαρος, ον", pos: "Adjective", transliteration: "phluaros", phonetic_spelling: "(floo'-ar-os)", short_definition: "prating, talking foolishly", medium_definition: "prating, talking foolishly, babbling.", long_definition: " from fluaroV - phluaros <a>5397</a>; to be a babbler or trifler, i.e. (by implication) to berate idly or mischievously:--prate against." })
NTGreekWord.create({strong_id: 5398, form: "φοβερός, ά, όν", pos: "Adjective", transliteration: "phoberos", phonetic_spelling: "(fob-er-os')", short_definition: "fearful, dreadful", medium_definition: "fearful, dreadful, terrible.", long_definition: " from phluo (to bubble); a garrulous person, i.e. prater:--tattler." })
NTGreekWord.create({strong_id: 5399, form: "φοβέομαι", pos: "Verb", transliteration: "phobeó", phonetic_spelling: "(fob-eh'-o)", short_definition: "I fear, am terrified", medium_definition: "I fear, dread, reverence, am afraid, terrified.", long_definition: " from foboV - phobos <a>5401</a>; frightful, i.e. (objectively) formidable:--fearful, terrible." })
NTGreekWord.create({strong_id: 5400, form: "φόβητρον, ου, τό", pos: "Noun, Neuter", transliteration: "phobétron", phonetic_spelling: "(fob'-ay-tron)", short_definition: "a cause of terror", medium_definition: "a terrible sight, cause of terror, an object of fear.", long_definition: " from foboV - phobos <a>5401</a>; to frighten, i.e. (passively) to be alarmed; by analogy, to be in awe of, i.e. revere:--be (+ sore) afraid, fear (exceedingly), reverence." })
NTGreekWord.create({strong_id: 5401, form: "φόβος, ου, ὁ", pos: "Noun, Masculine", transliteration: "phobos", phonetic_spelling: "(fob'-os)", short_definition: "fear, terror, reverence", medium_definition: "(a) fear, terror, alarm, (b) the object or cause of fear, (c) reverence, respect.", long_definition: " from a primary phebomai (to be put in fear); alarm or fright:--be afraid, + exceedingly, fear, terror." })
NTGreekWord.create({strong_id: 5402, form: "Φοίβη, ης, ἡ", pos: "Noun, Feminine", transliteration: "Phoibé", phonetic_spelling: "(foy'-bay)", short_definition: "Phoebe", medium_definition: "Phoebe, a Christian woman in the church at Cenchreae.", long_definition: " feminine of phoibos (bright; probably akin to the base of 5457); Phoebe, a Christian woman:--Phebe." })
NTGreekWord.create({strong_id: 5403, form: "Φοινίκη, ης, ἡ", pos: "Noun, Feminine", transliteration: "Phoiniké", phonetic_spelling: "(foy-nee'-kay)", short_definition: "Phoenicia", medium_definition: "Phoenicia, a northern coast strip of the Roman province Syria.", long_definition: " from foinix - phoinix <a>5404</a>; palm-country; Phoenice (or Phoenicia), a region of Palestine:--Phenice, Phenicia." })
NTGreekWord.create({strong_id: 5404, form: "φοίνιξ, ικός, ὁ", pos: "Noun, Masculine", transliteration: "phoinix", phonetic_spelling: "(foy'-nix)", short_definition: "a palm tree, palm branch", medium_definition: "a palm tree, the date-palm.", long_definition: " of uncertain derivation; a palm-tree:--palm (tree)." })
NTGreekWord.create({strong_id: 5405, form: "Φοῖνιξ, ικός, ἡ", pos: "Noun, Masculine", transliteration: "Phoinix", phonetic_spelling: "(foy'-nix)", short_definition: "Phoenix", medium_definition: "Phoenix, a bay on the south coast of Crete.", long_definition: " probably the same as foinix - phoinix <a>5404</a>; Phoenix, a place in Crete:--Phenice." })
NTGreekWord.create({strong_id: 5406, form: "φονεύς, έως, ὁ", pos: "Noun, Masculine", transliteration: "phoneus", phonetic_spelling: "(fon-yooce')", short_definition: "a murderer", medium_definition: "a murderer.", long_definition: " from fonoV - phonos <a>4607</a> is a special term for a public bandit):--murderer." })
NTGreekWord.create({strong_id: 5407, form: "φονεύω", pos: "Verb", transliteration: "phoneuó", phonetic_spelling: "(fon-yoo'-o)", short_definition: "I murder", medium_definition: "I murder, kill.", long_definition: " from foneuV - phoneus <a>5406</a>; to be a murderer (of):--kill, do murder, slay." })
NTGreekWord.create({strong_id: 5408, form: "φόνος, ου, ὁ", pos: "Noun, Masculine", transliteration: "phonos", phonetic_spelling: "(fon'-os)", short_definition: "murder, slaughter", medium_definition: "murder, slaughter, killing.", long_definition: " from an obsolete primary pheno (to slay); murder:--murder, + be slain with, slaughter." })
NTGreekWord.create({strong_id: 5409, form: "φορέω", pos: "Verb", transliteration: "phoreó", phonetic_spelling: "(for-eh'-o)", short_definition: "I carry, wear", medium_definition: "I carry, wear, bear constantly.", long_definition: " from foroV - phoros <a>5411</a>; to have a burden, i.e. (by analogy) to wear as clothing or a constant accompaniment:--bear, wear." })
NTGreekWord.create({strong_id: 5410, form: "Φόρον, ου, τό", pos: "Noun, Neuter", transliteration: "phoron", phonetic_spelling: "(for'-on)", short_definition: "Forum, Market", medium_definition: "(of Latin origin), Forum, Market, Market-Town.", long_definition: " of Latin origin; a forum or market-place; only in comparative with AppioV - Appios <a>675</a>; a station on the Appian road:--forum." })
NTGreekWord.create({strong_id: 5411, form: "φόρος, ου, ὁ", pos: "Noun, Masculine", transliteration: "phoros", phonetic_spelling: "(for'-os)", short_definition: "a tax, tribute", medium_definition: "a tax, tribute, especially on persons.", long_definition: " from ferw - phero <a>5056</a> is usually a general toll on goods or travel):--tribute." })
NTGreekWord.create({strong_id: 5412, form: "φορτίζω", pos: "Verb", transliteration: "phortizó", phonetic_spelling: "(for-tid'-zo)", short_definition: "I load, burden", medium_definition: "I load, burden; pass: I am laden.", long_definition: " from fortoV - phortos <a>5414</a>; to load up (properly, as a vessel or animal), i.e. (figuratively) to overburden with ceremony (or spiritual anxiety):--lade, by heavy laden." })
NTGreekWord.create({strong_id: 5413, form: "φορτίον, ου, τό", pos: "Noun, Neuter", transliteration: "phortion", phonetic_spelling: "(for-tee'-on)", short_definition: "a burden, freight", medium_definition: "a burden; the freight of a ship.", long_definition: " diminutive of fortoV - phortos <a>5414</a>; an invoice (as part of freight), i.e. (figuratively) a task or service:--burden." })
NTGreekWord.create({strong_id: 5414, form: "φόρτος", pos: "phortos", transliteration: "(for'-tos)", phonetic_spelling: "cargo", short_definition: "variant reading for ", medium_definition: ", q.v.", long_definition: " from ferw - phero <a>5342</a>; something carried, i.e. the cargo of a ship:--lading." })
NTGreekWord.create({strong_id: 5415, form: "Φορτουνάτος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Phortounatos", phonetic_spelling: "(for-too-nat'-os)", short_definition: "Fortunatus", medium_definition: "Fortunatus, a Christian of Corinth.", long_definition: " of Latin origin; \"fortunate\"; Fortunatus, a Christian:--Fortunatus." })
NTGreekWord.create({strong_id: 5416, form: "φραγέλλιον, ου, τό", pos: "Noun, Neuter", transliteration: "phragellion", phonetic_spelling: "(frag-el'-le-on)", short_definition: "a scourge, lash", medium_definition: "a scourge, lash, whip.", long_definition: " neuter of a derivative from the base of fragellow - phragelloo <a>5417</a>; a whip, i.e. Roman lash as a public punishment:--scourge." })
NTGreekWord.create({strong_id: 5417, form: "φραγελλόω", pos: "Verb", transliteration: "phragelloó", phonetic_spelling: "(frag-el-lo'-o)", short_definition: "I flagellate, scourge", medium_definition: "I flagellate, scourge.", long_definition: " from a presumed equivalent of the Latin flagellum; to whip, i.e. lash as a public punishment:--scourge." })
NTGreekWord.create({strong_id: 5418, form: "φραγμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "phragmos", phonetic_spelling: "(frag-mos')", short_definition: "a hedge, fence, partition", medium_definition: "a hedge, fence, partition.", long_definition: " from frassw - phrasso <a>5420</a>; a fence, or inclosing barrier (literally or figuratively):--hedge (+ round about), partition." })
NTGreekWord.create({strong_id: 5419, form: "φράζω", pos: "Verb", transliteration: "phrazó", phonetic_spelling: "(frad'-zo)", short_definition: "I declare, explain, interpret", medium_definition: "I declare, explain, interpret.", long_definition: " probably akin to frassw - phrasso <a>5420</a> through the idea of defining; to indicate (by word or act), i.e. (specially), to expound:-- declare." })
NTGreekWord.create({strong_id: 5420, form: "φράσσω", pos: "Verb", transliteration: "phrassó", phonetic_spelling: "(fras'-so)", short_definition: "I stop, close up", medium_definition: "I stop, close up, obstruct.", long_definition: " apparently a strengthening form of the base of frhn - phren <a>5424</a>; to fence or inclose, i.e. (specially), to block up (figuratively, to silence):--stop." })
NTGreekWord.create({strong_id: 5421, form: "φρέαρ, φρέατος, τό", pos: "Noun, Neuter", transliteration: "phrear", phonetic_spelling: "(freh'-ar)", short_definition: "a pit, well", medium_definition: "a pit, well, cistern.", long_definition: " of uncertain derivation; a hole in the ground (dug for obtaining or holding water or other purposes), i.e. a cistern or well; figuratively, an abyss (as a prison):--well, pit." })
NTGreekWord.create({strong_id: 5422, form: "φρεναπατάω", pos: "Verb", transliteration: "phrenapataó", phonetic_spelling: "(fren-ap-at-ah'-o)", short_definition: "I deceive the mind", medium_definition: "I deceive the mind, impose upon.", long_definition: " from frenapathV - phrenapates <a>5423</a>; to be a mind-misleader, i.e. delude:--deceive." })
NTGreekWord.create({strong_id: 5423, form: "φρεναπάτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "phrenapatés", phonetic_spelling: "(fren-ap-at'-ace)", short_definition: "a mind-deceiver", medium_definition: "a deceiver, seducer.", long_definition: " from frhn - phren <a>539</a>; a mind-misleader, i.e. seducer:--deceiver." })
NTGreekWord.create({strong_id: 5424, form: "φρήν, φρενός, ἡ", pos: "Noun, Feminine", transliteration: "phrén", phonetic_spelling: "(frane)", short_definition: "the mind, intellect", medium_definition: "the mind, intellect, thought, understanding.", long_definition: " probably from an obsolete phrao (to rein in or curb; compare 5420); the midrif (as a partition of the body), i.e. (figuratively and by implication, of sympathy) the feelings (or sensitive nature; by extension (also in the plural) the mind or cognitive faculties):--understanding." })
NTGreekWord.create({strong_id: 5425, form: "φρίσσω", pos: "Verb", transliteration: "phrissó", phonetic_spelling: "(fris'-so)", short_definition: "I shudder", medium_definition: "I shudder, shiver, tremble.", long_definition: " apparently a primary verb; to \"bristle\" or chill, i.e. shudder (fear):--tremble." })
NTGreekWord.create({strong_id: 5426, form: "φρονέω", pos: "Verb", transliteration: "phroneó", phonetic_spelling: "(fron-eh'-o)", short_definition: "I think, judge, observe", medium_definition: "(a) I think, (b) I think, judge, (c) I direct the mind to, seek for, (d) I observe, (e) I care for.", long_definition: " from frhn - phren <a>5424</a>; to exercise the mind, i.e. entertain or have a sentiment or opinion; by implication, to be (mentally) disposed (more or less earnestly in a certain direction); intensively, to interest oneself in (with concern or obedience):--set the affection on, (be) care(-ful), (be like-, + be of one, + be of the same, + let this) mind(-ed), regard, savour, think." })
NTGreekWord.create({strong_id: 5427, form: "φρόνημα, ατος, τό", pos: "Noun, Neuter", transliteration: "phronéma", phonetic_spelling: "(fron'-ay-mah)", short_definition: "thought, purpose", medium_definition: "thought, purpose, aspirations.", long_definition: " from fronew - phroneo <a>5426</a>; (mental) inclination or purpose:--(be, + be carnally, + be spiritually) mind(-ed)." })
NTGreekWord.create({strong_id: 5428, form: "φρόνησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "phronésis", phonetic_spelling: "(fron'-ay-sis)", short_definition: "understanding", medium_definition: "understanding (which leads to right action), practical wisdom, prudence.", long_definition: " from fronew - phroneo <a>5426</a>; mental action or activity, i.e. intellectual or moral insight:--prudence, wisdom." })
NTGreekWord.create({strong_id: 5429, form: "φρόνιμος, ον", pos: "Adjective", transliteration: "phronimos", phonetic_spelling: "(fron'-ee-mos)", short_definition: "intelligent, prudent", medium_definition: "intelligent, prudent, sensible, wise.", long_definition: " from frhn - phren <a>4908</a> indicates rather intelligence or mental acquirement); in a bad sense conceited (also in the comparative):--wise(-r)." })
NTGreekWord.create({strong_id: 5430, form: "φρονίμως", pos: "Adverb", transliteration: "phronimós", phonetic_spelling: "(fron-im'-oce)", short_definition: "wisely, sensibly, prudently", medium_definition: "wisely, sensibly, prudently.", long_definition: " adverb from fronimoV - phronimos <a>5429</a>; prudently:--wisely." })
NTGreekWord.create({strong_id: 5431, form: "φροντίζω", pos: "Verb", transliteration: "phrontizó", phonetic_spelling: "(fron-tid'-zo)", short_definition: "I am thoughtful, careful", medium_definition: "I am thoughtful, careful, give heed.", long_definition: " from a derivative of frhn - phren <a>5424</a>; to exercise thought, i.e. be anxious:--be careful." })
NTGreekWord.create({strong_id: 5432, form: "φρουρέω", pos: "Verb", transliteration: "phroureó", phonetic_spelling: "(froo-reh'-o)", short_definition: "I guard, keep", medium_definition: "I guard, keep, as by a military guard.", long_definition: " from a compound of pro - pro <a>5083</a>." })
NTGreekWord.create({strong_id: 5433, form: "φρυάσσω", pos: "Verb", transliteration: "phruassó", phonetic_spelling: "(froo-as'-so)", short_definition: "I roar, rage", medium_definition: "I am wanton, insolent; I roar, rage.", long_definition: " akin to bruw - bruo <a>1031</a>; to snort (as a spirited horse), i.e. (figuratively) to make a tumult:--rage." })
NTGreekWord.create({strong_id: 5434, form: "φρύγανον, ου, τό", pos: "Noun, Neuter", transliteration: "phruganon", phonetic_spelling: "(froo'-gan-on)", short_definition: "a dry stick for burning", medium_definition: "a dry stick for burning.", long_definition: " neuter of a presumed derivative of phrugo (to roast or parch; akin to the base of 5395); something desiccated, i.e. a dry twig:--stick." })
NTGreekWord.create({strong_id: 5435, form: "Φρυγία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Phrugia", phonetic_spelling: "(froog-ee'-ah)", short_definition: "Phrygia", medium_definition: "Phrygia, an ethnic district in Asia Minor, the north-western part of which was in the Roman province Asia and the south-eastern part in the Roman province Galatia.", long_definition: " probably of foreign origin; Phrygia, a region of Asia Minor:--Phrygia." })
NTGreekWord.create({strong_id: 5436, form: "Φύγελος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Phugelos", phonetic_spelling: "(foog'-el-los)", short_definition: "Phygelus", medium_definition: "Phygelus, a Christian of the Roman province Asia who deserted Paul.", long_definition: " probably from feugw - pheugo <a>5343</a>; fugitive; Phygellus, an apostate Christian:--Phygellus." })
NTGreekWord.create({strong_id: 5437, form: "φυγή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "phugé", phonetic_spelling: "(foog-ay')", short_definition: "flight", medium_definition: "flight, fleeing.", long_definition: " from feugw - pheugo <a>5343</a>; a fleeing, i.e. escape:--flight." })
NTGreekWord.create({strong_id: 5438, form: "φυλακή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "phulaké", phonetic_spelling: "(foo-lak-ay')", short_definition: "a watching, guard, prison, imprisonment", medium_definition: "a watching, keeping guard; a guard, prison; imprisonment.", long_definition: " from fulassw - phulasso <a>5442</a>; a guarding or (concretely, guard), the act, the person; figuratively, the place, the condition, or (specially), the time (as a division of day or night), literally or figuratively:--cage, hold, (im-)prison(-ment), ward, watch." })
NTGreekWord.create({strong_id: 5439, form: "φυλακίζω", pos: "Verb", transliteration: "phulakizó", phonetic_spelling: "(foo-lak-id'-zo)", short_definition: "I imprison", medium_definition: "I imprison, deliver into custody.", long_definition: " from fulax - phulax <a>5441</a>; to incarcerate:--imprison." })
NTGreekWord.create({strong_id: 5440, form: "φυλακτήριον, ου, τό", pos: "Noun, Neuter", transliteration: "phulaktérion", phonetic_spelling: "(foo-lak-tay'-ree-on)", short_definition: "a phylactery, an amulet", medium_definition: "a phylactery, an amulet, a parchment capsule containing little parchment rolls with the Hebrew texts, affixed to the left upper arm or the forehead of men at morning prayer, and regarded as a protection (hence the name) against evil spirits.", long_definition: " neuter of a derivative of fulassw - phulasso <a>5442</a>; a guard-case, i.e. \"phylactery\" for wearing slips of Scripture texts:-- phylactery." })
NTGreekWord.create({strong_id: 5441, form: "φύλαξ, ακός, ὁ", pos: "Noun, Masculine", transliteration: "phulax", phonetic_spelling: "(foo'-lax)", short_definition: "a guard, keeper, sentinel", medium_definition: "a guard, keeper, sentinel.", long_definition: " from fulassw - phulasso <a>5442</a>; a watcher or sentry:--keeper." })
NTGreekWord.create({strong_id: 5442, form: "φυλάσσω", pos: "Verb", transliteration: "phulassó", phonetic_spelling: "(foo-las'-so)", short_definition: "I keep, guard, observe", medium_definition: "(a) I guard, protect; mid: I am on my guard, (b) act. and mid. of customs and regulations: I keep, observe.", long_definition: " probably from fulh - phule <a>5083</a>." })
NTGreekWord.create({strong_id: 5443, form: "φυλή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "phulé", phonetic_spelling: "(foo-lay')", short_definition: "a tribe, race", medium_definition: "a tribe or race of people.", long_definition: " from fuw - phuo <a>5453</a> (compare 5444); an offshoot, i.e. race or clan:--kindred, tribe." })
NTGreekWord.create({strong_id: 5444, form: "φύλλον, ου, τό", pos: "Noun, Neuter", transliteration: "phullon", phonetic_spelling: "(fool'-lon)", short_definition: "a leaf", medium_definition: "a leaf.", long_definition: " from the same as fulh - phule <a>5443</a>; a sprout, i.e. leaf:--leaf." })
NTGreekWord.create({strong_id: 5445, form: "φύραμα, ατος, τό", pos: "Noun, Neuter", transliteration: "phurama", phonetic_spelling: "(foo'-ram-ah)", short_definition: "a mass or lump", medium_definition: "a mass or lump, as of bread dough.", long_definition: " from a prolonged form of phuro (to mix a liquid with a solid; perhaps akin to fuw - phuo <a>5453</a> through the idea of swelling in bulk), mean to knead; a mass of dough:--lump." })
NTGreekWord.create({strong_id: 5446, form: "φυσικός, ή, όν", pos: "Adjective", transliteration: "phusikos", phonetic_spelling: "(foo-see-kos')", short_definition: "natural, according to nature", medium_definition: "natural, (a) according to nature, (b) merely animal.", long_definition: " from fusiV - phusis <a>5591</a>." })
NTGreekWord.create({strong_id: 5447, form: "φυσικῶς", pos: "Adverb", transliteration: "phusikós", phonetic_spelling: "(foo-see-koce')", short_definition: "by nature, naturally", medium_definition: "by nature, naturally.", long_definition: " adverb from fusikoV - phusikos <a>5446</a>; \"physically\", i.e. (by implication) instinctively:--naturally." })
NTGreekWord.create({strong_id: 5448, form: "φυσιόω", pos: "Verb", transliteration: "phusioó", phonetic_spelling: "(foo-see-o'-o)", short_definition: "I inflate, puff up", medium_definition: "I inflate, puff up; pass: I am puffed up, arrogant, proud.", long_definition: " from fusiV - phusis <a>5449</a> in the primary sense of blowing; to inflate, i.e. (figuratively) make proud (haughty):--puff up." })
NTGreekWord.create({strong_id: 5449, form: "φύσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "phusis", phonetic_spelling: "(foo'-sis)", short_definition: "nature, inherent nature", medium_definition: "nature, inherent nature, origin, birth.", long_definition: " from fuw - phuo <a>5453</a>; growth (by germination or expansion), i.e. (by implication) natural production (lineal descent); by extension, a genus or sort; figuratively, native disposition, constitution or usage:--(man-)kind, nature(-al)." })
NTGreekWord.create({strong_id: 5450, form: "φυσίωσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "phusiósis", phonetic_spelling: "(foo-see'-o-sis)", short_definition: "a puffing up, pride", medium_definition: "a puffing up, pride, swelling.", long_definition: " from fusiow - phusioo <a>5448</a>; inflation, i.e. (figuratively) haughtiness:--swelling." })
NTGreekWord.create({strong_id: 5451, form: "φυτεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "phuteia", phonetic_spelling: "(foo-ti'-ah)", short_definition: "a plant", medium_definition: "a plant, that which is planted.", long_definition: " from futeuw - phuteuo <a>5452</a>; trans-planting, i.e. (concretely) a shrub or vegetable:--plant." })
NTGreekWord.create({strong_id: 5452, form: "φυτεύω", pos: "Verb", transliteration: "phuteuó", phonetic_spelling: "(foot-yoo'-o)", short_definition: "I plant", medium_definition: "I plant, set.", long_definition: " from a derivative of fuw - phuo <a>5453</a>; to set out in the earth, i.e. implant; figuratively, to instil doctrine:--plant." })
NTGreekWord.create({strong_id: 5453, form: "φύω", pos: "Verb", transliteration: "phuó", phonetic_spelling: "(foo'-o)", short_definition: "I grow, grow up", medium_definition: "I grow, grow up, spring up.", long_definition: " a primary verb; probably originally, to \"puff\" or blow, i.e. to swell up; but only used in the implied sense, to germinate or grow (sprout, produce), literally or figuratively:--spring (up)." })
NTGreekWord.create({strong_id: 5454, form: "φωλεός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "phóleos", phonetic_spelling: "(fo-leh-os')", short_definition: "a burrow, hole", medium_definition: "a burrow, hole, den, lair.", long_definition: " of uncertain derivative; a burrow or lurking-place:--hole." })
NTGreekWord.create({strong_id: 5455, form: "φωνέω", pos: "Verb", transliteration: "phóneó", phonetic_spelling: "(fo-neh'-o)", short_definition: "I crow, shout, summon", medium_definition: "I give forth a sound, hence: (a) of a cock: I crow, (b) of men: I shout, (c) trans: I call (to myself), summon; I invite, address.", long_definition: " from fwnh - phone <a>5456</a>; to emit a sound (animal, human or instrumental); by implication, to address in words or by name, also in imitation:--call (for), crow, cry." })
NTGreekWord.create({strong_id: 5456, form: "φωνή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "phóné", phonetic_spelling: "(fo-nay')", short_definition: "a sound, noise, voice", medium_definition: "a sound, noise, voice, language, dialect.", long_definition: " probably akin to fainw - phaino <a>5316</a> through the idea of disclosure; a tone (articulate, bestial or artificial); by implication, an address (for any purpose), saying or language:--noise, sound, voice." })
NTGreekWord.create({strong_id: 5457, form: "φῶς, φωτός, τό", pos: "Noun, Neuter", transliteration: "phós", phonetic_spelling: "(foce)", short_definition: "light, a source of light", medium_definition: "light, a source of light, radiance.", long_definition: " from an obsolete phao (to shine or make manifest, especially by rays; compare fainw - phaino <a>5316</a>, 5346); luminousness (in the widest application, natural or artificial, abstract or concrete, literal or figurative):--fire, light." })
NTGreekWord.create({strong_id: 5458, form: "φωστήρ, ῆρος, ὁ", pos: "Noun, Masculine", transliteration: "phóstér", phonetic_spelling: "(foce-tare')", short_definition: "a light, brilliancy", medium_definition: "a light, an illuminator, perhaps the sun; a star; brilliancy.", long_definition: " from fwV - phos <a>5457</a>; an illuminator, i.e. (concretely) a luminary, or (abstractly) brilliancy:--light." })
NTGreekWord.create({strong_id: 5459, form: "φωσφόρος, ον", pos: "Adjective", transliteration: "phósphoros", phonetic_spelling: "(foce-for'-os)", short_definition: "light-bearing, radiant, the morning-star", medium_definition: "(lit: light-bearing), radiant, the morning-star.", long_definition: " from fwV - phos <a>5342</a>; light-bearing (\"phosphorus\"), i.e. (specially), the morning-star (figuratively):--day star." })
NTGreekWord.create({strong_id: 5460, form: "φωτεινός, ή, όν", pos: "Adjective", transliteration: "phóteinos", phonetic_spelling: "(fo-ti-nos')", short_definition: "bright, luminous, full of light", medium_definition: "bright, luminous, full of light.", long_definition: " from fwV - phos <a>5457</a>; lustrous, i.e. transparent or well-illuminated (figuratively):--bright, full of light." })
NTGreekWord.create({strong_id: 5461, form: "φωτίζω", pos: "Verb", transliteration: "phótizó", phonetic_spelling: "(fo-tid'-zo)", short_definition: "I illuminate, bring to light", medium_definition: "(a) I light up, illumine, (b) I bring to light, make evident, reveal.", long_definition: " from fwV - phos <a>5457</a>; to shed rays, i.e. to shine or (transitively) to brighten up (literally or figuratively):--enlighten, illuminate, (bring to, give) light, make to see." })
NTGreekWord.create({strong_id: 5462, form: "φωτισμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "phótismos", phonetic_spelling: "(fo-tis-mos')", short_definition: "light, luster, illumination", medium_definition: "light, luster, illumination, enlightenment.", long_definition: " from fwtizw - photizo <a>5461</a>; illumination (figuratively):--light." })
NTGreekWord.create({strong_id: 5463, form: "χαίρω", pos: "Verb", transliteration: "chairó", phonetic_spelling: "(khah'-ee-ro)", short_definition: "I rejoice, am glad", medium_definition: "I rejoice, am glad; also a salutation: Hail.", long_definition: "" })
NTGreekWord.create({strong_id: 5464, form: "χάλαζα, ης, ἡ", pos: "Noun, Feminine", transliteration: "chalaza", phonetic_spelling: "(khal'-ad-zah)", short_definition: "hail", medium_definition: "hail.", long_definition: " a primary verb; to be \"cheer\"ful, i.e. calmly happy or well-off; impersonally, especially as salutation (on meeting or parting), be well:--farewell, be glad, God speed, greeting, hall, joy(- fully), rejoice." })
NTGreekWord.create({strong_id: 5465, form: "χαλάω", pos: "Verb", transliteration: "chalaó", phonetic_spelling: "(khal-ah'-o)", short_definition: "I let down, lower", medium_definition: "I let down, lower, slacken, loosen.", long_definition: " probably from calaw - chalao <a>5465</a>; hail:--hail." })
NTGreekWord.create({strong_id: 5466, form: "Χαλδαῖος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Chaldaios", phonetic_spelling: "(khal-dah'-yos)", short_definition: "a Chaldean", medium_definition: "a Chaldean.", long_definition: " from the base of casma - chasma <a>5490</a>; to lower (as into a void):--let down, strike." })
NTGreekWord.create({strong_id: 5467, form: "χαλεπός, ή, όν", pos: "Adjective", transliteration: "chalepos", phonetic_spelling: "(khal-ep-os')", short_definition: "hard, harsh, fierce", medium_definition: "(a) hard, troublesome, (b) harsh, fierce.", long_definition: " probably of Hebrew or (Kasdiy <a>3778</a>; a Chaldoean (i.e. Kasdi), or native or the region of the lower Euphrates:--Chaldaean." })
NTGreekWord.create({strong_id: 5468, form: "χαλιναγωγέω", pos: "Verb", transliteration: "chalinagógeó", phonetic_spelling: "(khal-in-ag-ogue-eh'-o)", short_definition: "I bridle, curb", medium_definition: "I bridle, curb, restrain, sway.", long_definition: " perhaps from calaw - chalao <a>5465</a> through the idea of reducing the strength; difficult, i.e. dangerous, or (by implication) furious:--fierce, perilous." })
NTGreekWord.create({strong_id: 5469, form: "χαλινός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "chalinos", phonetic_spelling: "(khal-ee-nos')", short_definition: "a bridle", medium_definition: "a bridle, bit.", long_definition: " from a compound of calinoV - chalinos <a>71</a>; to be a bit-leader, i.e. to curb (figuratively):--bridle." })
NTGreekWord.create({strong_id: 5470, form: "χάλκοῦς, ῆ, οῦν", pos: "Adjective", transliteration: "chalkous", phonetic_spelling: "(khal'-keh-os)", short_definition: "made of bronze", medium_definition: "made of bronze, bronze, brass.", long_definition: " from calaw - chalao <a>5465</a>; a curb or head-stall (as curbing the spirit):--bit, bridle." })
NTGreekWord.create({strong_id: 5471, form: "χαλκεύς, έως, ὁ", pos: "Noun, Masculine", transliteration: "chalkeus", phonetic_spelling: "(khalk-yooce')", short_definition: "a worker in brass or copper", medium_definition: "a worker in brass or copper; a smith.", long_definition: " from calkoV - chalkos <a>5475</a>; coppery:--brass." })
NTGreekWord.create({strong_id: 5472, form: "χαλκηδών, όνος, ὁ", pos: "Noun, Masculine", transliteration: "chalkédón", phonetic_spelling: "(khal-kay-dohn')", short_definition: "chalcedony", medium_definition: "chalcedony, a small stone of various colors.", long_definition: " from calkoV - chalkos <a>5475</a>; a copper-worker or brazier:--coppersmith." })
NTGreekWord.create({strong_id: 5473, form: "χαλκίον, ου, τό", pos: "Noun, Neuter", transliteration: "chalkion", phonetic_spelling: "(khal-kee'-on)", short_definition: "a bronze vessel", medium_definition: "a bronze vessel, brazen utensil.", long_definition: " from calkoV - chalkos <a>1491</a>; copper-like, i.e. \"chalcedony\":--chalcedony." })
NTGreekWord.create({strong_id: 5474, form: "χαλκολίβανον, ου, τό", pos: "Noun, Neuter", transliteration: "chalkolibanon", phonetic_spelling: "(khal-kol-ib'-an-on)", short_definition: "orichalcum, or frankincense of a yellow color", medium_definition: "orichalcum, a fine metal, or frankincense of a yellow color.", long_definition: " diminutive from calkoV - chalkos <a>5475</a>; a copper dish:--brazen vessel." })
NTGreekWord.create({strong_id: 5475, form: "χαλκός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "chalkos", phonetic_spelling: "(khal-kos')", short_definition: "copper, brass, money", medium_definition: "copper, brass, money; a brazen musical instrument.", long_definition: " neuter of a compound of calkoV - chalkos <a>3030</a> (in the implied mean of whiteness or brilliancy); burnished copper, an alloy of copper (or gold) and silver having a brilliant lustre:--fine brass." })
NTGreekWord.create({strong_id: 5476, form: "χαμαί", pos: "Adverb", transliteration: "chamai", phonetic_spelling: "(kham-ah'-ee)", short_definition: "on or to the ground", medium_definition: "on or to the ground.", long_definition: " perhaps from calaw - chalao <a>5465</a> through the idea of hollowing out as a vessel (this metal being chiefly used for that purpose); copper (the substance, or some implement or coin made of it):--brass, money." })
NTGreekWord.create({strong_id: 5477, form: "Χαναάν, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Chanaan", phonetic_spelling: "(khan-ah-an')", short_definition: "Canaan", medium_definition: "Canaan, the whole of Palestine or Palestine west of the river Jordan.", long_definition: " adverb perhaps from the base of casma - chasma <a>5490</a> through the idea of a fissure in the soil; earthward, i.e. prostrate:--on (to) the ground." })
NTGreekWord.create({strong_id: 5478, form: "Χαναναῖος, αία, αῖον", pos: "Adjective", transliteration: "Chananaios", phonetic_spelling: "(khan-ah-an-ah'-yos)", short_definition: "Canaanite", medium_definition: "Canaanite, a Biblical and archaic name for Phoenician.", long_definition: " of Hebrew origin (Kna`an <a>3667</a>; Chanaan (i.e. Kenaan), the early name of Palestine:--Chanaan." })
NTGreekWord.create({strong_id: 5479, form: "χαρά, ᾶς, ἡ", pos: "Noun, Feminine", transliteration: "chara", phonetic_spelling: "(khar-ah')", short_definition: "joy, gladness", medium_definition: "joy, gladness, a source of joy.", long_definition: " from Canaan - Chanaan <a>5477</a>; a Chanaanoean (i.e. Kenaanite), or native of gentile Palestine:--of Canaan." })
NTGreekWord.create({strong_id: 5480, form: "χάραγμα, ατος, τό", pos: "Noun, Neuter", transliteration: "charagma", phonetic_spelling: "(khar'-ag-mah)", short_definition: "sculpture, a stamp, sign", medium_definition: "sculpture; engraving, a stamp, sign.", long_definition: " from cairw - chairo <a>5463</a>; cheerfulness, i.e. calm delight:--gladness, X greatly, (X be exceeding) joy(-ful, -fully, -fulness, -ous)." })
NTGreekWord.create({strong_id: 5481, form: "χαρακτήρ, ῆρος, ὁ", pos: "Noun, Masculine", transliteration: "charaktér", phonetic_spelling: "(khar-ak-tare')", short_definition: "an exact reproduction", medium_definition: "an impression, representation, exact reproduction; a graving-tool.", long_definition: " from the same as carax - charax <a>5482</a>; a scratch or etching, i.e. stamp (as a badge of servitude), or scupltured figure (statue):--graven, mark." })
NTGreekWord.create({strong_id: 5482, form: "χάραξ, ακός, ὁ", pos: "Noun, Masculine", transliteration: "charax", phonetic_spelling: "(khar'-ax)", short_definition: "a mound for besieging", medium_definition: "a palisade, mound for besieging.", long_definition: " from the same as carax - charax <a>5482</a>; a graver (the tool or the person), i.e. (by implication) engraving ((\"character\"), the figure stamped, i.e. an exact copy or (figuratively) representation):--express image." })
NTGreekWord.create({strong_id: 5483, form: "χαρίζομαι", pos: "Verb", transliteration: "charizomai", phonetic_spelling: "(khar-id'-zom-ahee)", short_definition: "I show favor to, forgive", medium_definition: "(a) I show favor to, (b) I pardon, forgive, (c) I show kindness.", long_definition: " from charasso (to sharpen to a point; akin to grafw - grapho <a>1125</a> through the idea of scratching); a stake, i.e. (by implication) a palisade or rampart (military mound for circumvallation in a siege):--trench." })
NTGreekWord.create({strong_id: 5484, form: "χάριν", pos: "Adverb", transliteration: "charin", phonetic_spelling: "(khar'-in)", short_definition: "on account of", medium_definition: "for the sake of, by reason of, on account of.", long_definition: " middle voice from cariV - charis <a>5485</a>; to grant as a favor, i.e. gratuitously, in kindness, pardon or rescue:--deliver, (frankly) forgive, (freely) give, grant." })
NTGreekWord.create({strong_id: 5485, form: "χάρις, ιτος, ἡ", pos: "Noun, Feminine", transliteration: "charis", phonetic_spelling: "(khar'-ece)", short_definition: "grace, favor, kindness", medium_definition: "(a) grace, as a gift or blessing brought to man by Jesus Christ, (b) favor, (c) gratitude, thanks, (d) a favor, kindness.", long_definition: " accusative case of cariV - charis <a>5485</a> as preposition; through favor of, i.e. on account of:--be-(for) cause of, for sake of, +...fore, X reproachfully." })
NTGreekWord.create({strong_id: 5486, form: "χάρισμα, ατος, τό", pos: "Noun, Neuter", transliteration: "charisma", phonetic_spelling: "(khar'-is-mah)", short_definition: "an undeserved favor", medium_definition: "a gift of grace, an undeserved favor.", long_definition: " from cairw - chairo <a>5463</a>; graciousness (as gratifying), of manner or act (abstract or concrete; literal, figurative or spiritual; especially the divine influence upon the heart, and its reflection in the life; including gratitude):--acceptable, benefit, favour, gift, grace(- ious), joy, liberality, pleasure, thank(-s, -worthy)." })
NTGreekWord.create({strong_id: 5487, form: "χαριτόω", pos: "Verb", transliteration: "charitoó", phonetic_spelling: "(khar-ee-to'-o)", short_definition: "I favor, bestow freely on", medium_definition: "I favor, bestow freely on.", long_definition: " from carizomai - charizomai <a>5483</a>; a (divine) gratuity, i.e. deliverance (from danger or passion); (specially), a (spiritual) endowment, i.e. (subjectively) religious qualification, or (objectively) miraculous faculty:--(free) gift." })
NTGreekWord.create({strong_id: 5488, form: "Χαρράν, ἡ", pos: "Proper Noun, Indeclinable", transliteration: "Charran", phonetic_spelling: "(khar-hran')", short_definition: "Haran", medium_definition: "Haran.", long_definition: " from cariV - charis <a>5485</a>; to grace, i.e. indue with special honor:--make accepted, be highly favoured." })
NTGreekWord.create({strong_id: 5489, form: "χάρτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "chartés", phonetic_spelling: "(khar'-tace)", short_definition: "papyrus, paper", medium_definition: "papyrus, paper.", long_definition: " of Hebrew origin (Charan <a>2771</a>; Charrhan (i.e. Charan), a place in Mesopotamia:--Charran." })
NTGreekWord.create({strong_id: 5490, form: "χάσμα, ατος, τό", pos: "Noun, Neuter", transliteration: "chasma", phonetic_spelling: "(khas'-mah)", short_definition: "a gap, gulf, chasm", medium_definition: "a gap, gulf, chasm.", long_definition: " from the same as carax - charax <a>5482</a>; a sheet (\"chart\") of writing-material (as to be scribbled over):--paper." })
NTGreekWord.create({strong_id: 5491, form: "χεῖλος, ους, τό", pos: "Noun, Neuter", transliteration: "cheilos", phonetic_spelling: "(khi'-los)", short_definition: "a lip, mouth, shore", medium_definition: "a lip, mouth, shore, edge, brink; meton: language, dialect.", long_definition: " from a form of an obsolete primary chao (to \"gape\" or \"yawn\"); a \"chasm\" or vacancy (impassable interval):--gulf." })
NTGreekWord.create({strong_id: 5492, form: "χειμάζομαι", pos: "Verb", transliteration: "cheimazó", phonetic_spelling: "(khi-mad'-zo)", short_definition: "I am storm-tossed", medium_definition: "I am storm-tossed.", long_definition: " from a form of the same as casma - chasma <a>5490</a>; a lip (as a pouring place); figuratively, a margin (of water):--lip, shore." })
NTGreekWord.create({strong_id: 5493, form: "χείμαρρος, ου, ὁ", pos: "Noun, Masculine", transliteration: "cheimarros", phonetic_spelling: "(khi'-mar-hros)", short_definition: "a winter torrent", medium_definition: "a storm-brook, a winter torrent.", long_definition: " from the same as ceimwn - cheimon <a>5494</a>; to storm, i.e. (passively) to labor under a gale:--be tossed with tempest." })
NTGreekWord.create({strong_id: 5494, form: "χειμών, ῶνος, ὁ", pos: "Noun, Masculine", transliteration: "cheimón", phonetic_spelling: "(khi-mone')", short_definition: "a tempest, the rainy season", medium_definition: "a storm, tempest; winter, the rainy season.", long_definition: " from the base of ceimwn - cheimon <a>4482</a>; a storm-runlet, i.e. winter-torrent:--brook." })
